INSERT INTO `tb_ocorrencia` (`incidente`, `criado`, `resolucao`, `descricao_problema`, `descricao_solucao`, `fk_grupo_designado`, `fk_ic`, `fk_prioridade`, `fk_sumario`, `registro_base`) VALUES
('INC000001580285', '2018-01-02 08:07:03', '2018-01-02 08:19:12', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Servidor DF7562SR857&#10;Atuação: Verificar Distribuidor Sondas&#10;&#10;Descrição: Informamos que a aplicação que processa os arquivos de sondas (DISTRIBUIDOR DE SONDAS TI) do servidor DF7562SR857 não está processando, com isso ocorrendo a inconsistência de dados nas páginas  do Canal Online.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1818', 'Inconscitênia encontrada e tratada com sucesso!', 4, 160, 1, 34, '2018-05-08 08:16:35'),
('INC000001581287', '2018-01-03 00:48:00', '2018-01-03 01:07:04', 'CEPTISP_Se3/1.28_CEXE_GEMALTO_FILE-TRANS_EBT_&#60;OCO841290-CVP4448592202&#62;', 'Circuito down, abertura de chamado junto a operadora.', 7, 93, 2, 508, '2018-05-08 08:16:35'),
('INC000001582569', '2018-01-02 08:29:47', '2018-01-02 09:46:27', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Servidor DF7562SR857&#10;Atuação: Verificar Distribuidor Sondas&#10;&#10;Descrição: Foi identificado que aplicação de distribuição de Sondas TI do servidor DF7562SR857 encontra-se travada.', 'Prezados(As),&#10;&#10;Informamos que o processo voltou a normalidade.', 4, 225, 1, 34, '2018-05-08 08:16:35'),
('INC000001582570', '2018-01-02 09:07:27', '2018-01-02 13:00:59', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Fila CONTRATO_HABITACAO com 5,8% de AB1', 'Informamos que, após diversos testes pelo 3004 1105, as ligações recebidas em SP foram atendidas normalmente. Observamos, no entanto, que CERATSP não possui agentes disponíveis e com alto enfileiramento de chamadas, com tempo médio de espera de 01min44seg. Por falta de operadores disponíveis, os clientes estão sujeitos a abandonarem as ligações em qualquer um dos 5 intervalos, e isso inclui o primeiro intervalo (ab1). Sugerimos que sejam alocados na CERATSP mais operadores para atendimento, de modo que não haja filas, a fim de diminuir o alto índice de abandonos inclusive de AB1. Segue em anexo print comprobatório, que evidencia que não há nenhum agente disponível para atendimento, gerando assim o cenário de filas.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001604741', '2018-01-01 04:03:32', '2018-01-01 04:40:12', 'MON 01 JAN, 2018 -04=03=28&#10;SPTSROCO1 - A INTERFACE&#10;NOME= 0 GIGABITETHERNET1/0/15&#10;DESC= BKB_C-SPTSROCO1-G1/0/15«=»PARSBLM5_G0/3_LV3_«500012799»&#10;IP=192.168.254.214 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Conforme verificado, o circuito encontra-se operacional Ocorreram oscilações', 10, 129, 1, 624, '2018-05-08 08:16:35'),
