('INC000001605222', '2018-01-02 14:35:51', '2018-01-02 16:47:26', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão em todos módulos de Serviço. &#10;&#10;- Data Início: 02/01/2018                                                 &#10;- Hora Início: 14:20&#10;&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR&#10;J.C.D.B.', 'Ambiente normalizado.&#10;&#10;Por favor, realize limpeza de cache nos navegadores (ctrl+shift+del) , logout e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001605256', '2018-01-03 15:48:35', '2018-01-03 16:57:26', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila FGTS o AB1 de 8,7%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Segue o fechamento, com anexo:&#10;&#10;Informamos que revisamos as configurações da fila FGTS na CERATSA e não encontramos falhas. No entanto, observamos que CERATSA não possui agentes disponíveis e está com tempo médio de atendimento de espera de 18 segundos. Por falta de operadores disponíveis, os clientes estão sujeitos a abandonarem as ligações em qualquer um dos 5 intervalos, e o primeiro intervalo está incluso nesse cenário (AB1). Sugerimos que sejam alocados operadores para atendimento na CERATSA, de modo que não haja filas no atendimento, a fim de diminuir o índice de abandonos inclusive de AB1. Segue em anexo print comprobatório, evidenciando que não há nenhum operador disponível para atendimento, gerando o cenário de filas.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001605259', '2018-01-03 16:06:52', '2018-01-03 17:09:52', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila PROGRAMAS_SOCIAIS o AB1 de 8,1%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila PROGRAMAS_SOCIAIS – MCDU 8125 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis para atender a fila PROGRAMAS_SOCIAIS (segue anexo print com evidencia), gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001605260', '2018-01-03 16:28:23', '2018-01-03 17:23:30', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila SEGURO_DESEMPREGO o AB1 de 8,1%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila SEGURO_DESEMPREGO – MCDU 8085 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis para atender a fila SEGURO_DESEMPREGO, gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001605787', '2018-01-04 11:45:13', '2018-01-04 15:25:15', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicitamos verificação do sistema, visto que está extremamente lento e travando constantemente.&#10;&#10;&#10;Aguardo e agradeço', 'Após falha na mudança de ontem no servidor de banco CCTDCDADLX0003 , foi necessário o restart  geral no sistema GSC (servicos.caixa) para normalização.', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001605907', '2018-01-02 11:39:58', '2018-01-02 11:47:18', 'Totems da AG Joao Negrao fora ar. Necessita restart da aplicação URGENTE. Obs: Ambiente de PRD piloto (só a Joao Negrao). Att GITEC/CT', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Restart realizado com sucesso&#10;[domain@cctdcapllx0120.df.caixa:9999 /] /server-group=SIPNL:restart-servers&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; undefined,&#10;    &#34;server-groups&#34; =&#62; undefined&#10;}', 6, 244, 3, 385, '2018-05-08 08:16:35'),
('INC000001605908', '2018-01-02 11:51:42', '2018-01-02 13:33:37', 'Atualizei matérias do Jornal da Caixa e também matérias em destaque na home da intranet por volta de 10h27 e e até agora as alterações não são visualizadas na home. Na tela de erro anexa mostra as matérias que foram alteradas há mais de uma hora.', 'Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas;&#10;&#10;Informamos que identificamos no Titulo do Conteúdo Home tinha uma letra “c” a mais como mostra o arquivo em anexo, por isso que a noticia não aparecia em destaque após a publicação por isso não atualizava a Home.', 2, 71, 2, 597, '2018-05-08 08:16:35'),
('INC000001606001', '2018-01-02 10:40:20', '2018-01-02 11:59:35', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: OPERACOES_CREDITO&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: OPERACOES_CREDITO 11,3% &#10;·  Início da Ocorrência: 10:30', 'Prezados,&#10;&#10;Informamos que, após nova análise, reiteramos que não há falha de telefonia no ambiente da CERATSA. Observamos, novamente, menor número de operadores disponíveis nessa CERATSA em vários momentos, sendo que no momento há 33 operadores com skill para atendimento dessa Fila e todos ocupados. Quando não há operadores disponíveis, a tendência é que os clientes desistam das chamadas em qualquer dos intervalos (isso inclui o primeiro intervalo). Isso significa que abandono no primeiro intervalo não é indicativo de falha no ambiente a não ser em grande quantidade, o que não é o caso.&#10;&#10;Observamos também as configurações da fila OPERACOES_CREDITO com a fila COMERCIAL_CLIENTE, que também é oriunda de URA Comercial, e constatamos que ambas utilizam o mesmo método de transferência (transit number), o mesmo meio e a mesma configuração de MLHG (anúncio), o que descarta mais uma vez falha no ambiente.&#10;&#10;No entanto, observamos que a volumetria de ligações de OPERACOES_CREDITO na CERATSA não é elevada, e diante do fato de ainda assim não haver disponibilidade de agentes disponíveis para atendimento, a tendência é que a quantidade de ligações abandonadas no primeiro intervalo, em comparação com as recebidas, acabe sendo mais expressiva.&#10;&#10;A sugestão para a resolução de abandono no primeiro intervalo é que a CERATSA aloque mais operadores para atender as ligações, de modo que ocorra menos chance dos clientes desistirem das chamadas, conforme já exposto nos outros incidentes (INC000001458753). Seguem anexo Relatório Técnico e Relatório extraído do Manager do OSCC da CERATSA evidenciando a falta de operadores disponíveis na CERATSA e evidenciando duas chamadas abandonadas no primeiro intervalo que foram finalizadas com evento de Normal Clearing, ou seja, evento normal de desconexão de chamada.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001606003', '2018-01-02 13:39:11', '2018-01-02 13:52:18', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Servidor DF7562SR857&#10;Atuação: Verificar Distribuidor Sondas&#10;&#10;Descrição: Informamos que a aplicação que processa os arquivos de sondas (DISTRIBUIDOR DE SONDAS TI) do servidor DF7562SR857 não está processando, com isso ocorrendo a inconsistência de dados nas páginas  do Canal Online.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1818', 'Prezados,&#10;&#10;Informo que a situação foi regularizada.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Fabiano Barbosa', 4, 139, 1, 34, '2018-05-08 08:16:35'),
('INC000001606023', '2018-01-03 10:16:04', '2018-01-03 11:17:17', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: SOLICITO ATUALIZAÇÃO DA BASE DE DADOS DO GSC - EMPRESA DATADIVI - CONTRATO 0338/2013, ONDE OS CHAMADOS JA ENCERRADOS CONTINUAM COM STATUS DE &#34;EM ANDAMENTO&#34;.&#10; &#10;CHAMADO&#9;                     RAT&#10;WO0000023119955          2880733&#10;WO0000023143476          2882036', 'Prezado(a) usuário(a),&#10;&#10;Informamos que os chamados listados foram concluídos corretamente pela DATADIVI. Após receberem a conclusão do fornecedor, retornaram para o grupo de triagem.&#10;&#10;Para alterar essa regra, favor entrar em contato com a equipe CAIXA CETEC84.&#10;&#10;Atenciosamente,&#10;   Thiago Cavalcante&#10;   Equipe Sustentação GSC', 8, 58, 1, 573, '2018-05-08 08:16:35'),
