('INC000001626132', '2018-01-03 11:15:04', '2018-01-03 14:12:38', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com extrema lentidão no que tange os módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data Início: 03/01/2018                                                 &#10;- Hora Início: 11:00&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Ambiente normalizado.&#10;&#10;Por favor, realize limpeza de cache nos navegadores (ctrl+shift+del) , logout e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001626157', '2018-01-04 10:44:59', '2018-01-04 14:34:54', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGDB&#10;Atuação: Arquivos não Disponibilizados&#10;&#10;Descrição: A Página http://aplicativos.cetec.df.caixa/Pages/Web/Gestao/SIGDB/TransmissaoArquivo.aspx, não foi identificado os arquivos do SIGDB do dia de hoje, 04/01/2018, no controle de transmissão de arquivos SIGDB.', '', 5, 336, 1, 34, '2018-05-08 08:16:35'),
('INC000001626201', '2018-01-02 14:19:29', '2018-01-02 17:39:07', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Fila ACOES_ONLINE com 6,2% de AB1', 'Prezado,&#10;&#10;Informamos que em durante analise no atendimento Ações On Line  e foram realizados testes pelo 3004 1105 onde observamos que no período da tarde as  ligações recebidas em SP foram atendidas normalmente.&#10;&#10;Observamos que no período onde ocorreu o volume de ligações abandonadas a CERATSP estava com baixo volume de agentes disponíveis e enfileiramento de chamadas, atingindo tempo médio espera de até 00:30seg. Pela falta de operadores disponíveis, os clientes estão sujeitos a abandonarem as ligações em qualquer dos intervalos, e isso inclui o primeiro intervalo (ab1). &#10;&#10;Informamos que com um fator adicional ao cenário, a fila ACOES_ONLINE está em produção utilizando o recurso de Network e habilitado os critérios de aceitação e distribuição em rede.  &#10;&#10;Sugerimos que sejam alocados na CERATSP mais operadores para atendimento, de modo que não haja filas, a fim de diminuir o  índice de abandonos inclusive de AB1.&#10;&#10;Segue em anexo prints  com evidencias que não agente disponível para atendimento, gerando assim o cenário de fila.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001626221', '2018-01-03 10:01:44', '2018-01-03 11:11:30', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Servidor DF7562SR857&#10;Atuação: Verificar Distribuidor Sondas&#10;&#10;Descrição: Prezados,&#10;&#10;Inforamos que o processo MODULO PAGADOR do PROCESSO SAA da aplicação DISTRUIDOR DE SONDAS TI está processamento que enorme lentidão. &#10;Ressaltamos que devido a inconsistência a aplicação IMPORTA SONDAS que se encontra no servidor df7562sr824 também fica com lentidão para processar as sondas recebidas acarretando na desatualição das páginas que são alimentadas por essasa aplicações.&#10;&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'Prezado,&#10;&#10;Informo que a situação foi regularizada.&#10;&#10;Atenciosamente,&#10;&#10;Fabiano Barbosa&#10;CETEC - Gestão de Informações', 4, 139, 1, 34, '2018-05-08 08:16:35'),
('INC000001626224', '2018-01-03 11:22:49', '2018-01-03 12:14:40', 'Está ocorrendo erro que impede aos usuários usar o SIMJE em produção.&#10;No firefox é apresentada tela &#34;Redirecionamento incorreto&#34;, conforme imagem anexa, depois que o usuário tenta logar no sistema.&#10;No Internet Firefox na tela de login é apresentada mensagem de que há erro com o certificado antes mesmo de apresentar a tela de login (ver outra figura em anexo) e depois que o usuário decide continuar e efetuar o login o sistema fica travado na tela de login aguardando resposta do servidor, o que não ocorre.&#10;Não foi possível avaliar o log da aplicação pois ele não está sendo disponibilizado na ferramenta http://jbosslogs.proinfo.caixa.&#10;Solicitamos identificar e corrigir a causa do problema, bem como disponibilizar o log de produção.', '“Prezado (a) Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;1 -) Informamos que a aplicação encontra-se disponivél conforme evidencias em anexos.&#10;&#10;2 -) Informamos que o mensagem refente ao certificado é uma mensagem normal de primeiro acesso a aplicação no navegador, no caso do internet explorer é necessario clicar em  (Continuar neste site (Não recomendado)).&#10;&#10;Att', 2, 327, 3, 588, '2018-05-08 08:16:35'),
('INC000001626508', '2018-01-02 23:00:51', '2018-01-02 23:31:02', 'TUE 02 JAN, 2018 -23=00=48&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO MS7438SW106&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITEC/CG_AV_MATO_GROSSO_5500_CAMPO_GRANDE-MS&#10;      CONTATO - GITEC/CG_67_4009_9670&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING', 10, 151, 1, 151, '2018-05-08 08:16:35'),
('INC000001626516', '2018-01-03 05:58:21', '2018-01-03 06:36:11', 'WED 03 JAN, 2018 -05=57=05&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO PA7434SW103&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITECBE_32112100&#10;      CONTATO - GITECBE_32112100&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING', 10, 153, 1, 157, '2018-05-08 08:16:35'),
('INC000001627111', '2018-01-03 11:33:57', '2018-01-03 12:37:00', 'O gerenciadordeatendimento.caixa está apresentando erro ao conectar com a base de dados:&#10;javax.ejb.EJBTransactionRolledbackException: org.hibernate.exception.JDBCConnectionException: Conexão Fechada&#10;Favor verificar.', '“Prezado (a) informamos que já iniciamos o atendimento desta demanda e a mesma poderá ser acompanhada por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;&#10;Foi necessario realizar o restart da aplicação, novas coneões estavam bloqueadas&#10;&#10;&#10;Att', 2, 244, 3, 385, '2018-05-08 08:16:35'),
('INC000001627121', '2018-01-03 13:36:16', '2018-01-03 14:46:35', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: SOLICITO ATUALIZAÇÃO DA BASE DE DADOS DO GSC - EMPRESA DATADIVI - CONTRATO 0338/2013, ONDE OS CHAMADOS JA ENCERRADOS CONTINUAM COM STATUS DE &#34;EM ANDAMENTO&#34;.&#10; &#10;CHAMADO&#9;                     RAT&#10;WO0000023119955          2880733&#10;WO0000023143476          2882036&#10;&#10;&#10;CHAMADO REABERTO POIS O CHAMADO ANTERIOR FOI ENCERRADO E O PROBLEMA NÃO FOI RESOLVIDO.', 'Prezado(a) usuário(a),&#10;&#10;Conforme informado anteriormente, não houve erro técnico nos chamados listados.&#10;&#10;Os chamados receberam as conclusões do fornecedor DATADIVI/Rat.Sistemas corretamente.&#10;&#10;Ocorre que os chamados haviam passado por um grupo de triagem, e após serem concluídos, voltaram para esse grupo.&#10;&#10;Essa é a regra definida pela CAIXA.&#10;&#10;Para alterar a regra, favor entrar em contato com a equipe CETEC84.&#10;&#10;Atenciosamente,&#10;   Thiago Cavalcante&#10;   Equipe Sustentação GSC', 8, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001627128', '2018-01-03 17:37:42', '2018-01-03 18:38:00', 'Informamos o recebimento de alto volume de acionamentos de usuários recebidos no Canal Service Desk, a respeito do erro Sem comunicação TFGR 024, no canal lotérico.&#10;&#10;Seguem alguns acionamentos que exemplificam as requisições recebidas até o momento no Canal:&#10;&#10;REQ000023002594 - MT&#10;REQ000023003219 - MG&#10;REQ000023003244  - RJ&#10;REQ000023002999  MT', 'Conforme contato com Marcos Paulo Barbosa das Chagas o mesmo informa que UL encontram-se normalizadas.', 10, 132, 3, 596, '2018-05-08 08:16:35'),
