('INC000001628365', '2018-01-03 09:17:04', '2018-01-03 10:34:30', 'WED 03 JAN, 2018 -09=14=53&#10;CREXTRRR002 - A INTERFACE&#10;NOME= 0 SE1/7&#10;DESC= CEPTIRJ_CREXTRRR002_SE1/7_CEXC_JF-SE_CONSULTA-PROCESSOS_OI_1MB_«&#10;IP=172.29.139.1 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Vide notas', 7, 91, 1, 44, '2018-05-08 08:16:35'),
('INC000001628504', '2018-01-03 10:16:05', '2018-01-03 11:07:14', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila OPERACOES_CREDITO está com a taxa de AB1 de 8,0%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme já informado em chamados anteriores INC000001537231, INC000001533736, INC000001472213, INC000001513844, INC000001491336, INC000001472213, INC000001458753 e INC000001458969, verificamos as configurações da fila OPERACOES_CREDITO – MCDU 8116 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV com as configurações da fila COMERCIAL_CLIENTES (que utiliza os mesmos recursos), e não encontramos divergências de configurações. No entanto, temos reforçado que a CERATSA nem sempre possui agentes disponíveis para atender a fila OPERACOES_CREDITO (segue anexo print demonstrando isso mais uma vez), gerando enfileiramento de chamadas. Quando ocorre enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos, mais uma vez, como TODOS os incidentes abertos anteriormente, que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir. Segue em anexo evidencias do dia 03-01-18 (hoje) apontando todos os agentes em atendimento, sem operador disponível.', 9, 172, 1, 144, '2018-05-08 08:16:35');
