('INC000001628519', '2018-01-04 11:04:37', '2018-01-04 14:30:24', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: OPERACOES_CREDITO&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: OPERACOES_CREDITO 9,6% &#10;·  Início da Ocorrência: 11:00', 'Conforme solicitado verificamos as configurações da fila OPERACOES_CREDITO – MCDU 8116 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis para atender a fila OPERACOES_CREDITO (segue anexo print com evidencia), gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
