('INC000001628887', '2018-01-03 20:01:45', '2018-01-03 20:29:23', 'WED 03 JAN, 2018 -19=59=34&#10;CSEXTRRR004 - A INTERFACE&#10;NOME= 0 SE4/0&#10;DESC= CEPTISP_SE4/0_CEXE_SAGENORGA_FILE-TRANS_EBT_128KB_«TTESGOCOASDPA&#10;IP=172.30.127.17 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Após oscilação circuito retornou a responder a teste de PING.', 10, 342, 1, 59, '2018-05-08 08:16:35'),
