('INC000001629518', '2018-01-04 09:53:48', '2018-01-04 11:25:00', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com extrema lentidão no que tange os módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data Início: 04/01/2018                                                 &#10;- Hora Início: 09:20&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezada&#10;&#10;1 - Foi analisado todo a base e não foi constatado lentidão extrema aparente, fizemos a navegação nos módulos informados e não foi constatado lentidão, o funcionamento dos mesmos ocorreu normalmente&#10;2 - À disposição&#10;&#10;Atenciosamente&#10;Equipe de Sustentação - GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
