('INC000001629809', '2018-01-04 11:56:16', '2018-01-04 14:28:34', 'THU 04 JAN, 2018 -11=54=02&#10;CSEXTRRR002 - A INTERFACE&#10;NOME= 0 SE6/3&#10;DESC= CEPTISP_SE6/3_CEXC_EMBRATEL_FILE-TRANS_EBT_«OCO_LK_RJOAM_DHP_000&#10;IP=172.30.0.161 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Incidente relacionado a WO0000023224163. Em tratativa com a operadora.', 10, 92, 1, 55, '2018-05-08 08:16:35'),
('INC000001630409', '2018-01-04 14:51:09', '2018-01-04 15:56:53', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão&#10;&#10;Números Afetados: CIDADÂO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila FGTS  está com a taxa de AB1 de 8,7%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila FGTS – MCDU 8003 na CERAT-SA, bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis para atender a fila FGTS (segue anexo print com evidencia), gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações perdidas, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir.', 9, 172, 1, 144, '2018-05-08 08:16:35'),
('INC000001630443', '2018-01-05 09:45:28', '2018-01-05 10:19:50', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: a estação de trabalho de serie PE0015TJ0 e nome logico MA7052ET211 não está cadastrada - usuário tenta abrir chamado porque máquina está fora do dominio, mas não consegue.', 'Prezada Ana Raquel,&#10;&#10;Informamos que a estação de trabalho n/s: PE015TJ0 foi cadastrada no CMDB em 10/11/2015 07:44:10.&#10;&#10;Realizamos atualização no cadastro do ativo.&#10;&#10;À disposição para mais informações.&#10;&#10;Atenciosamente,&#10;&#10;Equipe Conformidade SIGSC.', 20, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001630466', '2018-01-06 05:47:32', '2018-01-06 06:09:01', 'BKB_C-SPRSCAS5-P5/0&#60;=&#62;SPRRSPO9_P6/0_TIM_&#60;CASSPOCPL020444&#62;', 'SERVIÇO CONTINGENCIADO', 7, 128, 2, 496, '2018-05-08 08:16:35'),
('INC000001630468', '2018-01-06 10:58:05', '2018-01-06 13:55:15', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Fila FGTS com 9,1% de AB1', 'Informamos que observamos um aumento na volumetria de ligações período da manhã ,em comparação com mesmo dia nas semanas anteriores.&#10;Verificamos as configurações da fila FGTS e não encontramos falha, a seguir realizamos testes em determinados intervalos, onde ficamos em espera e fomos atendidos, mas, com tempo de espera em torno de 40 segundos até 1 minuto. Observamos falta de operadores disponíveis para o atendimento da Fila FGTS na CERATSP, desta forma, os clientes estão sujeitos a abandonarem as ligações em qualquer um dos 4 intervalos, sendo que no primeiro intervalo (AB1)  está incluso neste cenário.&#10;Sugerimos que sejam alocados operadores para atendimento na fial FGTS da CERATSP, de modo que não haja filas no atendimento, a fim de diminuir o índice de abandonos.&#10;Segue anexo prints evidenciando a falta de operadores disponíveis e testes de atendimento.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001630603', '2018-01-04 14:52:11', '2018-01-04 16:55:45', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão&#10;&#10;Números Afetados: CIDADÂO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila SEGURO_DESEMPREGO está com a taxa de AB1 de 8,5%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme PRINT DO RELATORIO DE USUÁRIOS abaixo verificamos as configurações da fila SEGURO_DESEMPREGO – MCDU 8085 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis para atender a fila SEGURO_DESEMPREGO, gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir. Verificamos que esse cenário indica em muitos casos desistência do usuário com o evento do CANCEL conforme podemos observar no call flow de algumas chamadas de amostragem e analisadas no SBC – CAIXA.', 9, 172, 1, 144, '2018-05-08 08:16:35'),
('INC000001630604', '2018-01-04 15:02:35', '2018-01-04 18:30:17', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: TIM_MULTIBANK&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATBR:&#10;·  FILA: TIM_MULTIBANK 8,33% &#10;·  Início da Ocorrência: 14:00', 'Após verificação constatamos que as ocorrências de AB1 na fila TIM_MULTIBANK são decorrentes de desconexão pela operadora durante o processo de transferência das chamadas da URA para a respectiva fila. Segue em anexo evidência.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001630626', '2018-01-05 11:38:56', '2018-01-05 15:42:44', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila STE_SOCIAL_PJ está com a taxa de AB1 de 8,2%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 18, 320, 1, 144, '2018-05-08 08:16:35'),
('INC000001630627', '2018-01-05 11:55:29', '2018-01-05 14:56:01', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila STE_CONVENIO_COBRANCA_PJ está com a taxa de AB1 de 9,8%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Após analise verificamos que o aumento  de AB1 nas filas do STE ocorreu devido a uma falha de CSTA entre o servidor OSV e OSCC da localidade em função do aumento do consumo de memória na Vmware do OSV Pool 01 correspondente ao ambiente da CERAT-SP ocasionando erro 503 Service Unavialabel.  Realizamos procedimento na maquina virtual e em seguida testes no ambiente e constatamos a normalidade.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001630630', '2018-01-05 12:09:13', '2018-01-05 15:39:50', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: SAC: 0800 726 0101&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila HABITACAO  está com a taxa de AB1 de 8,1%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 18, 320, 2, 144, '2018-05-08 08:16:35'),
('INC000001630631', '2018-01-05 12:19:53', '2018-01-05 15:38:42', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: SAC: 0800 726 0101&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila EMPRESTIMOS está com a taxa de AB1 de 9,0%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 18, 320, 2, 144, '2018-05-08 08:16:35'),
('INC000001630632', '2018-01-05 12:23:50', '2018-01-05 14:12:12', 'Baseados em evidências apresentadas pelo gestor identificamos que o SIGRO tem apresentado falhas na rotina de exportação de perdas.&#10;Ocorreram falhas:&#10;-  nos dias 04, 06 e 07/nov/2017 e no dia 13/dez/2017  por problema de conexão com o banco, conforme mensagem de erro verificada no log.&#10;&#10;- nos dias 03 e 04/jan/2018 por problema de memória também conforme mensagem registrada no log.&#10;&#10;Solicitamos verificar e solucionar com urgência o problema de memória, verificando especialmente se rotinas de outras aplicações executadas em paralelo não podem estar influenciando no problema, visto que há no log registro de rotinas de mensageria não pertencentes ao SIGRO e que podem estar consumindo muita memória.&#10;&#10;Para resolver a indisponibilidade e gerar imediatamente o arquivo de perdas para o gestor, solicitamos reinicializar a aplicação e após ter sido reinicializada executar manualmente a rotina /sistemas/SIGRO/rotinas/exportarBaseAnaliticaPerdasContabeis.sh e acompanhar pelo log a sua execução para certificar do sucesso.&#10;&#10;Solicitamos ainda investigar o motivo das falhas de conexão com o banco ocorridas nos meses de novembro e dezembro/2017 para mitigar que o problema se repita.', 'Prezado (a) &#10;               Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;Informamos que foi realizado o aumento de memória JVM conforme envidência abaixo:&#10;&#10; [domain@10.123.9.48:9999 /] /server-group=SIGRO/jvm=SIGRO_JVM:read-resource&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; {&#10;        &#34;agent-lib&#34; =&#62; undefined,&#10;        &#34;agent-path&#34; =&#62; undefined,&#10;        &#34;env-classpath-ignored&#34; =&#62; undefined,&#10;        &#34;environment-variables&#34; =&#62; undefined,&#10;        &#34;heap-size&#34; =&#62; &#34;4096m&#34;,&#10;        &#34;java-agent&#34; =&#62; undefined,&#10;        &#34;java-home&#34; =&#62; undefined,&#10;        &#34;jvm-options&#34; =&#62; [&#34;-javaagent:/opt/ca/wily/Agent.jar&#34;],&#10;        &#34;max-heap-size&#34; =&#62; &#34;4096m&#34;,&#10;        &#34;max-permgen-size&#34; =&#62; &#34;2048m&#34;,&#10;        &#34;permgen-size&#34; =&#62; &#34;2048m&#34;,&#10;        &#34;stack-size&#34; =&#62; undefined,&#10;        &#34;type&#34; =&#62; undefined&#10;    }&#10;}&#10;&#10;&#10;Apos o restart da aplicação realizado a execução do scrip&#10;&#10;# source /sistemas/SIGRO/rotinas/exportarBaseAnaliticaPerdasContabeis.sh&#10;&#10;&#10;Em seguida foi constatado que os arquivos estão sendo gerados no diretório  /sistemas/SIGRO/exportacao_perdas_internas conforme envidência abaixo.&#10;&#10;root@cctdcapllx0101 exportacao_perdas_internas]# ls -ltr  GRO_LANCAMENTOS_D20180103_P20180105135937.txt&#10;-rw-r--r-- 1 root root 104478529 Jan  5  2018 GRO_LANCAMENTOS_D20180103_P20180105135937.txt', 2, 235, 3, 584, '2018-05-08 08:16:35'),
('INC000001630703', '2018-01-04 14:40:10', '2018-01-04 16:37:37', 'Há erro de carregamento no perfil Administrador para os usuários da GEDTI, gestora do sistema. Ademais, notou-se que o erro persiste com usuários cuja matrícula inicia-se com &#39;0&#39;. Após correções da FSW, a falha persiste. Favor analisar o ocorrido.', '', 2, 325, 2, 578, '2018-05-08 08:16:35'),
