('INC000001631567', '2018-01-08 12:03:43', '2018-01-08 12:41:04', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: PAINEL SIOUV&#10;Descrição: À&#10;Gestão de  Informações&#10;&#10;Favor verificar o site de plantonistas no sharepoint link abaixo:&#10;&#10;http://unidades/sites/CETEC/SitePages/Plantonistas.aspx&#10;&#10;erro: Ocorreu um erro ao carregar a pagina', '', 4, 48, 3, 135, '2018-05-08 08:16:35'),
('INC000001631572', '2018-01-08 13:01:47', '2018-01-08 15:04:57', 'À &#10;Gerência,&#10;&#10;1.&#9;Informamos que temos recebido vários acionamentos de Usuários apontando diversas falhas quando da tentativa de acessar o SICT2 e promover a Digitalização de Documentos, tais como: “Lista de Pedidos de Pagamentos de FGTS”, “Conformidade de Pagamentos de Prêmios de Loterias”, “Escaneamentos de Documentos de Concessão e Garantias Habitacionais” dentre outros documentos.&#10;&#10;2.&#9;Visto não dispormos de orientações que normatizem procedimentos solucionáveis, solicitamos posicionamento desta Gerência no tocante as ações a serem envidadas que norteiem nosso atendimento juntos aos Usuários.&#10;&#10;3.&#9;Relacionamos abaixo algumas ocorrências de SICT2, as quais sinalizam a Incidência:&#10;&#10;#&#9;Solicitando Atualização:&#10;WO0000023270531 / WO0000023280241 / WO0000023287614 / WO0000023288302.&#10;&#10;#&#9;Solicitando Configuração:&#10;WO0000023270731 / WO0000023271304 / WO0000023279991 / WO0000023282291.&#10;&#10;Atenciosamente,&#10;&#10;Equipe de Atendimento Service Desk', '', 5, 326, 4, 576, '2018-05-08 08:16:35'),
('INC000001631587', '2018-01-09 10:29:54', '2018-01-09 11:33:04', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Indicador GERTI&#10;Atuação: &#10;&#10;Descrição: Prezados,&#10;Informamos que na data de hoje foi identificado na pàgina &#10;http://indicadores.gerti.caixa, que os seguintes indicadores não foram publicados em D-1 para as filiais e CETEC.&#10;&#10;GERENCIAMENTO DO AUTOATENDIMENTO - AMBIENTE DAS SAA (CETEC).&#10;GERENCIAMENTO DO AUTOATENDIMENTO - AMBIENTE EXTERNO (CETEC).&#10;&#10;Solicitamos verificar a situação apresentada.&#10;&#10;Atenciosamente&#10;&#10;Central de Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'Prezados,&#10;&#10;1. Informo que foi realizada correção na origem dos dados e foi solicitado o reprocessamento das informações no painel pela CETEC84.&#10;&#10;Atenciosamente,&#10;&#10;&#10;Fabiano da Silva Barbosa&#10;CETEC - Gestão de Informações.', 4, 322, 1, 34, '2018-05-08 08:16:35'),
('INC000001631588', '2018-01-09 12:52:30', '2018-01-09 13:41:52', 'BA7400RA1 (CERAT) - SDR5994902)', 'Vide notas.', 7, 320, 3, 492, '2018-05-08 08:16:35'),
('INC000001631604', '2018-01-05 09:44:39', '2018-01-05 12:39:25', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila OPERAÇÕES_CREDITO o AB1 de 9,6%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme já informado em chamados anteriores INC000001537231, INC000001533736, INC000001472213, INC000001513844, INC000001491336, INC000001472213, INC000001458753, INC000001458969 e INC000001558915, identificamos que não há agentes disponíveis na CERATSA para atender as ligações de imediato, conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Também pode ocorrer desconexão dos clientes durante o processo de enqueue com attachment data, em que o cliente desiste da ligação antes de iniciar o processo de transferência da voz enquanto os dados já foram enfileirados por enqueue no contact center. Tais cenários são características da fila e do ambiente, não caracterizando falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001631607', '2018-01-05 11:08:10', '2018-01-05 14:16:59', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: &#10;Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão em todos módulos de Serviço. &#10;&#10;- Data Início: 05/01/2017                                                 &#10;- Hora Início: 11:00', 'Ambiente normalizado.&#10;&#10;Por favor, realize limpeza de cache nos navegadores (ctrl+shift+del) , logout e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001631611', '2018-01-05 11:27:32', '2018-01-05 19:44:03', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila STE_CONVENIO_FOLHA_RJ o AB1 de 14,8%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 7, 339, 2, 144, '2018-05-08 08:16:35'),
('INC000001631612', '2018-01-05 11:52:24', '2018-01-05 15:31:05', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERATSP&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila CONTRATO_HABITAÇÃO o AB1 de 8,2%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que identificamos na CERATSP que não há agentes disponíveis alocados para este serviço. Assim sendo, como os clientes acabam ficando na fila de espera, estão sujeitos a abandonarem ligações em qualquer um dos 5 intervalos, inclusive o 1o intervalo, causando assim o AB1 no site. Efetuamos testes de telefonia e não encontramos falhas. Segue em anexo print comprobatório que evidencia falta de operadores disponíveis para a demanda.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001631613', '2018-01-05 12:06:55', '2018-01-05 15:21:27', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: 0800 726 0101&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila RECLAMAÇÃO_CARTAO 14,9%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 18, 320, 2, 144, '2018-05-08 08:16:35'),
('INC000001631614', '2018-01-05 12:07:34', '2018-01-05 15:36:13', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: 0800 726 0101&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila SAC_OUVIDORIA o AB1 de 9,2%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 18, 320, 2, 144, '2018-05-08 08:16:35'),
('INC000001631646', '2018-01-06 18:22:46', '2018-01-06 19:03:12', '&#60;DEXTRRT001&#62;display interface Eth-Trunk1.1694', '.', 7, 18, 2, 487, '2018-05-08 08:16:35'),
('INC000001631662', '2018-01-08 09:57:52', '2018-01-08 11:06:36', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Fila STE_IBC_PF com 8,9% de AB1', 'Conforme solicitado verificamos as configurações da fila STE_IBC_PF – MCDU 8141 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG) não apresentam falhas, somente ao coletar os logs do roteador principal de rede da localidade encontramos algumas falhas com relação ao link que comutou no período da manhã para o link de redundância. Até o momento esta normalizando as fila com grande índices abandono.&#10;&#10;Em anexo segue evidencias.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001631667', '2018-01-08 11:35:16', '2018-01-08 12:23:42', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: 0800 726 0101&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Fila HABILACAO com 9% de AB1', 'Prezados,&#10;Informamos que analisams as ligações dessa Fila e identificamos oscilação no Circuito de dados WAN da CERATSA. Sendo assim, a CETEC16 solicitou a GITECSA abertura de chamado juntamente a CGR para manutenção do circuito de dados WAN da CERATSA, pois as quedas no circuito está prejudicando toda Telefonia daquela CERAT. Segue anexo evidência.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
