('INC000001631698', '2018-01-08 19:19:24', '2018-01-08 19:36:26', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Os usuários abaixo estão com matrícula ativa no SISCP contudo ainda não aparecem no SIGSC, impossibilitando a utilização do sistema:&#10;&#10;P795319 Emmannuelly Kennilly Fernandes Sala Gome&#10;P795320 Estefani dos Santos Nascimento Menezes&#10;P795324 Geovanna Santos Cabral&#10;P795315 Jenifer Oliveira Bispo dos Santos&#10;P795327 Julia Amanda de Quadros Santos&#10;P795329 Nadja Teixeira Ferreira&#10;P795486 Silvaneide Santos Santana&#10;P795332 Thaila Franciele Santana Nascimento&#10;P795333 Thais Cardoso Calmon&#10;P795340 Uine Soares dos Reis Correia&#10;P795330 William Oliveira da Silva&#10;&#10;Solicitamos verificação urgente pois vários destes usuários foram cadastrados no SISCP no dia 19/12/2017 (há quase 20 dias).&#10;&#10;Aguardamos retorno urgente.&#10;&#10;Att&#10;Cicero', 'Prezado Cicero,&#10;&#10;1. Informamos que foi identificado uma falha na integração SIICP x ITSM, porém a situação foi regularizada e os usuários foram integrados conforme o esperado.&#10;&#10;2. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001632209', '2018-01-05 16:49:42', '2018-01-05 17:07:48', 'FRI 05 JAN, 2018 -16=48=26&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO CSEXTRRR102_ GE1/0/1.1100_CEF_DATAMEC_GCI_AMT «CEF_SPOL01100»&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - N/A&#10;      CONTATO - N/A&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'O circuito encontra-se operacional.', 10, 95, 1, 70, '2018-05-08 08:16:35'),
('INC000001632642', '2018-01-08 09:31:03', '2018-01-08 10:44:45', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: OPERACOES_CREDITO&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: OPERACOES_CREDITO 8,0% &#10;·  Início da Ocorrência: 09:25', 'Conforme já informado em incidentes anteriores INC000001537231, INC000001533736, INC000001472213, INC000001513844, INC000001491336, INC000001472213, INC000001458753, INC000001458969, INC000001558915 e INC000001631604, identificamos que não há agentes disponíveis na CERATSA para atender as ligações de imediato, conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Também pode ocorrer desconexão dos clientes durante o processo de enqueue com attachment data, em que o cliente desiste da ligação antes de iniciar o processo de transferência da voz enquanto os dados já foram enfileirados por enqueue no contact center. Tais cenários são características da fila e do ambiente, não caracterizando falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001632645', '2018-01-08 11:50:56', '2018-01-08 13:11:15', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CONTRATO_HABITACAO&#10;&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: CONTRATO_HABITACAO 10,5% &#10;·  Início da Ocorrência: 11:50', 'Prezados,&#10;Informamos que analisamos as ligações dessa Fila e identificamos oscilação no Circuito de dados WAN da CERATSA. Sendo assim, a CETEC16 solicitou a GITECSA abertura de chamado juntamente a CGR para manutenção do circuito de dados WAN da CERATSA, pois as quedas no circuito está prejudicando toda Telefonia da CERATSA. Segue anexo evidência.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001632646', '2018-01-08 12:15:29', '2018-01-08 15:08:52', 'Informamos verificar todas as rotinas pentaho previstas para os movimentos de 05, 06 e 07/01.&#10;&#10;Segundo informações da área gestora os arquivos de verificações diárias dos dias 06 abaixo não foram gerados:&#10;SIIAC_VERIFICACOES_DIARIAS_06012018 &#10;SIIAC_VERIFICACOES_DIARIAS_jSON_06012018 &#10;&#10;e os gerados na data de 08_01_2018 estão vazios.&#10;&#10;as rotinas pentaho são as constantes no caminho:&#10;publicSIIACSIIAC_EXPORTACAO_ARQUIVOS&#10;J_SIIAC_EXPORTA_VERIFICACOES_DIARIAS&#10;J_SIIAC_EXPORTA_VERIFICACOES_DIARIAS_json&#10;&#10;Mais cedo abrimos outra requisição REQ000023071810 sobre o arquivo de Produtividade, daí estarmos solicitando que sejam verificadas as execuções de todas as rotinas de geração de dados para exportação.', 'os arquivos do movimento 05/01 foram gerados', 2, 59, 1, 585, '2018-05-08 08:16:35'),
('INC000001632649', '2018-01-08 16:37:58', '2018-01-08 17:13:34', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: TIM_MULTIBANK&#10;&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATBR:&#10;·  FILA: TIM_MULTIBANK 9,76% &#10;·  Início da Ocorrência: 16:00', 'Prezados,&#10;&#10;Foi detectado pela equipe que a partir das 14h30 a CERATSP passou a receber ligações na fila TODOS.&#10;&#10;Em análise identificamos que as ligações recebidas na fila TODOS são aquelas oriundas do atendimento CARTAO_SOCIAL_SOLICITACAO, MCDU 8069. Em averiguação no fluxo de estratégia de roteamento, identificamos que efetuada uma programação do Gestor para enviar ligações para outra unidade quando &#34;tempo de espera - atendimento estimado&#34; for maior que 5 seg.&#10;No entanto, identificamos que quando as ligações são roteadas para outra unidade seguindo esses critérios negociais, estão sendo roteadas da CERATSP para CERATSP, ou seja, gerando um cenário de looping no ambiente e enfileiramento de ligações desse transbordo na fila TODOS, conforme segue:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
