('INC000001644909', '2018-01-08 09:09:51', '2018-01-08 11:31:14', 'Informamos que os arquivos abaixo não foram gerados:&#10;IndiceProdutividade_SIIAC_05_01_2018.txt&#10;IndiceProdutividade_SIIAC_06_01_2018.txt&#10;IndiceProdutividade_SIIAC_07_01_2018.txt&#10;&#10;A rotina de geração é a rotina pentaho abaixo, que é executada diariamente:&#10;J_SIIAC_EXPORTACAO_PRODUTIVIDADE', 'ARQUIVOS GERADOS', 2, 59, 1, 585, '2018-05-08 08:16:35'),
('INC000001644911', '2018-01-08 09:58:34', '2018-01-08 11:27:07', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila STE_IBC_PF está com a taxa de AB1 de 9,3%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Após análise verificamos que ocorreu oscilação de rede no ambiente da CERAT-SA no período das 08:57 as 09:34hs. Devido a falha os contatos que estavam curso desconectaram gerando cenário de Abandono no 1 Intervalo. Realizamos testes após as 10hs  e observamos que o circuito está estável e o cenário de AB1 está diminuindo, no entanto sugerimos abertura de REQ para CGR a fim de verificar a falha de rede. Segue em anexo evidencias.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644913', '2018-01-08 11:33:40', '2018-01-08 15:45:38', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila CONTRATO_HABITACAO está com a taxa de AB1 de 9,4%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informo que a falha dos AB1 e devido a inconsistências na rede da localidade CERAT-SP, abaixo segue o print do zabbix &#9;que nos evidencia a indisponibilidade no roteador principal.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644915', '2018-01-08 11:41:55', '2018-01-08 15:48:12', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: SAC: 0800 726 0101&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila EMPRESTIMOS  está com a taxa de AB1 de 8,2%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que a falha dos AB1 e devido a inconsistências na rede da localidade CERAT-SP, abaixo segue o print do zabbix &#9;que nos evidencia a indisponibilidade no roteador principal.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644916', '2018-01-08 11:41:58', '2018-01-08 15:47:10', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: SAC&#10;&#10;Números Afetados: SAC: 0800 726 0101&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila HABITACAO  está com a taxa de AB1 de 9,0%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que a falha dos AB1 e devido a inconsistências na rede da localidade CERAT-SP, abaixo segue o print do zabbix &#9;que nos evidencia a indisponibilidade no roteador principal.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644917', '2018-01-08 11:54:52', '2018-01-08 15:49:13', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila HABITACAO_CLIENTES   está com a taxa de AB1 de 8,7%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que a falha dos AB1 e devido a inconsistências na rede da localidade CERAT-SP, abaixo segue o print do zabbix &#9;que nos evidencia a indisponibilidade no roteador principal.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644925', '2018-01-08 16:41:20', '2018-01-08 17:10:35', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila FGTS está com a taxa de AB1 de 15,50%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezados,&#10;&#10;Foi detectado pela equipe que a partir das 14h30 a CERATSP passou a receber ligações na fila TODOS.&#10;&#10;Em análise identificamos que as ligações recebidas na fila TODOS são aquelas oriundas do atendimento CARTAO_SOCIAL_SOLICITACAO, MCDU 8069. Em averiguação no fluxo de estratégia de roteamento, identificamos que efetuada uma programação do Gestor para enviar ligações para outra unidade quando &#34;tempo de espera - atendimento estimado&#34; for maior que 5 seg.&#10;No entanto, identificamos que quando as ligações são roteadas para outra unidade seguindo esses critérios negociais, estão sendo roteadas da CERATSP para CERATSP, ou seja, gerando um cenário de looping no ambiente e enfileiramento de ligações desse transbordo na fila TODOS, conforme segue:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
