('INC000001644929', '2018-01-08 16:44:52', '2018-01-08 17:05:55', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila STE_IBC_PJ está com a taxa de AB1 de 8,80%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezados,&#10;&#10;Foi detectado pela equipe que a partir das 14h30 a CERATSP passou a receber ligações na fila TODOS.&#10;&#10;Em análise identificamos que as ligações recebidas na fila TODOS são aquelas oriundas do atendimento CARTAO_SOCIAL_SOLICITACAO, MCDU 8069. Em averiguação no fluxo de estratégia de roteamento, identificamos que efetuada uma programação do Gestor para enviar ligações para outra unidade quando &#34;tempo de espera - atendimento estimado&#34; for maior que 5 seg.&#10;No entanto, identificamos que quando as ligações são roteadas para outra unidade seguindo esses critérios negociais, estão sendo roteadas da CERATSP para CERATSP, ou seja, gerando um cenário de looping no ambiente e enfileiramento de ligações desse transbordo na fila TODOS, conforme segue:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001644938', '2018-01-09 14:51:09', '2018-01-09 15:12:35', 'Segundo relato do gestor o ambiente de homologação do SIGRO está apresentando instabilidade desde ontem.&#10;Gentileza verificar o que está ocorrendo e se necessário efetuar a reinicialização do SIGRO de homologação.', '', 2, 235, 1, 364, '2018-05-08 08:16:35'),
('INC000001644941', '2018-01-09 15:33:07', '2018-01-09 15:55:03', 'Prezados (as)&#10;1. Informamos que o Portal do Empregado apresenta indisponibilidade para edição do banner &#34;Corrida do Desenvolvimento CAIXA&#34;, conforme anexo.&#10;2. Tendo em vista demanda da unidade gestora, precisamos modificar o Estado de “Publicado” para &#34;Enviar de Volta&#34;, no entanto, a funcionalidade não está disponível para edição por parte dessa GENER.&#10;3. Solicitamos urgência no atendimento da demanda.&#10;4. Agradecemos e colocamo-nos à disposição para mais informações.&#10;&#10;Atenciosamente, &#10;Vanessa Coelho&#10;GENER', 'Sr(a) Vanessa Oliveira&#10;&#10;1 - Informamos que esta solicitação não caracteriza incidente, orientamos abrir uma requisição do tipo WO.&#10;&#10;2. Em caso de dúvidas na abertura de demandas normativas ou operacionais, acione a CN de Atendimento Interno por meio do 0800 721 2222.&#10;&#10;3. Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 66, 3, 203, '2018-05-08 08:16:35'),
('INC000001646106', '2018-01-08 11:18:54', '2018-01-16 13:41:12', 'RTC3516262&#10;Solicitamos verificar o motivo da unidade 4958 não estar listada nas unidades de consulta do SIVIR. Verificamos que a unidade foi criada em 18/12/2017 e possivelmente a base do SIICO no banco de dados SIVIR esteja desatualizada. Solicitamos verificar se a replicação da base do SIICO no servidor de banco do SIVIR está sendo feita automaticamente.', 'Prezados&#10;&#10;Ao realizar consulta no banco de dados onde encontra-se o SIVIR e o SIICO, foi constatado que existe as unidades informadas, aproveito para informar que todas as bases do SIICO  da PROINFO estão atualizadas, segue em anexo o resultado da consulta.&#10;&#10;Att,.&#10;&#10;Marcel Costa Moreno', 2, 3, 1, 488, '2018-05-08 08:16:35'),
('INC000001646167', '2018-01-09 13:03:12', '2018-01-09 14:36:57', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Solicitamos inclusão do ATM Perto TS 3100 TR, série 20521, no contrato de Garantia da ATP 3281/2016.', 'Para a resolução do problema foram atualizados os atributos &#39;status&#39; e &#39;hostname&#39; do Terminal.', 20, 58, 1, 573, '2018-05-08 08:16:35'),
