('INC000001665167', '2018-01-09 03:41:16', '2018-01-09 03:57:21', 'TUE 09 JAN, 2018 -03=41=12&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO PRRRCTA6.PR.CAIXA&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITEC/CT - R.JOSE LOUREIRO, 195 1AND - CENTRO - CURITIBA - PR&#10;      CONTATO - GITEC/CT-(41)3544-5300&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING', 10, 315, 1, 569, '2018-05-08 08:16:35'),
('INC000001665168', '2018-01-09 03:41:40', '2018-01-09 04:00:04', 'TUE 09 JAN, 2018 -03=41=13&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO PR0000SW801&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITEC/CT - R.JOSE LOUREIRO, 195 1AND - CENTRO - CURITIBA - PR&#10;      CONTATO - GITEC/CT-(41)3544-5300&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING', 10, 319, 1, 342, '2018-05-08 08:16:35'),
('INC000001665169', '2018-01-09 03:41:59', '2018-01-09 04:02:18', 'TUE 09 JAN, 2018 -03=41=12&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO PR0000SW800.PR.CAIXA&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITEC/CT - R.JOSE LOUREIRO, 195 1AND - CENTRO - CURITIBA - PR&#10;      CONTATO - GITEC/CT-(41)3544-5300&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING', 10, 318, 1, 341, '2018-05-08 08:16:35'),
('INC000001665202', '2018-01-08 10:11:12', '2018-01-08 10:41:25', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;2.&#9;Afim de que a CETEC avalie a situação e proceda com as tratativas necessárias à normalização&#10;&#10;Período de Lentidão/indisponibilidade:&#10;- Data Início: 08/01/2018                                                 &#10;- Hora Início: 09h50', 'Prezada usuária bom dia .&#10;Durante a noite de ontem foi realizado um flush cache nos servidores de Web o que vai estar causando lentidão no acesso a ferramenta. &#10;Para amenizar os sintomas do problema favor limpar o cache do browser, se deslogar da ferramenta e tentar novamente.&#10;Atenciosamente,&#10;Equipe Sustentação -  SIGSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001665211', '2018-01-08 14:42:33', '2018-01-08 15:31:13', 'Solicito verificar ocorrência no servidor do SIING (sorteiodeingressos.caixa) ambiente de Produção:&#10;- Servidor não está encaminhando e-mail automático pela aplicação.&#10;- Não está executando rotina batch de sorteio de ingressos.', '', 2, 60, 2, 196, '2018-05-08 08:16:35'),
('INC000001665240', '2018-01-09 12:03:18', '2018-01-09 18:13:20', 'ABERTO POR MONITORAÇÃO G&#38;P', 'Sem nenhuma ação da Equipe de REDE', 7, 337, 4, 518, '2018-05-08 08:16:35'),
('INC000001665242', '2018-01-09 14:47:51', '2018-01-09 16:14:10', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila FGTS o AB1 de 8,4%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila FGTS – MCDU 8003 na CERAT-SA , bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV. No entanto, observamos que a CERATSA está sem agentes disponíveis suficientes para atender a fila FGTS (segue anexo print com evidencia), gerando enfileiramento de chamadas. Nos testes realizados observamos que está ocorrendo enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos que sejam alocados mais agentes para atender essa fila de modo que não haja ligações, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Na medida em que forem alocados mais agentes para atendimento, a taxa de Abandono (e AB1 inclusive) tende a diminuir.  Segue a analise em anexo com base em numeros de origem aleatórios onde observamos que todas as chamadas desconectadas no intervalo de 0 a 10 Segundos são ocasionadas na origem o nos leva a crer que está ocorrendo desistência do usuário em virtude do tempo de espera alto para atendimento.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001665270', '2018-01-10 15:01:50', '2018-01-10 15:14:50', 'Solicito verificar indisponibilidade do SIING (sorteiodeingressos.caixa), após fazer o logon apresenta tela de ERRO.', '', 2, 60, 2, 196, '2018-05-08 08:16:35'),
('INC000001665272', '2018-01-10 15:20:44', '2018-01-10 16:45:34', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: O SIGSC está apresentando muita lentidão nesta data.&#10;Estamos recebendo reclamação de vários usuários, principalmente de unidades solucionadoras.&#10;Solicitamos verificação.&#10;Em anexo, algumas evidências e reclamações.', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Lembrando também que existe um problema sendo tratado pela Proinfo, pois o banco de dados do GSC está trabalhando apenas com 50% da sua capacidade, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001665617', '2018-01-09 10:14:36', '2018-01-09 10:41:54', 'SIPNL v3.0 - Piloto Joao Negrao fora do ar&#10;GITEC/CT', '', 2, 244, 3, 385, '2018-05-08 08:16:35'),
('INC000001665619', '2018-01-09 15:23:15', '2018-01-09 16:44:58', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila STE_CERTIFICACAO_DIGITAL_PF  está com a taxa de AB1 de 8,70%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Observamos, novamente, menor disponibilidade de operadores disponíveis na CERATBR com a maior quantidade de ligações oferecidas no primeiro intervalo. Quando não há agentes disponíveis, a tendência é que os clientes desistam das chamadas em qualquer dos intervalos (isso inclui o primeiro intervalo). Isso significa que abandono no primeiro intervalo não é indicativo de falha no ambiente a não ser em grande quantidade, o que não é o caso.&#10;&#10;A sugestão para a resolução de abandono no primeiro intervalo é que a CERATBR aloque mais operadores para atender as ligações, de modo que ocorra menos chance de os clientes desistirem das chamadas. &#10;&#10;Realizamos testes discando diretamente no MCDU 8143 que cai na fila STE_CERTIFICAÇÕES_DIGITAL_PF que contatamos que as ligações foram atendidas corretamente caindo no operador na CERATBR após esperar algum tempo na fila que esse teste descarta qualquer falha na telefonia.&#10;&#10;Segue em anexo o relatório do Contact Center da CERATBR de todos os operadores atribuídos para atender a fila em questão estão ocupados.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001665632', '2018-01-09 21:52:34', '2018-01-09 22:10:26', 'DEXTRRT001_Eth-Trunk2.2802_CEF_TECBAN_DIVEO_DCPEXTRASW001_TE8_OI_&#60;TCS10590222&#62;', 'Circuito indisponível', 7, 18, 2, 538, '2018-05-08 08:16:35'),
('INC000001665647', '2018-01-10 15:47:31', '2018-01-12 12:46:01', 'RTC3540983&#10;1. Conforme evidências contidas na mensagem em anexo, o SIAAS está apresentando erro na hora de tentar SALVAR a versão 1 de uma MAP.&#10;&#10;2. Favor verificar.', 'Prezado Usuário,&#10;&#10;1. Conforme posicionamento da PROINFO (CETEC64), o ambiente está apresentando funcionamento normal. A Equipe Mais2x (PROINFO) registrou o seguinte informação:&#10;&#10;   &#34;Conforme verificado com analista o erro referido no log de aplicação são referentes à erros de acesso (permissão), não foi encontrado nenhum outro erro na parte de infraestrutura/JBOSS. Favor solicitar verificação com a equipe responsável pela aplicação.&#34;&#10;&#10;2. Nessa caso terá que acionar a equipe Gestora do Sistema (GITECCT), por meio da Caixa Postal geset07@caixa.gov.br (GESET07 - Desenv Seguro e Controle de Acesso em Sistemas). &#10;&#10;3. Ressaltamos que a GITEC não faz tratamento de incidentes, por conta disso o incidente será fechado. Favor seguir as orientações da nota de Resolução.&#10;&#10;4. Estamos à disposição para esclarecimentos adicionais.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;61 3206 -1800', 3, 49, 2, 353, '2018-05-08 08:16:35'),
('INC000001665683', '2018-01-12 14:08:09', '2018-01-12 15:30:43', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Autoatendimento - Gestão de Contratos AA&#10;Atuação: &#10;&#10;Descrição: Informamos que na página http://gestaoregionalaa.caixa/ na aba Índices dos Indicadores os contratos: CONNECTCOM  00276/2017, TMSOLUTIONS 1047/2017, TIVIT00279/2017, MTI 00273/2017, CONNECTCOM 11639/2017 e DIVIDATA 14803/2017 não estão com as datas atualizadas em D-1, gentileza verificar.&#10;&#10;Atenciosamente,&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 4, 335, 1, 34, '2018-05-08 08:16:35'),
('INC000001665684', '2018-01-12 14:51:39', '2018-01-12 15:06:18', 'A área de gestão do Jornal está apresentando instabilidade e lentidão que inviabiliza a utilização do mesmo.&#10;Estamos levando cerca de 10 minutos para abrir as propriedades de uma matéria e depois é apresentado erro ou o comando é ignorado.&#10;&#10;Pedimos urgência na demanda', 'Prezados, venho através desta nota informar que o incidente para o SITEM está sendo tratado no INC000001671670 , conforme informado pelo analista responsável.', 2, 1, 3, 577, '2018-05-08 08:16:35'),
