('INC000001670621', '2018-01-10 11:40:25', '2018-01-10 14:16:27', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos módulos de mudanças, serviços e incidentes. &#10;&#10;- Data Início: 10/01/2018                                                 &#10;- Hora Início: 11:20&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento', 'Prezado(a), bom dia.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
