('INC000001695818', '2018-01-10 17:20:08', '2018-01-10 18:07:37', 'Informamos que estamos recebendo diversos chamados de erro no SIIAC.&#10;Seguem alguns códigos:&#10;ef9cebc80450433e8e8477d2d73e4eee&#10;a91896bf2fc84bd1aa5544cc542bbb93&#10;3c811b7d5c724a4a95c79cc5d096b8e8', '', 2, 59, 3, 586, '2018-05-08 08:16:35'),
('INC000001695830', '2018-01-11 18:55:41', '2018-01-11 19:06:55', '', 'Circuito indisponível', 7, 198, 2, 494, '2018-05-08 08:16:35'),
('INC000001695907', '2018-01-10 11:27:51', '2018-01-10 14:16:00', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicitamos verificação no sistema, tendo em vista que está extremamente lento e travando constantemente. &#10;Ressaltamos que já foi feito limpeza de cache nos navegadores (ctrl+shift+del) e um novo login, mas a lentidão permanece&#10;&#10;Aguardo e agradeço', 'Prezado(a), bom dia.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001695913', '2018-01-10 16:17:05', '2018-01-10 17:45:16', 'Na página principal da Intranet, ao clicar na matéria do carrossel - Portal das Loterias Online, não abre e retorna tela de erro anexa.', 'Desbloqueado conforme solicitado:&#10;&#10;CADDCSYSLB0001-Active-affinity-def-vMaster[1/1][INTRA_EXTERNO]#show running-config slb virtual-server VS_NOVAINTRANET&#10;slb virtual-server VS_NOVAINTRANET 10.123.6.15&#10;   port 80  http&#10;      access-list name ACL_SERVICOS_CET source-nat-pool SNAT_SERVICOS_CETEC&#10;      service-group SG_NOVAINTRANET_80&#10;      template virtual-port NOVAINTRANET&#10;      template cache NOVAINTRANET&#10;      aflex REDIRECT_INTRANET&#10;   port 443  tcp&#10;      access-list name ACL_SERVICOS_CET source-nat-pool SNAT_SERVICOS_CETEC&#10;      service-group SG_NOVAINTRANET_443', 2, 71, 3, 598, '2018-05-08 08:16:35'),
('INC000001695949', '2018-01-11 10:10:41', '2018-01-11 13:28:08', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos módulos de mudanças, serviços e incidentes. &#10;&#10;- Data Início: 11/01/2018                                                 &#10;- Hora Início: 09:50&#10;&#10; &#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento de TI&#10;&#10;CN  Operações de TI Brasília/BR', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;&#10;Lembrando também que existe um problema sendo tratado pela Proinfo, pois o banco de dados do GSC está trabalhando apenas com 50% da sua capacidade, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001695963', '2018-01-11 13:33:22', '2018-01-11 14:26:10', '1.&#9;Recebemos nesta manhã quatro (04) chamados de usuários de agência, que não estão conseguindo acessar a opção CONSULTA &#62;&#62; PARECER.&#10;&#10;WO0000023391856&#10;WO0000023391190&#10;WO0000023390597&#10;WO0000023391226&#10;&#10;2.&#9;O erro informado é &#34; Ocorreu um erro durante realização da operação. Entre em contato com equipe de suporte”, anexo.&#10;&#10;3.&#9;Todos os usuários possuem perfil automático de unidade_atendimento.&#10;&#10;4.&#9;A versão do Mozilla utilizada pelos usuários é a 38.1.0. Os empregados testaram em outras máquinas e por mais de duas vezes.', '', 2, 59, 3, 586, '2018-05-08 08:16:35'),
('INC000001695972', '2018-01-11 15:15:57', '2018-01-11 16:40:03', 'Informamos que estamos recebendo acionamentos relatando que ao tentar acessar o sistema SIIAC.CAIXA ou consultar pareceres é exibida a seguinte mensagem de erro: &#10;&#10;&#34;Um erro ocorreu durante a realização da operação. Por favor, entre em contato com a equipe de suporte. Código do erro: 421fd8bb19b4431f832e8bb52992c264&#34;', '', 2, 59, 3, 586, '2018-05-08 08:16:35'),
('INC000001695987', '2018-01-12 09:27:39', '2018-01-12 09:54:18', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com extrema lentidão nos  módulos de Mudanças, Serviços e Incidentes.&#10;                                          &#10;- Hora Início: 09:00', 'Prezada usuária bom dia. &#10;A lentidão foi ocasionada por uma intermitência na comunicação entre o banco de dados e o SIGSC.&#10;O erro já foi contornado e não deve ocorrer novamente. &#10;Att,&#10;Equipe SIGSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
