('INC000001704202', '2018-01-13 06:01:54', '2018-01-13 11:23:13', 'Equipe de suporte  CAIXA CETEC- DEMANDAS GSC&#10;&#10;Favor verificar o motivo  - &#10;&#10;&#10;Indisponibilidade de geração de W.O &#10;&#10;Segue em anexo a evidencia &#10;&#10;&#10;         &#10;&#10;&#10;&#10;&#10;Daniel Boone Souza&#10;Produção - Madrugada&#10;G&#38;P - G &#38; P Projetos e Sistemas SA&#10;MC Produção  &#10;Tel. 3201-6756  - 3201-6707', 'Prezados bom dia.&#10;O erro de processamento das requisições já foi resolvido porém ainda resta um legado de 50 requisições.&#10;Para estar tratando o reprocessamento das mesmas vamos estar abrindo a requisição de erro REQ000023242163 para tratamento e documentação deste problema &#10;Att, &#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC.', 8, 58, 2, 564, '2018-05-08 08:16:35'),
