('INC000001704649', '2018-01-15 09:49:52', '2018-01-15 11:17:34', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Visão ETL&#10;Atuação: &#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que a página VISÃO ETL está apresentando alerta no processo SERVICE DESK pacote ETL034_SERVICE_DESK_AD.&#10;&#10;Solicitamos verificar a situação apresentada.&#10;&#10;Atenciosamente&#10;&#10;Central de Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'Prezados,&#10;&#10;Informamos que a ETL IC_CONSUMO so servidor 407 foi desabilitada, restando implantada apenas no servidor CCTD002.&#10;&#10;Att,&#10;&#10;Wesley Cardoso&#10;Gestão de Informações', 4, 78, 1, 34, '2018-05-08 08:16:35'),
('INC000001704656', '2018-01-15 10:39:28', '2018-01-15 15:29:50', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: &#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com extrema lentidão nos módulos de Mudanças, Serviços e Incidentes.&#10;2.&#9;Foi aberto a REQ000023209978  para verificação.&#10;&#10;- Data Início: 15/01/2018                                                 &#10;- Hora Início: 10:20', 'Prezado usuário boa tarde. &#10;O incidente foi causado por atividades realizadas pós a mudança citada na ultima comunicação.&#10;Essas atividades fizeram com que as comunicações da ferramenta estivessem causando a lentidão reportada.&#10;Estaremos movendo este incidente para concluido. &#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001704660', '2018-01-15 11:12:29', '2018-01-15 12:02:16', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Servidor DF7562SR857&#10;Atuação: Verificar Distribuidor Sondas&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que a aplicação DISTRIBUIDOR DE SONDAS que se encontra no servidor df7562sr857 está apresentando extrema lentidão para processar o MÓDULO PAGADOR. Ressaltamos que durante a tentativa de processamento o DISTRIBUIDOR está gerando inconsistencia também no IMPORTA SONDAS gerando atraso para processar as sondas recebidas. Solicitamos verificar a situação apresentada tendo em vista que o evento está gerando a desatualização do PAINEL DE MONITORAÇÃO VISÃO NEGOCIAL.&#10;&#10;&#10;Atenciosamente&#10;&#10;Central de Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'Inconsistencia foi encontrada e tratada', 4, 37, 1, 34, '2018-05-08 08:16:35'),
