('INC000001704876', '2018-01-15 16:04:39', '2018-01-15 17:49:52', 'Tipo: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Serviço: PAINEL SIOUV&#10;Descrição: Senhores,&#10;&#10;O portal de RH, conforme link abaixo  esta travado, impedindo que os empregados façam as solicitações como por exemplo, destacamento.&#10;&#10;&#10;http://unidades/sites/CETEC/RH/Solicitar/SitePages/Home.aspx&#10;&#10;Att&#10;Francisca de Lourdes de Sousa&#10;CETEC01', 'Como não temos acesso ao site, fizemos testes com André da CETEC64 e, nesse teste, o acesso foi normal. Não identificou o problema.', 2, 48, 3, 135, '2018-05-08 08:16:35'),
('INC000001704890', '2018-01-15 19:00:58', '2018-01-15 19:15:37', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Disponibilidade Parcial&#10;&#10;Descrição: Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com disponibilidade parcial nos módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data Início: 15/01/2018                                                 &#10;- Hora Início: 18:50&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR&#10;L.S.M', 'Prezado Usuário,&#10;&#10;1. Realizamos testes em todos os servidores da aplicação e não foi identificado falhas nos módulos citados.&#10;&#10;2. Gentileza efetuar novos testes e caso apresente alguma falha, nos retornar com evidências.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 574, '2018-05-08 08:16:35'),
('INC000001705047', '2018-01-15 10:19:30', '2018-01-15 11:31:31', 'SIPNL - Fora do ar Ag Joao Negrao. com o seguinte erro:&#10;&#34;Erro interno no SIPNL org.hibernate.exception.JDBCConnectionException: Conexão Fechada&#34;&#10;GITEC/CT', 'Prezado (a)&#10;   Informamos que realizamos o restart da aplicação, a mesma voltou a funcionar. Estamos realizando o monitoramento da mesma e avaliando o desempenho', 2, 244, 3, 385, '2018-05-08 08:16:35'),
