('INC000001710942', '2018-01-16 15:40:32', '2018-01-16 16:53:40', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Autoatendimento - Gestão de Contratos AA&#10;Atuação: &#10;&#10;Descrição: A Página - http://gestaoregionalaa.caixa, informamos que não foram publicados os seguintes indicadores em D-1:&#10;&#10; - Comparecimento nas Visitas Programadas (12/01 - Sexta-feira).&#10; - Padronização (12/01, 13/01 e 15/01)&#10;&#10;Contratos&#10;&#10; - TIVIT 00279/2017&#10; - MTI 00273/2017&#10; - CONNECTCOM 11639/2017&#10; - DIVIDATA 14803/2017', '', 4, 335, 1, 34, '2018-05-08 08:16:35'),
('INC000001711002', '2018-01-15 14:31:56', '2018-01-15 16:32:41', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Autoatendimento - Ind. Transação Saque (Saa Pae Snc)&#10;Atuação: &#10;&#10;Descrição: Gentileza verificar o painel de transações de saque (http://autoatendimento.cetec.df.caixa/new/apps/monitora/transacoes/disponibilidade/PAE-SNC/diaria/saques/), está apresentando inconsistência nos dados e a data se encontra desatualizado.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezados,&#10;&#10;Informamos que a situação foi regularizada. Reprocessamos os dados da página.&#10;&#10;Att,&#10;&#10;Gestão de Informações', 4, 37, 1, 34, '2018-05-08 08:16:35'),
