('INC000001720914', '2018-01-17 11:07:16', '2018-01-17 11:14:41', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: Erro de Indisponibilidade no banco Cctdcdadlx0014.df.caixa&#10;Retornando seguinte mensagem&#10;&#10;&#39;Status : Com Falha no teste: ORA-01034: ORACLE not available&#10;ORA-27101: shared memory realm does not exist&#10;Linux-x86_64 Error: 2: No such file or directory&#10;Additional information: 3640&#10;Additional information: -1619740289 &#39;&#10;&#10;Ressalto que mesmos esta impactando a ETL abastece  os portais  abaixo &#10;http://portalrequisicoes.cetec.df.caixa/,&#10;http://visaogconf.servicos.caixa/,&#10;http://demandas.servicos.caixa/,', '', 8, 58, 1, 575, '2018-05-08 08:16:35'),
('INC000001720930', '2018-01-17 18:48:50', '2018-01-17 19:49:02', 'Durante o uso da aplicação, aparece a tela com termo “HTTP Status 500', '', 2, 272, 2, 582, '2018-05-08 08:16:35'),
('INC000001721014', '2018-01-17 11:19:16', '2018-01-17 12:03:00', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila OPERAÇÕES_CREDITO o AB1 de 10,1%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Após analise não constatamos nenhuma falha envolvendo o ambiente e no roteamento de chamadas. Observamos que na CERATSA, nem sempre possui agentes disponíveis para atender as ligações (segue em anexo print comprobatório um exemplo em que observa-se que há momentos que não há agentes ociosos), causando um cenário de enfileiramento, e aumentando as chances de clientes desconectarem no primeiro intervalo. Portanto, observamos que o cenário de abandono no primeiro intervalo na CERATSA não configura um cenário de falha no ambiente. Ressaltamos a importância de alocar mais agentes para garantir o atendimento no primeiro intervalo e também, já verificamos as configurações da fila e não encontramos nenhuma configuração divergente. Nesse cenário o cliente está ligando e desconectando por falta de atendimento.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001721113', '2018-01-17 10:26:17', '2018-01-17 12:00:23', 'Conforme informações da área gestora em algumas consultas a dados no SIIAC estão recebendo retorno de &#39;ERRO NA CONSULTA AOS DADOS&#39;.&#10;Em consulta ao log da instância 0324 da aplicação &#10;(ctdcapllx0324:srv_0324_SIIAC_04) vimos que existem alertas de JDBCException: Cannot open connection.&#10;&#10;Solicitamos verificar.', 'Prezado (a) &#10;           Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;               Informamos que não foram encontradas evidẽncia de falhas referenta a infraestrutura da aplicação. Confome informado pelo solicitando erro estava sendo gerado em uma consulta especifica de um CPF : 319.007.928-50 , O qual não encontrada na base de dados do SIIAC. &#10;&#10;Estamos a disposição para esclarecimentos e duvidas.&#10;&#10;Att', 2, 294, 3, 586, '2018-05-08 08:16:35'),
('INC000001721125', '2018-01-17 16:18:03', '2018-01-18 13:53:03', 'Informamos que o SIVIR (sivirnovo.caixa) está com o problema a seguir: quando se digita no menu Relatórios, Consulta Relatórios, a unidade 4958, inaugurada em 18/12/2017 não aparece no campo unidades.&#10;Solciitamos o dump da base do SIICO que alimenta o SIVIR de produção e implantamos no nosso ambiente de desenvolvimento, e o erro informado não acontece, a unidade 4958 aparece normalmente. Solicitamos verificar se realmente a base do SIICO que o SIVIR utiliza realmente está atualizada. Segue anexa consulta que o sivir utiliza e o erro apresentado E TELAS DE ERRO do sivir desenvolvimento e produção que estão com a mesma versão do sistema e aparentemente mesma base do SIICO.&#10;Solicitamos enviar também o conteudo da função &#34;sivir_vinculacao_unidades_recursiva_2&#34; do servidor de banco de produção do SIVIR.', 'Prezado solicitante, venho através deste informar que solicitações de investigações devem ser feitas através de uma Requisição de problema (PBI) ou uma Ordem de serviço, pois este não é um incidente.', 2, 3, 1, 599, '2018-05-08 08:16:35'),
