('INC000001745024', '2018-01-25 11:03:43', '2018-01-25 13:26:59', 'Unidades do estado do Rio de Janeiro estão reportando lentidão na rede. Não afeta apenas o SISAG, mas sim todos os recursos da unidade que dependem da rede.&#10;&#10;Alguns exemplos:&#10;&#10;REQ000023513024 - 1853 (SIREA)&#10;REQ000023513749 - 2890 (SIREA)&#10;REQ000023514435 - 1026 (SIREA)&#10;REQ000023514478 - 2905&#10;REQ000023514424 - 4402 (SIREA)&#10;REQ000023513727 - 2594', 'Verificação unidades - RJ - Operadora WCS - REDE4', 7, 116, 1, 593, '2018-05-08 08:16:35'),
('INC000001745221', '2018-01-19 10:11:17', '2018-01-22 14:16:21', 'Sobre o processamento dos arquivos gerados na rotina diária do PENTAHO - Recebemos um relato em que todas as vezes em que há atraso na disponibilização do arquivo IndiceProdutividade_SIIAC _15_01_2018.txt após o processamento do relatório verificaram algumas divergências entre os dados contidos nele quando comparados a consulta do SIIAC. Exemplificando, neste último atraso no arquivo, pasta produtividade, do FTP de saída do SIIAC, (IndiceProdutividade_SIIAC _15_01_2018.txt) constam no SIIAC 43 PAs emitidos pela GIRET 7837 referente a LIBERAÇÃO DE ALÇADAS mas no arquivo foram identificados apenas 30 PAs, conforme planilha em anexo onde foram destacados os não localizados.&#10;A mesma GIRET ainda percebeu que tal divergência entre o arquivo “IndiceProdutividade_SIIAC_DD_MM_AAAA.txt” (do servidor ftp) e o SIIAC tem ocorrido mesmo nos arquivos quando não há atraso.&#10;No caso abaixo, a GIRET 7837 emitiu 39 Pareceres no SIIAC referente a REGIME DE ALÇADAS porém, no arquivo há apenas 38 Pareceres, o PA abaixo não foi listado.&#10; PA GIRET/RP 08249/2018&#9;075.315.169-34TARCILA SEMCHECHEN - 0110-000 CREDITO CONSIGNADO - Conforme&#9;C076109&#9;7837&#9;0110-000&#9;17/01/18&#9;REGIME DE ALÇADAS&#10; &#10;A nível nacional, neste mesmo produto, no dia 17/01, 502 Pareceres foram emitidos no SIIAC, porém no arquivo constam apenas 485.&#10;Esta divergência também ocorre em outros produtos, listamos o REGIME DE ALÇADAS apenas para exemplificar.', 'Prezado(a)&#10;&#10;A CETEC64 apenas administra o ambiente e realiza reprocessamento das rotinas conforme necessidade, desconhecemos a regra de negócio assim não temos como analisar o que está certo ou errado nos dados favor entrar em contato com a GITEC-GO, para solucionar o problema.&#10;&#10;Att,.&#10;&#10;Marcel Costa Moreno', 2, 59, 1, 585, '2018-05-08 08:16:35'),
('INC000001745223', '2018-01-19 11:16:35', '2018-01-19 12:18:57', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos módulos de Mudanças, Serviços e Incidentes. &#10;&#10;- Data Início: 19/01/2018                                                 &#10;- Hora Início: 11:00&#10;&#10;Atenciosamente,&#10;&#10;Dayse Lucie&#10;CPM/CEPTIBR/Central de atendimento&#10;Ramal: 6432', '', 8, 58, 1, 173, '2018-05-08 08:16:35'),
