('INC000001745568', '2018-01-23 16:32:27', '2018-01-23 17:05:29', 'Informamos que não está sendo possível logar no ambiente HMP do SIAVI (hmp.siavi.proinfo.caixa), com o seguinte log de erro anexo do JBOSS anexo.', 'Foi concedido permissões para o SIAVI no SIICO.', 2, 324, 3, 562, '2018-05-08 08:16:35'),
('INC000001745714', '2018-01-19 14:19:19', '2018-01-19 15:09:43', 'À&#10;CETEC&#10;Prezados,&#10;1.       Informamos que o tempo para aberturada das normas no novo SISMN está muito longo. Como teste acessamos cinco normativos, que levaram em média 16 segundos para abrir. No antigo SISMN esse tempo é “16 segundos na nova aplicação” enquanto no atual SISMN levarem em média 6 segundos.&#10;a.       Não é possível expandir o sistema para o território nacional sem esta correção. Esclarecemos ainda que todas as indicações de melhoria solicitada por esta CETEC à CEDES foram atendidas.&#10;2.       Ademais, preocupa-nos a performance do sistema quando todos os usuários o acessarem ao mesmo tempo, à época da expansão.&#10;3.    Certos de sua compreensão aguardamos atendimento breve. &#10;Atenciosamente&#10;Wilson Cunha Soares Junior&#10;Gerente Executivo&#10;GENOR', 'Informamos que foi verificado o site e o mesmo está acessível não havendo indisponibilidade da aplicação. Foram verificados os servidores do SharePoint e SQL Server e não encontramos nenhuma anormalidade de CPU, Memória e disco IO que possibilitasse a lentidão na abertura dos normativos. Solicitamos verificar em conjunto com a equipe da Cedes responsável pela solução a questão da lentidão no novo SISMN. Em termo de Infraestrutura está ok.&#10;Estamos à disposição para mais esclarecimento.', 2, 333, 1, 595, '2018-05-08 08:16:35'),
('INC000001745784', '2018-01-22 16:21:34', '2018-01-22 17:19:46', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: PROGRAMAS_SOCIAIS 8% &#10;- Início da Ocorrência: 16:21', 'Informamos que, em decorrência de poucos agentes disponíveis, observamos que a fila PROGRAMAS_SOCIAIS tem apresentado tempo de espera de mais de 2 minutos entre 10h15 e 12h. Observamos, também, que na falta de agentes disponíveis, os clientes são suscetíveis a desligarem as chamadas independente do intervalo. A partir das 15h15 um volume maior de chamadas passou a ser encaminhada para outra CERAT (por regra de negócio da GEATE), e o AB1 reduziu desde então. Atualmente, constatamos que o AB1 já diminuiu para 5,91. Efetuamos dez ligações de teste entre 16h45 e 17h, e observamos que fomos atendidos normalmente em todas as chamadas.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001745837', '2018-01-19 15:03:37', '2018-01-19 15:52:10', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila PROGRAMAS_SOCIAIS o AB1 de 9,2%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSA que justifiquem índice maior de AB1.&#10;&#10;Observamos que a CERATSA não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;&#10;Print evidenciando que não há agentes disponíveis para atendimento na CERATSA:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001745838', '2018-01-19 15:07:03', '2018-01-19 15:53:37', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADAO&#10;&#10;Números Afetados: 0800 726 0207 &#10;&#10;Localidade Afetada: CERATSP&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila PROGRAMAS_SOCIAIS o AB1 de 8,2%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSP que justifiquem índice maior de AB1.&#10;&#10;Observamos que a CERATSP não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;&#10;Print evidenciando que não há agentes disponíveis para atendimento na CERATSP:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001745839', '2018-01-19 15:39:48', '2018-01-19 17:13:44', 'Prezados,&#10;&#10;Inforamamos que a intranet.caixa está apresentando indisponibiilidade.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'O servidor de banco de dados ficou sobrecarregado. Tivemos que mover o banco para o nó secundário. Feito isso, o acesso ao site foi normalizado.', 2, 71, 3, 203, '2018-05-08 08:16:35'),
('INC000001745898', '2018-01-21 08:18:01', '2018-01-21 11:38:59', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Item Monitorado: Autoatendimento - Gestão De Contratos AA&#10;Atuação: &#10;&#10;Descrição: Prezados,&#10;&#10;Solicitamos verificar o banco de dados SQL7562PRD17 do servidor  CCTDCDADNT0003.corp.caixa.gov.br.&#10;&#10;Ressaltamos que as seguintes páginas estão indisponíveis.&#10;http://suporteweb.cetec.df.caixa/&#10;http://gestaoregionalaa.caixa/ContratosAA/&#10;http://antivirus.cetec.df.caixa/RepStatus/&#10;http://infogsc.caixa/Web/Pages/ConsoleTiq.aspx&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezados(as),&#10;&#10;Informamos que a rotina que apresentava problema foi corrigida e os acessos normalizados.', 4, 37, 1, 34, '2018-05-08 08:16:35'),
