('INC000001746404', '2018-01-19 15:11:11', '2018-01-19 16:43:16', 'FRI 19 JAN, 2018 -15=11=08&#10;O EQUIPAMENTO DF7066RA1.DF.CAIXA ENVIOU UMA TRAP DE &#34;POWER SUPPLY FAILED&#34; PARA O SPECTRUM&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - SEPN 512 CJT C ED JOSE ALENCAR - ASA NORTE - BRASILIA - CEP= 70760-500&#10;      CONTATO - GITEC-BR TEL (61) 3206-5800&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) O EQUIPAMENTO APRESENTOU UMA FALHA DE FONTE (PODE SER PRIMÁRIA OU SECUNDÁRIA)&#10;AÇÕES RECOMENDADAS&#10;SUBSTITUIR A FONTE DEFEITUOSA&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO&#10;--------&#10;&#10;VEJA A MENSAGEM DO EVENTO PARA MAIORES DETALHES=&#10;&#10;FRI 19 JAN, 2018 - 15=11=08 - THE REDUNDANT POWER SUPPLY &#39;&#39; HAS FAILED WITH STATE &#39;&#39;. (EVENT [0X00210009])', 'Conforme verificado, esta unidade se refere a Logística de Brasília, porem não tem telefone. Verificado no Spectrum,  o telefone indicado é 61-32065800 porem sem sucesso. Dispositivo disponível.', 10, 96, 1, 541, '2018-05-08 08:16:35'),
('INC000001746405', '2018-01-19 15:26:41', '2018-01-19 16:44:15', 'FRI 19 JAN, 2018 -15=26=37&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO DF7066RA1.DF.CAIXA&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - SEPN 512 CJT C ED JOSE ALENCAR - ASA NORTE - BRASILIA - CEP= 70760-500&#10;      CONTATO - GITEC-BR TEL (61) 3206-5800&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Conforme verificado, esta unidade se refere a Logística de Brasília, porem não tem telefone. Verificado no Spectrum,  o telefone indicado é 61-32065800 porem sem sucesso. Dispositivo disponível.', 10, 96, 1, 86, '2018-05-08 08:16:35'),
