('INC000001822584', '2018-01-23 07:14:55', '2018-01-23 10:07:15', 'TUE 23 JAN, 2018 -07=12=47&#10;CDEXTRRR002 - A INTERFACE&#10;NOME= 0 SE5/4&#10;DESC= CEPTIBR_SE5/4_CEXE_STEFANINI_FABRICA_DIV_«55610472»&#10;IP=172.28.2.161 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'vide notas', 7, 34, 1, 500, '2018-05-08 08:16:35'),
('INC000001822764', '2018-01-24 13:52:59', '2018-01-24 14:46:34', 'Ao acessar o site do novo portfólio ao tentar incluir um novo produto é retornado &#34; A consulta ao banco de dados causou um erro&#34;.&#10;Ao verificar a configuração no Sharepoint designer e retornado um erroCorrespondente o anexo SharepointErrorSINPC_1.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Informamos que não há indisponibilidade da aplicação do SINPC e foi feito o mesmo teste utilizando o SharePoint designer como mostra o arquivo em anexo e o mesmo não gerou o erro apresentado. &#10;&#10;Estamos à disposição para mais esclarecimento.', 2, 329, 2, 590, '2018-05-08 08:16:35'),
('INC000001822813', '2018-01-23 14:37:26', '2018-01-23 14:49:02', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: Senhores,&#10;&#10;Favor verificar o erro ao tentar abrir qualquer documento de conhecimento no ambiente HMG.&#10;&#10;Desde já agradeço.', 'Prezado, boa tarde.&#10;&#10;A falha era referente a discrepância de cache nas Mid Tiers. Falha corrigida.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 271, 1, 561, '2018-05-08 08:16:35'),
('INC000001822899', '2018-01-26 08:30:01', '2018-01-26 08:59:47', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: Favor verificar o ambiente do relatorio.caixa que está indisponível.', 'Prezado usuário bom dia. &#10;O servidor de aplicação foi reiniciado e o erro não deve mais ocorrer.&#10;Favor reabrir este incidente caso o erro persista.&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 2, 575, '2018-05-08 08:16:35'),
('INC000001823205', '2018-01-23 10:26:53', '2018-01-23 13:38:55', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;1.&#9;Informamos lentidão no servicos.caixa nos módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data inicio: 23/01/2018                                                 &#10;- Hora Fim: 10:15&#10;&#10;.', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;Estamos com problemas a nivel de banco de dados sendo investigado a causa raiz com a Proninfo:&#10;&#10;Seguem os registros do problema no banco de dados.&#10;&#10;Lentidão:&#10;INC000001704866&#10;WO0000023507458&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001823244', '2018-01-25 03:18:39', '2018-01-25 05:01:28', 'ABERTO POR PAULO RAMOS/G&#38;P - CEPTISP - CENTRAL DE SERVIÇOS', 'Prezados,&#10;&#10;1- Foi verificado que o servidor ifr7562wn019 apresentou um tempo limite de (30000 milissegundos)  enquanto aguardava resposta de transação do serviços do CONNECT&#10;2- Fato que se deu  devido a uma lentidão momentânea  da maquina em questão provocando travamentos de alguns  processos do CONNECT.&#10;3- Foi necessário realizar restart da maquina o que veio a restabelecer o serviço do CONNECT logo em seguida. A normalidade do serviço foi confirmado pela Sr. Ana pelo  tel: 11-3201-6500.&#10;&#10;Att,&#10;&#10;Equipe Mais2X', 6, 14, 3, 513, '2018-05-08 08:16:35'),
('INC000001823297', '2018-01-26 07:31:20', '2018-01-26 08:58:46', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que relatório.serviços.caixa/ esta indisponível, impedindo a geração dos relatórios diários. Solicitamos verificar com urgência visto a necessidade de disponibilizar os resultados ate as 9:00h.&#10;&#10;Em anexo segue evidencia.', 'Prezado usuário bom dia. &#10;O servidor de aplicação foi reiniciado e o erro não deve mais ocorrer.&#10;Favor reabrir este incidente caso o erro persista.&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 2, 567, '2018-05-08 08:16:35'),
