('INC000001826228', '2018-01-26 03:05:15', '2018-01-26 08:33:37', 'ABERTO POR PAULO RAMOS/G&#38;P - CEPTISP - CENTRAL DE SERVIÇOS', 'Não identificamos lentidão. Para comprovar, pegamos duas transmissões:&#10;50621 e 50622. Cada uma foi feita em menos de um segundo, conforme mostrado abaixo:&#10;&#10;03:00:49 CONNECT:Direct Process &#39;SIVIRCNV&#39; #58621 - Copy Termination Record.   RC=0 MsgID[SCPA000I].&#10;&#10;03:00:50 CONNECT:Direct Process &#39;SIVIRCNV&#39; #58621 - ended.&#10;&#10;03:00:51 CONNECT:Direct Process &#39;SIVIRCNV&#39; #58622 - Copy Termination Record.   RC=0 MsgID[SCPA000I].&#10;&#10;03:00:51 CONNECT:Direct Process &#39;SIVIRCNV&#39; #58622 - ended.&#10;&#10;No entanto, verificamos que houve uma grande quantidade de transmissão durante a madrugada, o que pode ter causado a demora por causa da quantidade de arquivos.', 2, 14, 1, 514, '2018-05-08 08:16:35'),
('INC000001826311', '2018-01-25 09:22:27', '2018-01-25 16:11:20', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informamos que o ITSM (servicos.caixa) emcotra-se com lentidão nos módulos de mudanças, serviços e incidentes.&#10;&#10;Data início: 25/01/2018&#10;Hora início: 09:00', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;&#10;Lembrando também que existe um problema sendo tratado pela Proinfo, pois o banco de dados do GSC está trabalhando apenas com 50% da sua capacidade, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001826315', '2018-01-25 11:04:07', '2018-01-25 11:51:51', 'Caderno de TI&#10;Link http://cadernoti.caixa/&#10;indisponível. Em outra ocasião foi necessário reinicializar o servidor df7562sr005, que estava travado', 'Prezados, &#10;&#10;O se encontrava inacessível, foi feito um restart e após o procedimento, o mesmo retornou e o sistema foi restabelecido. &#10;&#10;Atenciosamente&#10;Roger Edgard Malta&#10;Equipe +2x', 2, 276, 3, 600, '2018-05-08 08:16:35'),
