('INC000001828802', '2018-01-26 10:28:12', '2018-01-26 11:50:22', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com lentidão nos módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data Início: 26/01/2018                                                 &#10;- Hora Início: 10:15&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR&#10;D.L.A.F', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;Estamos com problemas a nivel de banco de dados sendo investigado a causa raiz pela Proninfo:&#10;&#10;Seguem os registros do problema no banco de dados.&#10;&#10;Lentidão:&#10;INC000001704866&#10;WO0000023507458&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001828903', '2018-01-26 15:31:08', '2018-01-26 15:58:35', 'Solicito verificar problema no acesso ao http://projetosti.caixa ao qual requer instalação do plugin TASQUES. Usuário não tem permissão para instalar plugin.&#10;&#10;Não atualização automática do Plugin TASQUES impedindo a atualização de cronogramas.&#10;&#10;Unidade Demandante: CEDESBR025&#10;Usuário: Paulo Roberto Bastos de Macedo&#10;Matrícula: f692542&#10;&#10;Equipamento: DF7390ET148&#10;Localização: S1S9E6&#10;Ramal: 1031', '', 2, 323, 2, 580, '2018-05-08 08:16:35'),
