('INC000001833925', '2018-01-29 11:35:56', '2018-01-29 11:58:29', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: GECON&#10;Descrição: Estamos com problema de fechamento de alguns chamados no Gecon, ao tentar fechar aparece a mensagem:&#10;Chamado WO00000XXXXXX não encontrado na base! Para que seja verificado o motivo do mesmo não estar cadastrado na base de dados, orientamos realizar a abertura de chamado no GSC relatando a situação, para que a equipe responsável possa realizar as devidas verificações.&#10; Esses dois é necessário o cancelamento&#10;WO0000023491476 &#10;WO0000023602350&#10;Os demais precisamos fechar a rat do atendimento&#10;WO0000023673777&#10;WO0000023666356&#10;WO0000023726769&#10;WO0000023704774&#10;WO0000023635167', 'Prezado Klecio,&#10;&#10;1. Sua demanda não poderá ser atendida por esta Requisição, pois não se trata de incidente.&#10;&#10;2. Por gentileza, abrir nova solicitação conforme abaixo:&#10;   2.1 Tecnologia da Informação e Comunicação&#10;   2.2 Demandas Internas - CETEC e Filiais de Tecnologia&#10;   2.3 Gestão de Informação e Governança&#10;   2.4 Gestão da Informação e Governança&#62;&#62;Solicitar Agora&#10;   2.4.1 Campo: Tipo de Solicitação = Gestão da Informação e Governança&#10; &#10;&#10;3. Em caso de dúvidas na abertura de demandas normativas ou operacionais, acione a CN de Atendimento Interno por meio do 0800 721 2222.&#10;&#10;4. Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 46, 3, 135, '2018-05-08 08:16:35'),
('INC000001834010', '2018-01-29 11:44:44', '2018-01-29 12:45:46', 'Os servidores 132, 207 e 208 do portal do SIAGS estão parados e/ou apresentando extrema lentidão.', 'Os portais estão funcionando normalmente.', 2, 52, 2, 581, '2018-05-08 08:16:35'),
('INC000001834026', '2018-01-30 10:07:36', '2018-01-30 14:42:30', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com lentidão nos módulos de Mudanças, Serviços e Incidentes.&#10;&#10;- Data Fim: 30/01/2018                                                 &#10;- Hora Fim: 09:45&#10;&#10;Atenciosamente,&#10;&#10;Dayse Lucie&#10;CPM/CEPTIBR/Central de atendimento&#10;Ramal: 6432', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001834103', '2018-01-29 11:49:33', '2018-01-29 17:37:22', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos módulos de mudanças, serviços e incidentes. &#10;&#10;- Data Início: 29/01/2018                                                 &#10;- Hora Início: 11:30&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001834104', '2018-01-29 12:59:23', '2018-01-29 13:17:23', 'Está acontecendo erro &#34;504 Gatway Time-out&#34; favor verificar configuração deo time-out  do NGINX para o SIIVG- Se tiver a configuração estiver como padrão favor altera-la', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;Informamos que realizamos as alteração de timeout conforme o solicitado.&#10;&#10;              keepalive_timeout       500000;&#10;              proxy_connect_timeout   500000;&#10;              proxy_send_timeout      500000;&#10;              proxy_read_timeout      500000;&#10;              send_timeout            500000;&#10;&#10;O sistema em questão encontra-se operacional.', 6, 61, 2, 395, '2018-05-08 08:16:35'),
('INC000001834128', '2018-01-30 12:57:01', '2018-01-30 13:59:06', 'BKB_C-RSRRPAE6-G0/3&#60;=&#62;SPTSROCO1_G1/0/12_OI_&#60;TCS10596996&#62;', 'vide', 7, 348, 1, 21, '2018-05-08 08:16:35'),
('INC000001834501', '2018-01-29 15:16:31', '2018-01-29 17:36:49', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicito análise uma vez que o GSC apresenta muita lentidão na utilização da ferramenta.', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
