('INC000001834530', '2018-01-30 11:45:14', '2018-01-30 13:24:01', 'A&#10;CETEC&#10;&#10;Senhor Gerente,&#10;&#10;1.      Estamos recebendo acionamentos de clientes informando que ao inserir o cartão no terminal de autoatendimento da Caixa (PAE ou SAA), o cartão fica retido no equipamento.&#10;&#10;1.1   Identificamos 134 acionamentos  de CARTÃO RETIDO PELO EQUIPAMENTO até o momento.&#10;&#10;3.       Solicitamos análise desta ocorrência.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Suporte Tecnológico Externo&#10;Caixa Econômica Federal', '1. Ocorrência conhecida e cuja correção está prevista na API PERTO – V25 que está implantada em pré-piloto.&#10;2. Enfatizamos que foi criado perfil específico para os operadores da CERAT no SIMOC, de forma que possam reiniciar a aplicação SIMAA e liberar o cartão do cliente.&#10;3. Caso não solucione, a CERAT deverá encaminhar a requisição para atuação da Filial de vinculação.&#10;4. À disposição para eventuais esclarecimentos.&#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', 3, 334, 3, 579, '2018-05-08 08:16:35'),
