('INC000001835641', '2018-01-31 11:42:28', '2018-01-31 17:36:58', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Relatamos lentidão na utilização da ferramenta.&#10;Em anexo segue a mensagem do outlook da tela de erro.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001835705', '2018-01-30 17:44:57', '2018-01-30 21:18:03', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: Senhores,&#10;&#10;Favor verificar o erro ao tentar criar um documento de conhecimento no ambiente HMG.&#10;&#10;Desde já agradeço.', 'Prezado boa noite. &#10;Os servidores de HMP foram reiniciados. &#10;Favor validar e em caso de erro favor reabrir este incidente.&#10;Obrigado&#10;Equipe SIGSC', 8, 271, 1, 561, '2018-05-08 08:16:35'),
('INC000001835734', '2018-01-31 10:59:02', '2018-01-31 11:08:36', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: GECON&#10;Descrição: Estamos com problema de fechamento de alguns chamados no Gecon, ao tentar fechar aparece a mensagem:&#10;&#10;Chamado WO00000XXXXXX não encontrado na base! Para que seja verificado o motivo do mesmo não estar cadastrado na base de dados, orientamos realizar a abertura de chamado no GSC relatando a situação, para que a equipe responsável possa realizar as devidas verificações.&#10;&#10;Segue chamados para verificação que não geraram ticket.&#10;&#10;WO0000023777421&#10;WO0000023822239', 'Prezado Klecio,&#10;&#10;1. Informamos que a solicitação foi aberta utilizando formulário incorreto.&#10;&#10;2. Por gentileza, abrir nova solicitação conforme abaixo:&#10;&#10;   2.1 Tecnologia da Informação e Comunicação&#10;   2.2 Demandas Internas - CETEC e Filiais de Tecnologia&#10;   2.3 Gestão de Informação e Governança&#10;   2.4 Gestão de Informação e Governança&#62;&#62; Solicitar Agora&#10;   2.5 Tipo de Solicitação: Reprocessamento GECON&#10;   &#10;&#10;3. Em caso de dúvidas na abertura de demandas normativas ou operacionais, acione a CN de Atendimento Interno por meio do 0800 721 2222.&#10;&#10;4. Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 46, 3, 135, '2018-05-08 08:16:35'),
('INC000001835742', '2018-01-31 15:20:20', '2018-02-01 18:42:00', 'Estamos recebendo acionamento informando que não é possivel logar no sistema. Quando digita matrícula e senha e clica em &#34;Entrar&#34;, a tela fica parada e não acessa o sistema. Os caracteres da senha que digitados são apagados logo depois que digita, a matrícula fica carregada na tela.&#10;&#10;Abaixo, segue exemplos de requisições:&#10;&#10;WO0000023871335&#10;WO0000023871311&#10;WO0000023870767&#10;WO0000023859706', '', 2, 60, 2, 196, '2018-05-08 08:16:35'),
