('INC000001835939', '2018-01-31 16:34:19', '2018-01-31 20:26:06', 'SKYPE com varios alertas de performance limitando os recursos. No monitoramento fica evidente o problema de performance nos discos. conforme PBI já aberto', 'A&#10;STEFANINICETECCENTRAL DE ATENDIMENTO&#10;&#10;AC - Demandante&#10;&#10;Conforme última nota no PBI110102 - TAS18625588, foi realizado monitoramento no ambiente de storage (VMAX24_002B8_00319) para o Skype. Foi entregue relatório informando o desempenho de utilização no período de 24 horas onde foi encontrato somente um alto consumo de utilização no disco de volume ID 0319 entre 15h e 15h15min onde o volume ID 002B8 com performance normal. Segue relatório em anexo.&#10;&#10;No PBI110102 - TAS19055610, foi apresentado parecer pela equipe CAIXA, matricula C134535, informando que a CAIXA adquiriu novos ativos para subsistemas de disco Huawei onde a inteção é para utiliza-los no Skype. A previsão para disponibilização do recurso está previsto para 3 meses a partir da data de instalação 25/01/2018 pois serão homologados.&#10;&#10;Foi solicitado o fechamento do INC. &#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 3, 321, 2, 616, '2018-05-08 08:16:35'),
('INC000001836056', '2018-01-31 13:41:13', '2018-01-31 14:38:51', 'Não é possível efetuar login no SICBC. Conforme o trecho de log abaixo, a conexão com o Banco de dados foi encerrada.&#10;&#10;Será necessário reiniciar o Tomcat.&#10;&#10;#sicbc# ERROR [SqlExceptionHelper] FATAL: terminating connection due to administrator command 13:38:27,519 [http-8443-1]    &#10; #sicbc# ERROR [SqlExceptionHelper] Um erro de E/S ocorreu ao enviar para o processo servidor. 13:38:27,519 [http-8443-1]    &#10; #sicbc# FATAL [UsuarioDAO] javax.persistence.PersistenceException: org.hibernate.exception.GenericJDBCException: FATAL: terminating connection due to administrator command 13:38:27,523 [http-8443-1]', '', 2, 55, 3, 190, '2018-05-08 08:16:35'),
