('INC000001845901', '2018-02-01 11:10:19', '2018-02-01 14:39:28', 'GSC lento, conforme evidência anexa.', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;&#10;Lembrando também que existe um problema no banco de dados sendo tratado em Sala de Crise com o pessoal da proinfo, CETEC84, cetad, CSC Brasil e Oracle, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000001845902', '2018-02-01 11:41:39', '2018-02-01 17:51:59', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos  módulos de mudanças, serviços e incidentes. &#10;&#10;&#10;- Data Início: 01/02/2018                                                 &#10;- Hora Início: 11:30&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;&#10;Lembrando também que existe um problema no banco de dados sendo tratado em Sala de Crise com o pessoal da proinfo, CETEC84, cetad, CSC Brasil e Oracle, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001845908', '2018-02-01 18:09:58', '2018-02-01 20:47:53', 'A opção do GSC &#34;Nova Solicitação&#34; para abertura de uma requisição já utilizada anteriormente está apresentando o erro anexo.&#10;Gentileza verificar', 'Prezado Usuário,&#10;&#10;1. Informamos que foi realizado mudança nesta data que regularizou a situação apontada.&#10;&#10;2. Gentileza efetuar novos teste.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 193, '2018-05-08 08:16:35'),
('INC000001845916', '2018-02-05 12:12:46', '2018-02-05 16:47:07', 'GSC está extremamente lento. Pedimos verificar.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado, após restart geral no ambiente.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000001846001', '2018-02-01 11:39:42', '2018-02-01 14:48:03', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicitamos verificação no sistema, tendo em vista a lentidão e travamentos constantes, causando atrasos nas tratativas.&#10;&#10;Aguardamos e agradecemos', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado após restart de alguns servidores.&#10;&#10;Lembrando também que existe um problema no banco de dados sendo tratado em Sala de Crise com o pessoal da proinfo, CETEC84, cetad, CSC Brasil e Oracle, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001846002', '2018-02-01 14:41:23', '2018-02-01 15:15:39', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Prezados (as),&#10;&#10;Conforme informada pela equipe CEDES, a requisição de mudança nº 3646416 foi solicitada porém não gera um número de CRQ, apresentando a seguinte mensagem de erro:&#10;&#10;1. The contact for the creation of an Change cannot be found, please verify the contact information and try again.&#10;&#10;Favor avaliar o que está impedindo a transmissão/geração da mudança.&#10;&#10;Atenciosamente,&#10;GMUD', 'Senhor solicitante,&#10;&#10;Informamos que a causa do erro foi encontrada, e estamos trabalhando na solução definitiva.&#10;&#10;Para não prejudicar o atendimento, aplicamos solução de contorno, e os usuários já podem solicitar novamente as RM&#39;s em questão no RTC, utilizando o mesmo registro.&#10;&#10;Estamos disponíveis para maiores informações.&#10;&#10;att,&#10;Kristian Pacheco&#10;CSC Brasil', 8, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001846042', '2018-02-02 15:17:33', '2018-02-02 16:08:27', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Prezados (as),&#10;&#10;Informamos que os empregados da supervisão de mudanças da CEPTIBR43 não conseguem aprovar as demandas emergenciais em seu último estágio de aprovação. Somente constam como aprovadores a equipe da central de atendimento.&#10;&#10;Solicitamos que seja verificada esta questão impeditiva ao tratamento das demandas emergenciais.&#10;&#10;Segue em anexo a evidência.&#10;&#10;Atenciosamente,&#10;GMUD', 'Em contato com o solicitante via Skype, o mesmo informou que faltava a equipe da Gestão de Mudanças como aprovadora das fases de Implementação e Fechamento.&#10;&#10;O fluxo de aprovação foi ajustado, e para as novas mudanças funcionará corretamente.&#10;&#10;Como a equipe terceira já havia realizado a aprovação necessária, a mudança pôde prosseguir seu fluxo, então estamos dando encerramento a este incidente.&#10;&#10;Qualquer dúvida, estamos à disposição.&#10;&#10;att,&#10;Kristian Pacheco&#10;CSC Brasil', 8, 58, 1, 573, '2018-05-08 08:16:35'),
