('INC000001878002', '2018-02-05 14:32:30', '2018-02-05 15:04:29', 'A agência virtual Caixa não está abrindo as bases HMP e DEV&#10;Seguem evidências de erro de acesso a base HMP e DEV em anexo', 'A aplicação do ambiente de HMP se encontra funcionando corretamente, mas o ambiente de DEV foi entregue para benner, sendo assim, eles são responsáveis por ele.&#10;&#10;&#10;De acordo com a imagem apresentada, o erro trata-se da falta de permissão na instalação do ambiente DESKTOP nas máquinas locais. Este tipo de acesso não é realizado desta forma. Geralmente se acessa via WEB ou pela ambiente virtual fornecido pela caixa.', 2, 52, 2, 673, '2018-05-08 08:16:35'),
