('INC000001879488', '2018-02-06 18:51:03', '2018-02-06 19:25:41', 'O SIMIL está indisponível, sem exibir completamente a tela de login, conforme imagem anexa.&#10;&#10;Consultando o JBossLogs, vemos que algumas das instâncias estão apresentando erro relacionado à falta de memória:&#10;&#10;2018-02-06 18:42:44,430 SEVERE [com.unisys.br.amsfw.web.exception.CustomExceptionHandler] (http-/0.0.0.0:8443-47) Erro tratado.: java.lang.OutOfMemoryError: GC overhead limit exceeded', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Realizamos o restart de todo a aplicação, a mesma encontra-se disponive, conforme evidência em anexo', 2, 64, 3, 200, '2018-05-08 08:16:35'),
('INC000001879505', '2018-02-06 06:51:55', '2018-02-06 09:17:32', 'REF OS: 0009/0952', 'Prezados bom dia. &#10;O servidor está já está disponível porém não foi deixado qualquer telefone para contato para solicitar a reiteração do mesmo no load balancer.&#10;Conforme contato telefônico estamos aguardando o procedimento de restauração ser finalizado.&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC.', 8, 58, 1, 712, '2018-05-08 08:16:35'),
('INC000001880415', '2018-02-06 14:26:31', '2018-02-06 14:49:08', 'Usuário ao tentar exportar determinado relatório esta recebendo mensagem de indisponibilidade.&#10;Para solucionar tal indisponibilidade solicitamos que se altere no MASTER a propriedade &#60;property name=&#34;br.gov.cef.sivir.tamanho.limite.arquivo.exportacao&#34; value=&#34;1&#34;/&#62;  para &#60;property name=&#34;br.gov.cef.sivir.tamanho.limite.arquivo.exportacao&#34; value=&#34;10&#34;/&#62; . Fazer tal alteracao e logo apos dar restart no servidor da instancia &#34;web cadnpitrlx007.df.caixa&#34; no horario de 18:30 as 19:30 hs .', '', 2, 72, 2, 705, '2018-05-08 08:16:35'),
