('INC000001902161', '2018-02-08 09:24:18', '2018-02-08 09:42:07', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão nos  módulos de mudanças, serviços e incidentes. &#10;&#10;&#10;- Data Início: 08/02/2018                                                 &#10;- Hora Início: 09:10&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezado usuário bom dia. &#10;Verificamos o ambiente e foi diagnosticado que uma das maquinas de apresentação estava com erros no Tomcat.&#10;Após reiniciar a mesma o erro foi resolvido. &#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001902167', '2018-02-08 09:42:34', '2018-02-08 18:01:15', 'Solicitamos verificar a base de dados do SISRH schema srhsm002 esta com as tabelas vazias', 'Fizemos a replicação dos dados da stage.', 2, 367, 1, 688, '2018-05-08 08:16:35'),
('INC000001902173', '2018-02-08 10:47:36', '2018-02-08 13:04:43', 'Serviço: DNS - Domain Name Service - Zona e Domínio&#10;Tipo de Evento: Indisponibilidade&#10;Ocorrência: A unidade inteira não consegue autenticar.&#10;Descrição: Informamos que a TECNET esta sem acesso aos servidores CTSDCAPLNT0045, CTSDCAPLNT0075, CTSDCAPLNT0085, CTSDCAPLNT0064 na página do ctc.caixa,  a informação que aparece é de CPU e Memoria sem espaço.', 'Prezado,&#10;&#10;Conforme contato com a equipe TECNET, o acesso aos servidores foi regularizado, desta forma estamos encerrando este incidente.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 3, 172, 3, 682, '2018-05-08 08:16:35'),
('INC000001902176', '2018-02-08 16:24:05', '2018-02-09 08:58:23', 'ATENÇÃO: O INCIDENTE É SOBRE O SISTEMA SIRCW AMBIENTE DES, FOI FEITA UMA CATEGORIZAÇÃO APROXIMADA, POIS O SIRCW-DES SE ENCONTRA NA CETEC.&#10;.&#10;.&#10;Trabalhamos com o sistema SIRCW - DES que não consegue acessar o SIFWC - DES, sifwc.des.coredf.caixa para a validação da autenticação por certificação digital. Efetuamos um ping e um telnet, a partir do servidor mg7435sr298, com ip 10.192.228.113 443 e obtivemos reposta. Contudo, ao efetuarmos um traceroute para o mesmo ip do SIFWC não conseguimos alcançar o ip alvo. Imaginamos que algum balanceador no caminho esteja direcionando incorretamente. Isso já aconteceu anteriormente com outros sistemas. Já contactamos o pessoal responsável pelo SIFWC e todas as tentativas de acesso do sistema SIRCW - DES não estão chegando até ele. No log do SIRCW informa FALHA NA AUTENTICAÇÃO. Pedimos a verificação do problema e, se for o caso suposto, sua solução.', 'vide notas', 7, 374, 3, 674, '2018-05-08 08:16:35'),
('INC000001902194', '2018-02-09 08:22:51', '2018-02-09 08:31:53', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Ao tentar solicitar INSTALAÇÃO de software através de requisição de serviços via SIGSC o campo &#34;Nome lógico&#34; não reconhece o equipamento RS7876ET499.', '', 8, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001902195', '2018-02-09 09:16:27', '2018-02-09 12:06:15', 'REDE2_CONC - DFRPECTC1_G6/0/5_MOB_&#60;533538&#62;', 'Vide', 7, 20, 2, 601, '2018-05-08 08:16:35'),
('INC000001902224', '2018-02-08 18:36:11', '2018-02-08 19:03:14', 'Solicito verificar se o usuário utilizado pela aplicação está com permissão no banco e nas tabelas necessárias.&#10;&#10;Att,&#10;Diogo&#10;SUCTI06 - PEDES', 'Prezado Diogo,&#10;&#10;1. Informamos que a solicitação não se trata de um incidente, solicitamos rever a categorização escolhida para abertura da sua demanda.&#10;2. Estamos à disposição para os mais esclarecimentos.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Monitoração', 3, 383, 3, 679, '2018-05-08 08:16:35'),
