('INC000001902403', '2018-02-09 08:42:04', '2018-02-09 15:12:19', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Alguns usuarios reclamam de Lentidao excessiva ao acessar o GSC agora cedo 8:32&#10;&#10;Para algumas situações o link servicos.caixa fica carregando e nao abre nada', 'Prezado usuário boa tarde. &#10;Durante a data citada e o dia de hoje o SIGSC passou por várias instabilidades.&#10;Após o restart de algumas maquinas de apresentação o erro não está ocorrendo.&#10;Caso volte a ocorrer favor reabrir o incidente.&#10;Att,&#10;Gustavo Petruff.&#10;Equipe Sustentação SIGSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001902754', '2018-02-09 13:58:43', '2018-02-09 17:35:33', 'Solicitamos verificar a base de dados do SISRH schema srhsm002 esta com as tabelas vazias, exemplo:&#10;srhtbe030_hist_fc, srhtbe031_hist_lot, srhtbl039_subto_dir.&#10;&#10;Favor verificar o que esta ocorrendo, pois as tabelas estão sendo zeradas diariamente.', 'Prezado (a)&#10;&#10;Concluímos o atendimento desse Incidente.&#10;&#10;Obs: mesmo tendo resolvido o problema as tabelas do banco só serão atualizadas na rotina que ocorre as 21h, as mesmas contem &#34;FK&#34; e não podem ser atualizadas fora da rotina.&#10;&#10;Caso entenda que a solução não foi satisfatória, você poderá reabrir está requisição, em até 72 horas, durante a realização da avaliação.&#10;&#10;Att.&#10;Equipe Mais2X', 2, 367, 1, 688, '2018-05-08 08:16:35'),
