('INC000001905565', '2018-02-14 11:41:55', '2018-02-14 15:46:19', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicito verificar o problema de lentidão do sistema SIGSC.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001905571', '2018-02-14 15:14:19', '2018-02-14 16:16:22', 'Solicitamos verificar a indisponibilidade da intranet.caixa conforme evidência.', 'Informamos que ocorreu falha no cache da notícia, foi feito um novo cache e a página está acessível.', 2, 71, 3, 598, '2018-05-08 08:16:35'),
('INC000001905655', '2018-02-14 15:47:24', '2018-02-14 17:04:33', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Indisponibilidade&#10;&#10;Descrição: O ambiente des.servicos.caixa encontra-se indisponível neste momento.&#10;Solicitamos verificação tempestiva.', '', 8, 271, 1, 672, '2018-05-08 08:16:35'),
('INC000001905699', '2018-02-16 09:49:51', '2018-02-16 10:14:38', 'Os destaques na home intranet do Jornal da Caixa foram alterados em 15/02/2018, às 18h05. Nesta data observamos que os destaques aparecem corretamente no Explorer, mas não estão atualizados no Firefox. Seguem telas de comprovação', 'Prezada Denise,&#10;&#10;1. Sua demanda não poderá ser atendida por esta Requisição, pois não se trata de incidente.&#10;&#10;2. Em caso de dúvidas na abertura de demandas normativas ou operacionais, acione a CN de Atendimento Interno por meio do 0800 721 2222.&#10;&#10;3 - Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 71, 2, 597, '2018-05-08 08:16:35'),
