('INC000001939104', '2018-02-15 12:57:40', '2018-02-15 13:38:13', '1 - Sistema SIIVG encontra-se indisponível. favor verificar.&#10;2 - Solicitamos Logs do Servidor Jboss e do nginx.', '', 2, 61, 3, 198, '2018-05-08 08:16:35'),
('INC000001939107', '2018-02-15 14:51:05', '2018-02-15 15:08:04', 'Foi aberto o incidente REQ000023938676 para restabelecer o SIIVG, porém quando restabelecido voltou para a versão antiga. Favor retornar a versão mais recente.', '', 2, 61, 2, 395, '2018-05-08 08:16:35'),
