('INC000001939109', '2018-02-15 15:45:05', '2018-02-15 16:44:14', 'Solicitamos a correção do acesso ao “Módulo de Negociação de Preço” do SIAGS, evidenciado no print anexo', 'Esse erro não se trata de Infraestrutura, por favor contactar a fábrica mencionado o erro com a tela em evidência para a equipe de suporte BENNER analisar e disponibilizar correção.&#10;&#10;Att, &#10;&#10;Paulo Barros', 2, 52, 3, 678, '2018-05-08 08:16:35'),
('INC000001939112', '2018-02-15 17:13:14', '2018-02-15 20:26:59', 'Informamos que se encontra indisponível CLIENT do SIGCT :&#10;http://client.sigct.caixa.gov.br.&#10;Pedimos, por gentileza, a verificação&#10;Pois todos os clientes que utilizam este serviço nos reportaram que o webservice se encontra inoperante.', '', 2, 385, 3, 698, '2018-05-08 08:16:35'),
('INC000001939121', '2018-02-15 22:10:20', '2018-02-15 22:51:14', 'CEPTISP_CSEXTRRR003_Gi0/2.211_EEXT_MOVILE_SIGMS_CS0000SW118_P7_DIV_1Mb_&#60;55511100162&#62;', 'Abertura de chamado junto a operadora.', 7, 167, 2, 635, '2018-05-08 08:16:35'),
('INC000001939156', '2018-02-19 14:28:01', '2018-02-19 14:36:54', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: PROGRAMAS_SOCIAIS 8,0% &#10;- Início da Ocorrência: 14:26', 'Conforme solicitado foi realizado analise do ambiente, os AB1 e devido ao movimento paredista, o atendimento na CERATSP está fora de operação e com isso está indo uma demanda maior de ligações para a localidade CERAT-SA.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001939159', '2018-02-19 15:33:01', '2018-02-19 15:54:34', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATBR:&#10;- FILA: STE_CONVENIO_COBRANCA_PJ 8,28% &#10;- Início da Ocorrência: 15:32', 'Informo que houveram varias oscilações de rede no dia de hoje em Brasília, com essas oscilações pode causar tanto ligações pendentes nos relatórios como ligações mudas. Pedimos também que nesses casos de chamados referente a ligações mudas ou pendentes, enviar numero de origem do cliente com o horário e data, para analise. &#10;&#10;Em anexo segue evidencias da oscilação de rede.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001939164', '2018-02-19 18:08:47', '2018-02-19 18:35:24', 'Sistema apresentando ERRO 500, conforme imagem anexa.', 'Informamos que o ambiente em questão encontra-se disponível', 2, 272, 3, 444, '2018-05-08 08:16:35'),
