('INC000001940784', '2018-02-19 13:42:54', '2018-02-19 15:36:06', 'Solicitamos verificar as configurações de regras de firewall do servidor do SIASO - PRD em relação ao LDAP de Clientes.&#10;&#10;Log do sistema esta apresentando erro de time out, conforme anexo.&#10;&#10;Verificado com a CEPTI e os dados do servidor de LDAP está OK.&#10;&#10;Servidor de LDAP: clientes.openldap.corecaixa:389&#10;IP: 10.192.192.61', '', 2, 53, 2, 693, '2018-05-08 08:16:35'),
('INC000001940791', '2018-02-19 17:41:15', '2018-02-19 18:50:35', 'RTC 3853476  Identificamos que uma rotina do sistema SIWMC, no ambiente de homologação, não está sendo realizada devido a uma outra rotina de geração de arquivos do sistema SISMN. A rotina é a geração de um arquivo TXT com a vigência dos manuais normativos do sistema SISMN. O sistema SIWMC não acessa o SISMN e busca esse arquivo. O SISMN é quem gera esse arquivo e o disponibiliza em uma pasta do sistema SIWMC que faz a leitura e importação do mesmo. Essa rotina do sistema SISMN já é executada para o sistema SIWMC no ambiente de produção sem problemas. Pedimos a verificação do problema e seu acerto para que possamos efetuar os testes necessários do sistema SIWMC antes de subir para a produção. (GITECBH05 - PEDES - 7435)&#10;As requisições abertas com o intuito de resolver o problema, sem solução, são: &#10;HMP - REQ000023752325&#10;PRD - REQ000023752307&#10;&#10;O endereço do servidor e pasta para a disponibilização do arquivo txt são:&#10;SIWMC - HMP&#10;https://scthmapllx0021.df.caixa:8543/siwmc/&#10;host scthmapllx0021&#10;scthmapllx0021.df.caixa has address 10.116.114.196&#10;pasta: /var/sistemas/siwmc/importar&#10;&#10;Segue também uma cópia do arquivo txt do ambiente de produção para exemplo e replicação em anexo. Nesse sentido, o arquivo gerado para o ambiente hmp deve ser o mesmo gerado para o ambiente PRD.&#10;&#10;Caso seja necessário, o ambiente PRD onde já é disponibilizado o arquivo txt com a vigência dos manuais normativos, e que deve continuar assim, é:&#10;SIWMC - PRD &#10;https://cctdcapllx0043.df.caixa:8643/siwmc/;&#10;host cctdcapllx0043&#10;cctdcapllx0043.df.caixa has address 10.123.8.82&#10;&#10;Pedimos que analisem as duas requisições informadas caso ainda haja alguma dúvida.&#10;&#10;Nos colocamos à disposição para quaisquer esclarecimentos.', '', 2, 389, 1, 680, '2018-05-08 08:16:35'),
('INC000001940915', '2018-02-16 17:34:32', '2018-02-16 18:05:25', 'O SIUSR está com problemas, o que está afetando alguns sistemas do ProInfo que utilizam o serviço. Verificamos no log que as instâncias do JBoss estão informando a seguinte mensagem: &#10;FATAL: o sistema de banco de dados está desligando &#10;&#10;Favor verificar o PostgreSQL que atende ao SIUSR', 'Não encontramos problema', 2, 388, 3, 704, '2018-05-08 08:16:35'),
('INC000001940973', '2018-02-19 11:43:56', '2018-02-19 12:13:05', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATBR:&#10;- FILA: TODOS 10,71% &#10;- Início da Ocorrência: 11:43', 'Conforme solicitado foi realizado analise do ambiente, os AB1 e devido ao movimento paredista, o atendimento na CERATSP está fora de operação e com isso está indo uma demanda maior de ligações para a localidade CERAT-BR.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
