('INC000001944352', '2018-02-19 01:06:58', '2018-02-19 10:15:01', 'MON 19 FEB, 2018 -01=06=51&#10;DFRPECTC1_2024= DFRPECTC1_2024= THE LINK STATUS OF PORT (NAME - DFRPECTC1_2024, TYPE - GEN_IF_PORT) IS NOW &#34;BAD&#34;.&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - N/A&#10;      CONTATO - N/A&#10;--------&#10;&#10;PROCEDIMENTOS=&#10;&#10;1) ACIONAR A EQUIPE DE SUPORTE--------&#10;&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO&#10;--------&#10;&#10;VEJA A MENSAGEM DO EVENTO PARA MAIORES DETALHES=&#10;&#10;MON 19 FEB, 2018 - 01=06=51 - THE LINK STATUS OF PORT (NAME - DFRPECTC1_2024, TYPE - GEN_IF_PORT) IS NOW &#34;BAD&#34;.&#10;BAD LINK&#10;&#10;(EVENT [0X00010D11])', 'A&#10;CETEC22&#10;&#10;1.   Conforme solicitado a  interface foi retirada de gerencia.&#10;&#10;2.  A disposição para esclarecimentos no ramal 6261.&#10;&#10;Adriana Bergamini&#10;Preposto - Engenharia&#10;Tel:  (11)3201-6261&#10;T I V I T&#10;www.tivit.com.br', 17, 20, 1, 664, '2018-05-08 08:16:35'),
('INC000001944823', '2018-02-18 13:16:09', '2018-02-18 15:09:45', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Item Monitorado: Monitoração.CETEC&#10;Atuação: &#10;&#10;Descrição: &#10;&#10;Informamos que a página do suporte web está apresentando indisponibilidade. Evento foi detectado ás 11h. Equipes responsáveis verificando a ocorrência. &#10;Segue link da página.&#10;http://suporteweb.cetec.df.caixa/Web/Default.aspx&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;61 3206 -1800', 'Prezados, &#10;&#10;Informamos que foram abertas as seguintes WOs para tratamento do evento.&#10;&#10;WO0000024224452 - suporte web&#10;WO0000024224454 - infogsc&#10;&#10;Estamos à disposição para mais informações.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;61 3206 -1800', 4, 77, 1, 34, '2018-05-08 08:16:35'),
('INC000001944828', '2018-02-19 09:29:58', '2018-02-19 09:52:00', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: FGTS&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: FTGS 8% &#10;·  Início da Ocorrência: 09:25', '', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001944830', '2018-02-19 11:18:03', '2018-02-19 12:09:53', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: TIM_MULTIBANK&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: TIM_MULTIBANK 10,48% &#10;·  Início da Ocorrência: 11:00', 'Conforme solicitado foi realizado analise do ambiente, os AB1 e devido ao movimento paredista, o atendimento na CERATSP está fora de operação e com isso está indo uma demanda maior de ligações para a localidade CERAT-BR. Esta fila em especifico e atendida 100% na CERAT-BR, porem os atendentes tem multi skill e por esse motivo estão atendendo outras filas além da  Tim Multbank.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001944837', '2018-02-19 13:54:26', '2018-02-19 14:14:53', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CONTRATO_HABITACAO&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: CONTRATO_HABITACAO 9,1% &#10;·  Início da Ocorrência: 13:50', 'Informamos que foi realizado análise das ligações da Fila Contrato_Habitação da CERATSA e identificamos que não há agentes disponíveis na CERATSA para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Ademais, devido a Greve da CERATSP as ligações foram redirecionadas para CERATBR e CERATSA, com isso o número de ligações para aquelas CERATs estão maior do que o normal e com isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001944839', '2018-02-19 14:08:20', '2018-02-19 18:50:03', 'Serviço: Skype&#10;Tipo de Evento: Indisponibilidade&#10;Ocorrência: Ninguém na unidade consegue abrir o Skype.&#10;Descrição: Em atenção ao incidente INC000001944836 cancelado indevidamente, segue para análise.&#10;&#10;Informamos que conforme acionamento no Service Desk o  Skype encontra-se com indisponibilidad (apresentando Offline para os usuários ) gentileza verificar.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que houve instabilidade, porém o serviço já encontra-se disponível.', 2, 71, 3, 681, '2018-05-08 08:16:35'),
('INC000001944840', '2018-02-19 14:18:59', '2018-02-19 14:44:11', 'informamos que a página intranet.caixa está indisponível.&#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', 'Informamos que devido um problema em um dos servidores do SQL a intranet travou, feito os ajustes em conjunto com a equipe da Cetad para a limpeza do cache AX e cache SharePoint, voltou a funcionar.', 2, 66, 3, 203, '2018-05-08 08:16:35'),
('INC000001944843', '2018-02-19 16:01:11', '2018-02-19 18:05:47', 'Informamos que a intranet.caixa encontra-se indisponível.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Foi feito o cache das notícias e o acesso à intranet foi restabelecido.', 2, 71, 3, 203, '2018-05-08 08:16:35'),
('INC000001944844', '2018-02-19 17:53:59', '2018-02-19 18:23:25', 'O acesso à agencia virtual está indisponível para alguns usuários tanto para produção quanto para homologação, conforme anexo.', 'Foi solicitado a alguns funcionários caixa que realizassem testes no ambiente de PRD e HMP, os mesmos conseguiram logar no ambiente sem nenhum erro.&#10;&#10;Por favor verificar quais são as unidades que estão relatando erros, pois o ambiente é igual para todos.&#10;&#10;Att, &#10;&#10;Paulo Barros', 2, 382, 3, 694, '2018-05-08 08:16:35'),
('INC000001944861', '2018-02-20 08:24:06', '2018-02-20 08:47:52', 'Informamos o acesso a VM cctdcdadnt0031 se encontra indisponível solicitamos verificar com urgência  visto que esta impactando o faturamento do Serviice desk&#10;&#10;&#10;Favor verificar o espaço em disco .', 'Foi identificado falta de espaço no servidor informado, isso gerou a indisponibilidade no mesmo. Após intervenção, o servidor voltou a operar normalmente.', 2, 46, 1, 690, '2018-05-08 08:16:35'),
('INC000001944875', '2018-02-20 13:10:07', '2018-02-23 11:31:52', 'Não estamos conseguindo designar as tarefas de mudança! segue imagem.', 'Prezado Renan&#10;&#10;1 - Os perfis de 2 usuários pertencentes ao grupo B2BR/CETEC/PRONIFO PRODUÇÃO, foram atualizados para o problema apresentado não volte a ocorrer&#10;2 - Por favor para cada usuário pedir para  sair do sistema e entrar novamente no sistema&#10;3 - À disposição&#10;&#10;Atenciosamente&#10;Equipe de Sustentação - GSC', 8, 58, 1, 193, '2018-05-08 08:16:35'),
('INC000001944886', '2018-02-20 19:26:43', '2018-02-20 19:57:47', 'Instalação do Citrix (agencia virtual) na máquina 172.16.141.216 (máquina que a benner utiliza para acesso ao SIAGS)', 'Conforme verificado no anexo, informa a solicitação de instalação do CITRIX, portanto esta requisição não se trata de um incidente e sim uma WO, segue abaixo a categorização correta para a abertura desta solicitação.&#10;&#10;- Tecnologia da Informação e Comunicação&#10;- Software, Aplicativos e Sistemas&#10;- Software e Aplicativos&#10;- Atendimento Software - Instalar/Desinstalar&#10;&#10;Solicitar Agora&#10;&#10; - Já tentou na Central de Software? * - Sim, mas não encontrei o software desejado&#10; - Selecione o Software * - CITRIX RECEIVER&#10; - Selecione a ocorrência * - Instalação&#10; ...', 3, 52, 3, 186, '2018-05-08 08:16:35'),
('INC000001944899', '2018-02-21 10:41:51', '2018-02-21 14:26:43', 'Favor esclarecer sobre a diminuição na capacidade de processamento dos servidores virtuais onde é visto no gráfico do zabbix a diminuição do processamento livre dos servidores. Imagens em anexo.', 'Conforme verificação, as oscilações são causadas devido ao uso da CPU pelos serviços no sistema operacional.', 2, 58, 1, 175, '2018-05-08 08:16:35'),
('INC000001944900', '2018-02-21 10:43:40', '2018-02-21 11:27:50', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE_CONVENIO_COBRANCA_PJ&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATBR:&#10;·  FILA: STE_CONVENIO_COBRANCA_PJ 8,25%&#10;·  Início da Ocorrência: 10:30', 'Identificamos que não há agentes disponíveis na CERATBR para atender as ligações de imediato da Fila STE_CONVENIO_COBRANÇA, conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Também pode ocorrer desconexão dos clientes durante o processo de enqueue com attachment data, em que o cliente desiste da ligação antes de iniciar o processo de transferência da voz enquanto os dados já foram enfileirados por enqueue no contact center. Tais cenários são características da fila e do ambiente, não caracterizando falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001945544', '2018-02-19 13:28:39', '2018-02-19 17:00:30', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Solicitamos providenciar a atualizar do endereço de instalação da UL, conforme abaixo.&#10;a.&#9;Tipo de Serviço: ALTERAÇÃO DE ENDEREÇO&#10;b.&#9;Código UL: 03-001449 - 2&#10;c.&#9;Razão Social: LBA7 CAJ LOTERIAS E SERVICOS LTDA&#10;d.&#9;Nome de Fantasia: LOTERIA SHOPPING CAJAZEIRAS&#10;e.&#9;CNPJ: 13.826.540/0001-70&#10;f.&#9;Quantidade de Terminais: 03&#10;g.&#9;Modelo do Terminal (ais): 4020&#10;h.&#9;N/S do Terminal (ais): 2850183, 2850190, 2840639&#10;i.&#9;Endereço Atual: AV SETE DE SETEMBRO, 750, EDIF SANTO AMARO LOJA 4, MERCES, CEP: 40.060-001, SALVADOR/BA&#10;j.&#9;Novo Endereço: EST DO COQUEIRO GRANDE, 1361, SHOPPING CAJAZEIRAS LJ 0009, CAJAZEIRAS, CEP: 41.342-315, SALVADOR/BA&#10;k.&#9;Nome e Contato do Gerente de Canais e Atendimento: EMMANUEL LIMA E OLIVEIRA&#10;l.&#9;Nome e Contato do Lotérico:   LUCAS BIRIBA, (71) 9 9670-8667', 'Prezado,&#10;&#10;1. O processo de cadastramento e atualização de Unidades Lotéricas é efetuado automaticamente, via integração.&#10;&#10;2. Para isso é necessário que o sistema de origem esteja devidamente atualizado.&#10;&#10;3. Favor verificar junto a equipe responsável pelas unidades lotéricas quando a atualização do endereço.&#10;&#10;Atenciosamente,&#10;Dyego Cirqueira&#10;Sustentação - GSC', 8, 58, 1, 573, '2018-05-08 08:16:35'),
