('INC000001946510', '2018-02-19 23:59:22', '2018-02-20 00:07:17', 'MON 19 FEB, 2018 -23=59=18&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO CS0000SW147&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - &#10;      CONTATO - SUPPORT@EXTREMENETWORKS.COM, +1 888 257 3000&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Conforme verificado, o circuito encontra-se operacional e respondendo ao teste de ping', 10, 144, 1, 46, '2018-05-08 08:16:35'),
('INC000001946515', '2018-02-20 02:09:10', '2018-02-20 02:18:09', 'TUE 20 FEB, 2018 -01=58=03&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO RTDJFCE&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - &#10;      CONTATO - &#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito encontra-se operacional e respondendo ao teste de PING.', 10, 121, 1, 231, '2018-05-08 08:16:35'),
('INC000001946727', '2018-02-20 10:31:10', '2018-02-20 12:41:38', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão &#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207 &#10;&#10;Localidade Afetada: CERAT/SA &#10;&#10;Descrição: &#10;Informamos que a fila FGTS  está com a taxa de AB1 de 9,7%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSA que justifiquem índice maior de AB1.&#10;&#10;Observamos que a CERATSA não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;&#10;Print evidenciando que não há agentes disponíveis para atendimento da fila FGTS na CERATSA:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001946732', '2018-02-20 11:00:36', '2018-02-20 12:21:22', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104 &#10;&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila STE_CANAIS_PF está com a taxa de AB1 de 8,26 % &#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Realizamos uma analise da fila STE_CANAIS_PF observamos na tela de AB1 que esta sendo normalizado e taxa de AB1 reduzindo de acordo com print que segue em anexo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001946733', '2018-02-20 11:06:00', '2018-02-20 16:42:10', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços. Caixa) encontra-se com lentidão em todos módulos. &#10;&#10;- Data Início: 20/02/2018                                                 &#10;- Hora Início: 10:45&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR&#10;J.C.D.B.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001946763', '2018-02-20 22:19:01', '2018-02-20 22:41:02', 'GITECBR_CERAT_REDE4_WCS_&#60;7392-CERAT&#62;', 'abertura de chamado junto operadora.', 7, 394, 2, 676, '2018-05-08 08:16:35'),
('INC000001947604', '2018-02-20 10:24:11', '2018-02-20 12:14:28', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERATBR&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que após monitoração da página http://df7392sr002/Reports/Pages/Report.aspx?ItemPath=%2fAB1%2fAbandonos+-+AB1, foi identificado na fila STE_CONVENIO_COBRANÇA_PJ o AB1 de 10,07%.&#10;&#10;Atenciosamente&#10;Central Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila STE_CONVENIO_COBRANCA_PJ MCDU 8039, bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. No entanto, temos reforçado que a CERATBR está sem gentes suficiente disponíveis para atender a fila STE_CONVENIO_COBRANCA_PJ (segue anexo print demonstrando isso mais uma vez), gerando enfileiramento de chamadas. Quando ocorre enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos, que sejam alocados mais agentes para atender essa fila de modo que não haja ligações pendentes na fila, pois, foi verificado que as desconexões ocorrem de maneira normal, e não por limitação de recurso ou falha na telefonia no ambiente. Quando ocorrer mais alocação de agentes para atender, a taxa de Abandono (e AB1 inclusive) irá diminuir.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001947609', '2018-02-20 11:10:39', '2018-02-20 12:20:27', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Informamos que a fila CONTRATO_HABITACAO está com a taxa de AB1 de 8,1%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Caro Ar. LUCAS FRANCISCO&#10;Conforme solicitado, foi realizado análise do motivo de ocorrência de abandono na fila CONTRATO_HABITACAO com a taxa de AB1 de 8,1%.&#10;Conforme segue figura 01 e 2 em anexo, foi constatado que a fila CONTRATO_HABITACAO não possuía atendentes disponíveis para atendimento caracterizando falta de work force.&#10;Conforme figura 03, 04 e 05 em anexo, concluímos que devido ao tempo alto de espera os clientes estão abandonando a ligação gerando abandono no primeiro intervalo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001947611', '2018-02-20 11:15:39', '2018-02-20 12:35:09', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Informamos que a fila PROGRAMAS_SOCIAIS está com a taxa de AB1 de 8,4%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSA que justifiquem índice maior de AB1.&#10;&#10;Observamos que a CERATSA não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;&#10;Print evidenciando que não há agentes disponíveis para atendimento na CERATSA:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001947901', '2018-02-20 11:48:55', '2018-02-20 12:18:05', 'SIAPA voltou a apresentar o ERRO 500, conforme arquivo anexo.', '', 2, 272, 3, 444, '2018-05-08 08:16:35'),
('INC000001947908', '2018-02-20 17:12:56', '2018-02-20 23:32:58', 'Unidades lotéricas estão reportando ao service desk falha de comunicação com o erro TFGR 024&#10;&#10;Alguns exemplos:&#10;&#10;REQ000024060975 - RJ - TFGR 024&#10;REQ000024060955 - MG - TFGR 024&#10;REQ000024060294 - RS - TFGR 024&#10;REQ000024061819 - BA - TFGR 024&#10;REQ000024060697 - SC - TFGR 024', 'Em contato com William da BT informa que os circuito tiveram erro de comutação devido a forte chuva na região, não houve intervenção técnica e normalizaram as 21:33hrs do dia 20/02/2018.', 21, 114, 3, 596, '2018-05-08 08:16:35'),
('INC000001947961', '2018-02-21 09:58:43', '2018-02-21 12:29:47', 'Prezados, o SIAPA continua apresentando ERRO 500. Solicitamos urgência no solucionamento do problema, visto a necessidade de atendimento das demandas da Presidência.', '', 2, 272, 3, 444, '2018-05-08 08:16:35'),
