('INC000001948241', '2018-02-20 14:36:41', '2018-02-20 14:47:40', 'TUE 20 FEB, 2018 -14=36=37&#10;PARSBLM6 - A INTERFACE&#10;NOME= 0 TU200222&#10;DESC= BKB-PARSBLM6_G0/3«=»DFTSRDTC1C_G2/2/13_OI_«BLM7179182»&#10;IP=192.168.253.209 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito já está sendo tratado pelo INC000001948226', 10, 32, 1, 165, '2018-05-08 08:16:35'),
('INC000001948305', '2018-02-20 13:24:13', '2018-02-20 13:27:18', 'TUE 20 FEB, 2018 -13=24=08&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO CS0000SW147&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - &#10;      CONTATO - SUPPORT@EXTREMENETWORKS.COM, +1 888 257 3000&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Conforme verificado não houve indisponibilidade do dispositivo.', 10, 144, 1, 46, '2018-05-08 08:16:35'),
('INC000001948420', '2018-02-21 10:49:05', '2018-02-21 14:05:23', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: &#10;Informamos que o ITSM (serviços. Caixa) encontra-se em extrema lentidão em todos módulos. &#10;&#10;- Data Início: 21/02/2018                                                 &#10;- Hora Início: 10:30', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001948867', '2018-02-20 15:25:16', '2018-02-20 15:29:19', 'TUE 20 FEB, 2018 -15=25=10&#10;DFTSRDTC1 - A INTERFACE&#10;NOME= 0 TUNNEL5/0/200&#10;DESC= BKB-DFTSRDTC1C_G2/2/13«=»PARSBLM6-G0/3_OI_«BLM7179182»&#10;IP=192.168.253.208 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Circuito já sendo tratado na WO0000024280547', 10, 23, 1, 101, '2018-05-08 08:16:35'),
('INC000001950310', '2018-02-20 20:40:03', '2018-02-21 02:13:02', '', 'Abertura de chamado junto a operadora.', 7, 299, 2, 615, '2018-05-08 08:16:35'),
('INC000001950312', '2018-02-21 04:11:53', '2018-02-21 04:40:13', '', 'Abertura de chamado junto a operadora.', 7, 18, 2, 407, '2018-05-08 08:16:35'),
('INC000001950318', '2018-02-21 13:10:32', '2018-02-21 15:03:40', 'O SIAPA está apresentando intermitência nos últimos dias, gerando impossibilidade de acesso e reclamações dos usuários. Apresentando ERRO 500, conforme imagem anexa. Peço solução definitiva ou abertura de &#34;Problema&#34; para investigação das causas das sucessivas indisponibilidades.', '', 2, 272, 4, 444, '2018-05-08 08:16:35'),
('INC000001950320', '2018-02-21 13:52:54', '2018-02-21 14:37:33', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila FGTS está com a taxa de AB1 de 8,7%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que foi realizado análise das ligações da Fila FGTS da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001950330', '2018-02-21 17:33:46', '2018-02-21 19:49:33', 'Estamos recebendo acionamentos no Service Desk de usuários relatando impossibilidade de acesso ao SIPNL pelos empregados da unidade, visto que o sistema retorna a mensagem criticando usuário ou senha.&#10;Foi verificar que, aparentemente não se trata de falha no sincronismo de senhas. Só acontece com o SIPNL e é com todos os empregados da unidades.&#10;Alguns exemplos:&#10;&#10;WO0000024297555 - 1131-TEIXEIRA DE FREITAS, BA&#10;WO0000024298279 - 0427-ARARANGUA, SC&#10;WO0000024299545 - 0613-IGUATU, CE&#10;WO0000024299706 - 1244-MARICA, RJ&#10;WO0000024298981 - 4566-IRANDUBA, AM', 'A&#10;&#10;UNIDADE,&#10;&#10;Senhor (a) Usuário (a)&#10;&#10;1&#9;Informamos que foi identificado falha no acesso ao gerenciador de atendimento para alguns usuários, sendo que após o usuário informar matricula e senha, está sendo apresentada a mensagem  de &#34;usuário e/ou senha inválido&#34;.&#10; &#10;2&#9;Comunicamos que a Área Gestora e de desenvolvimento já foi acionada para análise e estão trabalhando para corrigir o problema, e está CN CETEC continuará acompanhando a ocorrência, gentileza aguardar.&#10;&#10;3&#9;Desta forma, este chamado está sendo encerrado.&#10;&#10;4.  Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção Sênior&#10;Canais Agência Stefanini/CETEC', 5, 244, 2, 702, '2018-05-08 08:16:35'),
('INC000001950360', '2018-02-22 10:29:07', '2018-02-22 11:05:10', 'BKB_C-SPTSROCO1-G1/0/11&#60;=&#62;BARRSDR9_G3/0/7_LV3_&#60;L26006&#62;&#10;&#10;Spectrum não gerou incidente automaticamente, gerado incidente manual.', 'Vide notas', 7, 45, 4, 632, '2018-05-08 08:16:35'),
('INC000001950363', '2018-02-22 11:12:13', '2018-02-22 13:50:47', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: COMERCIAL&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505 &#10;&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila TIM_MULTIBANK está com a taxa de AB1 de 8,61 % &#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Após análise identificamos que a taxa de abandono nas ligações da fila TIM_MULTIBANK são oriundas de desconexão das chamadas no ambiente externo evidenciadas através do evento BYE. Segue anexo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
