('INC000001950605', '2018-02-21 12:04:04', '2018-02-21 15:30:59', 'Estamos recebendo acionamentos no Service Desk de usuários relatando impossibilidade de acesso ao SIPNL pelos empregados da unidade, visto que o sistema retorna a mensagem criticando usuário ou senha.&#10;Foi verificar que, aparentemente não se trata de falha no sincronismo de senhas. Só acontece com o SIPNL e é com todos os empregados da unidades.&#10;Alguns exemplos:&#10;&#10;WO0000024297555 - 1131-TEIXEIRA DE FREITAS, BA&#10;WO0000024298279 - 0427-ARARANGUA, SC&#10;WO0000024299545 - 0613-IGUATU, CE&#10;WO0000024299706 - 1244-MARICA, RJ&#10;WO0000024298981 - 4566-IRANDUBA, AM', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Informamos  que as bases se consulta do SIICO estão todas atualizadas.&#10;&#10;Informaos também que a administração dos servidores abaixo não é pernitente a PROINFO.&#10;&#10;host 1131.atendimento.caixa&#10;1131.atendimento.caixa is an alias for ba0000sr522.corp.caixa.gov.br.&#10;ba0000sr522.corp.caixa.gov.br has address 10.123.21.22&#10;&#10;host 0427.atendimento.caixa&#10;0427.atendimento.caixa is an alias for sc0000sr611.sc.caixa.&#10;sc0000sr611.sc.caixa has address 10.123.11.11&#10;&#10;host 1244.atendimento.caixa&#10;1244.atendimento.caixa is an alias for rj7469sx033.corp.caixa.gov.br.&#10;rj7469sx033.corp.caixa.gov.br has address 10.123.26.19&#10;&#10;host 4566.atendimento.caixa&#10;4566.atendimento.caixa is an alias for am7458sr', 2, 244, 2, 702, '2018-05-08 08:16:35'),
