('INC000001950717', '2018-02-21 10:51:12', '2018-02-21 11:07:59', 'Prezados, solicitamos verificar a indisponibilidade do SIPII COP módulo Internet. Erro 504 Gateway Time-out', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;   Não foi tomada nenhuma ação, pois a página SIPII-COP encontra-se disponível conforme evidếncia.', 2, 67, 3, 445, '2018-05-08 08:16:35'),
