('INC000001951220', '2018-02-21 15:36:30', '2018-02-21 16:14:28', '1                    Identificamos que a rotina de Imposto de Renda do SIAGS está demorando excessivamente para processar.&#10;2                    Necessitamos melhorar a performance do processamento, e par tanto solicitamos excepcionalmente, que seja rodada a estatística do banco do SIAGS hoje, iniciando às 17hs.&#10;3                    O processamento necessita ser concluído em tempo hábil para as devidas correções, e consequente reprocessamento, para que os demonstrativos sejam disponibilizados para os beneficiários e prestadores.', 'Atualização de estatística foi automatizada, mas por conta do incidente também será executado hoje as 17hrs.', 2, 52, 1, 187, '2018-05-08 08:16:35'),
('INC000001951233', '2018-02-22 11:25:20', '2018-02-22 13:16:50', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERATSP&#10;&#10;Descrição: Informamos que a fila STE_CONVENIO_COBRANCA_PJ está com a taxa de AB1 de 8,7%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Realizamos analise da referida fila com base nas informações coletadas a partir do banco de dados Informix do Servidor OSCC da CERAT-SP e ao analisar o fluxo das chamadas com base nos números de origem cujas chamadas desconectaram no intervalo de 0 a 10 segundos, constatamos que estava ocorrendo desconexão externa por desistência na origem (usuário) nesse caso não há falha de telefonia no ambiente. Verificamos no entanto que o a percentual de AB1 baixou no decorrer das ultimas horas. Segue em anexo analise.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001951259', '2018-02-23 09:55:43', '2018-02-23 12:11:07', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Programas Sociais&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207 &#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Informamos que a fila Programas Sociais  está com a taxa de AB1 de  8,0%&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'As altas taxas de AB1, estão ocorrendo devido a falhas constantes no ambiente virtualizado, VCenter.&#10;Estas falhas estão causando a perca de sincronia nos servidores do Telesserviço, pois as VMs estão migrando de hosts físicos e causando a desconexão de todas as ligações em curso.&#10;O Cetec está ciente do problema e estão atuando para corrigir o mesmo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001951260', '2018-02-23 09:55:44', '2018-02-23 12:15:11', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila STE_OP_SOCIAL_PJ está com a taxa de AB1 de 10,9%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'As altas taxas de AB1, estão ocorrendo devido a falhas constantes no ambiente virtualizado, VCenter.&#10;Estas falhas estão causando a perca de sincronia nos servidores do Telesserviço, pois as VMs estão migrando de hosts físicos e causando a desconexão de todas as ligações em curso.&#10;O Cetec está ciente do problema e estão atuando para corrigir o mesmo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001951261', '2018-02-23 09:56:26', '2018-02-23 12:14:09', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila STE_SOCIAL_PJ  está com a taxa de AB1 de 17,3%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'As altas taxas de AB1, estão ocorrendo devido a falhas constantes no ambiente virtualizado, VCenter.&#10;Estas falhas estão causando a perca de sincronia nos servidores do Telesserviço, pois as VMs estão migrando de hosts físicos e causando a desconexão de todas as ligações em curso.&#10;O Cetec está ciente do problema e estão atuando para corrigir o mesmo.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001951262', '2018-02-23 10:06:47', '2018-02-23 10:47:38', 'Prezados,&#10;Recebemos diversas requisições de serviços de usuários do SIIAC alegando que não conseguem acessar o sistema. É mostrada a seguinte msg: &#34;O usuário ou senha não estão corretos, ou não há permissão de acesso ao sistema&#10;(A tela de login será reapresentada em 5 segundos)&#34; &#10;Informamos que os usuários acessavam normalmente o sistema.&#10;Segue matrícula de um usuário que relatou o problema C109231&#10;Pedimos verificar', '“Prezado (a) Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;&#10;&#10;1-) Reciclagem das instancias utilizadas(restart);&#10;2-) Recadastramento dos servidores junto ao SIUSR; &#10;&#10;&#10;Pede-se a gentileza de realizarem o teste, caso o erro pesista reabrir o INC.', 2, 59, 3, 394, '2018-05-08 08:16:35'),
('INC000001951282', '2018-02-23 21:45:40', '2018-02-24 16:42:55', 'CEPTISP_Se1/2.1_CEXE_TAM_PEC_VVO_&#60;3681-2660&#62;', 'Sem intervenção pela Operadora.', 7, 165, 2, 643, '2018-05-08 08:16:35'),
('INC000001951300', '2018-02-24 11:18:40', '2018-02-24 12:29:02', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSP:&#10;- FILA: BOLSAS 10,3% &#10;- Início da Ocorrência: 11:18', 'Prezados,&#10;&#10;Recebemos o report da equipe de Monitoria que está havendo alto índice de AB1 na CERATSP.&#10;&#10;Através de testes pelo piloto 8888, direcionado ao anúncio ann116, identificamos por meio de monitoração que o Media Server 10.123.124.37 está desconectando as chamadas, conforme segue print abaixo:&#10;Verificamos os serviços do OMS e constatamos que estão operacionais, conforme abaixo.&#10;Tendo em vista que os serviços estão operacionais mas o Media Server está desconectando chamadas (ICMP Destination unreachable - port unreachable), optamos por bloquear o Media Server 10.123.124.37 (MS_CERATRJ_01) pelo OSV até que seja feita uma análise mais apurada, conforme segue:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001952721', '2018-02-22 10:28:06', '2018-02-22 12:50:15', '', 'Vide notas', 7, 164, 3, 709, '2018-05-08 08:16:35'),
