('INC000001953218', '2018-02-22 11:08:38', '2018-02-22 12:12:51', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Cidadão&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila FGTS está com a taxa de AB1 de 8,1%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Caríssima Srta. DAYSE MARIA SILVA DO PRADO&#10;Conforme solicitado, foi realizado a análise da fila FGTS está com a taxa de AB1 de 8,1%.&#10;Conforme consta no anexo na figura 01, a fila FGTS CERATSA, está com alta demanda de chamadas e todos os atendentes estão em atendimento e isto gera fila de espera e por está causa os clientes que ficam na espera estão abandonando a chamada antes de ser atendido conforme consta no anexo, as ligações (TERMINED com poucos segundos) na figura 02 e 03.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001953230', '2018-02-22 16:54:45', '2018-02-22 17:23:01', 'Sistema fora do ar, autenticação não entra, deve ser o LoginX, problema altamente recorrente:&#10;&#10;sidurweb.caixa', '', 2, 381, 3, 692, '2018-05-08 08:16:35'),
('INC000001953231', '2018-02-22 17:15:51', '2018-02-22 17:29:28', 'Verificar se os scripts de atualização noturna ARQUIVOS_SIAPF.sh e BD.sh continuam agendados no cron e sendo executados no servidor de bd cctdcdadlx0001.df.caixa, sistema sidurweb.caixa', '“Prezado (a) Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;&#10;Prezados, informamos que esse tipo de solicitação deve ser realizado através de requisição de serviços, e não como INC', 2, 381, 1, 691, '2018-05-08 08:16:35'),
('INC000001953235', '2018-02-22 18:48:25', '2018-02-22 19:33:01', 'O http://permissoes.correio.corp.caixa.gov.br/ está indisponível, conforme tela anexa.', '', 16, 378, 3, 689, '2018-05-08 08:16:35'),
('INC000001953279', '2018-02-25 12:25:28', '2018-02-25 14:07:22', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Disponibilidade Parcial&#10;&#10;Descrição: Solicitamos verificar visto que por volta das 02h24 até o momento não estão sendo gerados  Incidentes automáticos para as rotinas que apresentaram cancelamento. &#10; Segue abaixo algumas evidencias: &#10;&#10;A rotina cancelou às 02h24 e não gerou incidente automático. &#10;&#10;GIP06MZA 0035831 250218 02:24  234:27 00220 C1000  ENDED- NOT &#34;OK&#34; DUE TO CC &#10;                                                   (RESTARTED)              &#10;&#10; &#10;A rotina cancelou às 11h59 e não gerou INC automático. &#10;&#10;CTB01MZC 0037340 250218 11:59    0:00 00028 JFAIL  ENDED- NOT &#34;OK&#34; - TERM ON                                                    NCT2', 'Prezado, boa tarde.&#10;&#10;Verificamos que houve uma falha de comunicação no servidor de integração, após o restart foi corrigida. &#10;&#10;Favor validar e caso a falha continue, abrir um chamado de erro no servicos-caixa corretamente com evidencias.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 574, '2018-05-08 08:16:35'),
('INC000001953297', '2018-02-26 16:30:47', '2018-02-26 19:28:57', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informo que o portal http://conformidadecmdb.servicos.caixa &#10;encontra-se indisponível.&#10;&#10;Favor verificar.&#10;&#10;Atenciosamente,&#10;&#10;Egilson.', 'Prezado,&#10;&#10;1. Verificamos o ambiente de produção do SIGSC e não constatamos lentidão neste momento.&#10;&#10;2. Em entendimento com a Gestão de Incidentes da CETEC, efetuaremos o fechamento deste regisatro, uma vez que, a investigação e resolução do problema se dará por parte da equipe do PROINFO.&#10;&#10;3. Conforme mencionado anteriormente, a lentidão está relacionada com a falta de recursos computacionais do PROINFO.&#10;&#10;4. Salientamos que será efetuada a abertura de Problema para tratamento.&#10;&#10;5. Para maiores informações, entrar em contato com a CETEC84. &#10;&#10;Atenciosamente,&#10;Dyego Cirqueira&#10;Sustentação - GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
