('INC000001955902', '2018-02-23 15:19:25', '2018-02-23 16:26:32', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: À&#10;CETEC,&#10;&#10;Informamos que o ITSM (serviços.caixa) encontra-se com extrema lentidão no que tange os módulos de Mudanças, Serviços e Incidentes.&#10;&#10;- Data Início: 23/02/2018                                                 &#10;- Hora Início: 15:15&#10;&#10;Atenciosamente,&#10;&#10;Dayse Lucie&#10;CPM/CEPTIBR/Central de atendimento&#10;Ramal: 6432', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001956103', '2018-02-23 17:06:47', '2018-02-23 17:43:35', 'Recebemos relatos do Gestor de que o SICBC está apresentando instabilidade no dia de hoje.&#10;&#10;Em consulta ao log do tomcat, via JBossLogs, constatamos alta incidência de mensagens como a seguinte:&#10;&#10;Caused by: org.postgresql.util.PSQLException: This connection has been closed.&#10;&#10;Solicitamos avaliar.', '', 2, 55, 2, 695, '2018-05-08 08:16:35'),
('INC000001956154', '2018-02-26 11:30:06', '2018-02-26 14:22:57', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: SIGSC com lentidão, o mesmo está demorando certa de quase 01 minuto para abrir um chamado e 01 min para atualizara  designação. Logo a tratava de um chamado fica cerca de 03 minutos.', 'Prezado. bom dia.&#10;&#10;Existe um problema sendo tratado pela Proinfo devido a falta de recurso e sobrecarga no cluster de VMs dos servidores do GSC, com isso,  deveremos ter esses incômodos de lentidão até a solução definitiva do problema.&#10;&#10;Requisição que está sendo tratada pela Proinfo: REQ000024070692.&#10;Nova requisição: REQ000024179475.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001956158', '2018-02-26 14:44:45', '2018-02-27 06:47:42', 'ABERTO POR MONITORAÇÃO MAINFRAME / G&#38;P', 'VIDE NOTA', 7, 13, 1, 716, '2018-05-08 08:16:35'),
('INC000001956454', '2018-02-26 15:27:04', '2018-02-26 15:52:07', 'Informamos que não está sendo possível preencher o campo &#34;Designado para a solicitação&#34; da ordem de trabalho.&#10;Está acontecendo com todos os casos que fizemos teste.&#10;Exemplo anexo.', 'Prezado&#10;&#10;1 - Pedimos desculpas pelo inconveniente, pois tínhamos acertados os registros para as Tarefas de Mudanças;&#10;2 - Acabamos de acertar os dados para os registros de designação dos chamados de Ordem de trabalho, agora os dados estão devidamente acertados&#10;3 - Por favor refaça a operação para efetivação do acerto&#10;4 - À disposição&#10;&#10;Atenciosamente&#10;Equipe de Sustentação - GSC', 8, 58, 1, 699, '2018-05-08 08:16:35');
INSERT INTO `tb_ocorrencia` (`incidente`, `criado`, `resolucao`, `descricao_problema`, `descricao_solucao`, `fk_grupo_designado`, `fk_ic`, `fk_prioridade`, `fk_sumario`, `registro_base`) VALUES
('INC000001956455', '2018-02-26 16:26:47', '2018-02-26 19:28:31', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Informamos que o SIGSC está com extrema lentidão em todos os módulos, conforme informado no INC000001958618 que o problema estava sendo tratado nos INC&#39;s: INC000001957323 e INC000001944899, porém os incidentes não foram fechados e o problema persiste.', 'Prezado,&#10;&#10;1. Verificamos o ambiente de produção do SIGSC e não constatamos lentidão neste momento.&#10;&#10;2. Em entendimento com a Gestão de Incidentes da CETEC, efetuaremos o fechamento deste regisatro, uma vez que, a investigação e resolução do problema se dará por parte da equipe do PROINFO.&#10;&#10;3. Conforme mencionado anteriormente, a lentidão está relacionada com a falta de recursos computacionais do PROINFO.&#10;&#10;4. Salientamos que será efetuada a abertura de Problema para tratamento.&#10;&#10;5. Para maiores informações, entrar em contato com a CETEC84. &#10;&#10;Atenciosamente,&#10;Dyego Cirqueira&#10;Sustentação - GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001956880', '2018-02-26 09:49:50', '2018-02-26 10:43:02', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGSC&#10;Atuação: GSC - ITSM - Aplicação MQ Client&#10;&#10;Descrição: Prezados, &#10;&#10;Informamos que houve a partir das 09:00 hs aumento no número de mensagens travadas na fila LQ.RSP.SERVICO.ITSM na aplicação MQ.&#10;&#10;Lais Carvalho&#10;Central de Atendimento - STEFANINI &#10;CETEC - CN Tecnologia da Informação', 'Senhor solicitante,&#10;&#10;Informamos que o serviço foi restartado, e a fila normalizada.&#10;&#10;att,&#10;Kristian Pacheco&#10;CSC Brasil', 8, 58, 1, 34, '2018-05-08 08:16:35'),
('INC000001956974', '2018-02-26 12:00:56', '2018-02-26 13:46:31', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: CIDADÂO: 0800 726 0207&#10;&#10;Localidade Afetada: CERATSA&#10;&#10;Descrição: Informamos que a fila FGTS está com a taxa de AB1 de 8,0%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSA que justifiquem índice maior de AB1 verificamos alguns números de origem de AB1 e constatamos que a desconexão vem do ambiente externo feito pelo próprio cliente observados nos anexos com evento BYE causa normal.&#10;Observamos que a CERATSA não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas no primeiro intervalo, gerando AB1 como segue o anexo do relatório.&#10;Segue em anexo 26-02 FGTS INCIDENTE', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001956985', '2018-02-26 13:13:45', '2018-02-26 13:30:56', 'Favor restabelecer a instância do SIIVG', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Informamos que a aplicação encontra-se acessivel.', 6, 61, 3, 198, '2018-05-08 08:16:35'),
('INC000001957301', '2018-02-24 11:19:28', '2018-02-24 12:31:49', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSP:&#10;- FILA: PROGRAMAS_SOCIAIS 10,2% &#10;- Início da Ocorrência: 11:18', 'Prezados,&#10;&#10;Recebemos o report da equipe de Monitoria que está havendo alto índice de AB1 na CERATSP.&#10;&#10;Através de testes pelo piloto 8888, direcionado ao anúncio ann116, identificamos por meio de monitoração que o Media Server 10.123.124.37 está desconectando as chamadas, conforme segue print abaixo:&#10;Verificamos os serviços do OMS e constatamos que estão operacionais, conforme abaixo.&#10;Tendo em vista que os serviços estão operacionais mas o Media Server está desconectando chamadas (ICMP Destination unreachable - port unreachable), optamos por bloquear o Media Server 10.123.124.37 (MS_CERATRJ_01) pelo OSV até que seja feita uma análise mais apurada, conforme segue:', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001957304', '2018-02-24 15:05:21', '2018-02-24 15:59:06', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CORMERCIAL&#10;&#10;Números Afetados: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSP:&#10;- FILA: TIM_MULTIBANK 12,33% &#10;- Início da Ocorrência: 15:04', 'Efetuamos uma análise do comportamento da fila e constatamos que o AB1 da fila está sendo ocasionada por desconexão pelos próprios clientes em 90% dos casos analisados (Efetuamos análise das últimas 10 ligações abandonadas no primeiro intervalo), conforme documento em anexo. O único caso que foi evidenciada falha foi no ambiente da operadora Embratel, em que na ligação do número de origem 53991261688, recebemos o evento -500 (Server Internal Error UDP). Esse foi a única falha encontrada de ligação, ocasionada por ambiente externo. Concluímos portanto que não há nenhuma falha interna no ambiente.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001957323', '2018-02-26 13:24:16', '2018-02-26 14:46:49', 'Favor esclarecer sobre a diminuição na capacidade de processamento dos servidores virtuais onde é visto no gráfico do zabbix a diminuição do processamento livre dos servidores. Imagens em anexo.', 'Prezado solicitante , após verificar o anexo dos gráficos zabbix, ficou claro que há recursos disponíveis nos servidores, uma vez que o que ocorreu foi a alteração do &#34;Idle time&#34;, tempo ocioso do processador , de 100% para 60% , que indica que houve uma carga de processamento de 40% dos recursos disponíveis, indicando operação normal. Favor verificar o IC de abertura para 7562APl-SIGSC e não 7562APL-SIGCS. Em caso de maiores verificações, favor abrir um PBI e solicitar um grupo de trabalho para verificação.', 6, 58, 1, 175, '2018-05-08 08:16:35'),
