('INC000001957381', '2018-02-27 11:03:35', '2018-02-27 14:09:09', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de Lentidão&#10;- Data Início: 27/02/2018                                                 &#10;- Hora Início: 10h40&#10;&#10;Atenciosamente,&#10;Manoel&#10;CEPTIBR / CPM - Central de Atendimento&#10;Ramal:(61)3448-6437', 'Prezado(a), bom dia.&#10;&#10;Ambiente normalizado, após do restart do servidor.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
