('INC000001958618', '2018-02-26 11:03:55', '2018-02-26 14:25:15', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: &#10;Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se com extrema lentidão no que tange os módulos de Mudanças, Serviços e Incidentes.&#10;&#10;&#10;- Data Início: 26/02/2018                                                 &#10;- Hora Início: 10:45&#10;&#10;Atenciosamente&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezado. bom dia.&#10;&#10;Existe um problema sendo tratado pela Proinfo devido a falta de recurso e sobrecarga no cluster de VMs dos servidores do GSC, com isso,  deveremos ter esses incômodos de lentidão até a solução definitiva do problema.&#10;&#10;Requisição que está sendo tratada pela Proinfo: REQ000024070692.&#10;Nova requisição: REQ000024179475.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
