('INC000001958647', '2018-02-27 11:19:39', '2018-02-27 14:08:50', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Solicitamos verificação no sistema, visto que está extremamente lento e travando.&#10;&#10;Aguardamos e agradecemos', 'Prezado(a), bom dia.&#10;&#10;Ambiente normalizado, após do restart do servidor.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001958648', '2018-02-27 12:39:46', '2018-02-27 13:30:46', 'O servidor RS0000SR137 que possui a nossa base do SIICO e é base de diversas aplicações do PEDES está indisponível. Solicitamos tratamento tempestivo.', 'Foi verificado que o host RS0000SR137 , sofreu boot por parte do user da própria ( GITEC_PO ( Nome de usuário: p735893 ,Nome completo: Sergio Lemos Rodrigues) conforme evidências e Encontra-se Disponível.&#10;&#10;Segue também as considerações:&#10;&#10;1 - O host em questão é de responsábilidade da propria GITEC_PO , não havendo ações por parte da equipe PROINFO/Mais2x.&#10;&#10;2 - O host encontra-se disponível e o boot foi feito por um prestador da GITEC_PO.&#10;&#10;3 - A GITEC_PO não atende a incidentes e por tanto a abertura deste para a equipe CETEC/PROINFO MAIS2x não deve ocorrer uma vez que não temos atuação nos servidores da GITEC (IC 7259APL-SIICO não é da CETEC).&#10;&#10;4 - Seguem evidências.', 2, 366, 4, 687, '2018-05-08 08:16:35'),
