('INC000001960711', '2018-02-27 12:50:10', '2018-02-27 14:05:50', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: CIDADÃO&#10;&#10;Números Afetados: 0800 726 0207&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: FGTS 8,4% &#10;- Início da Ocorrência: 12:49', 'Informamos que foi realizado análise das ligações da Fila FGTS da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001960716', '2018-02-27 17:16:18', '2018-02-27 18:05:36', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE (Suporte Tecnológico)&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: STE_CONVENIO_COBRANCA_EP 8,0% &#10;- Início da Ocorrência: 17:16', 'Informamos que foi realizado análise das ligações da Fila STE_CONVENIO_COBRANÇA_EP da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001960728', '2018-02-27 23:00:54', '2018-02-28 23:45:27', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Disponibilidade Parcial&#10;&#10;Descrição: Favor verificar possível falha no envio de email no dia 09/02/2018.&#10;&#10;Foi evidenciado em log pela CEPTIBR  a geração e entrega do arquivo contendo as faturas de cartao a serem enviadas pela CETEC.&#10;&#10;INFO 12/02/2018 00:05:41 main br.gov.caixa.cartao.fatura.main.Main 258 - Arquivo = PCS.MZ.BDT2.C528.FENVEMA4.D180209.txt, Status = OK, Mensagem = OK;&#10;INFO 12/02/2018 00:05:41 main br.gov.caixa.cartao.fatura.main.Main 258 - Arquivo = PCS.MZ.BDT2.C529.FENVEMC4.D180209.txt, Status = OK, Mensagem = OK;&#10;INFO 12/02/2018 00:05:41 main br.gov.caixa.cartao.fatura.main.Main 262 &#10;&#10;Dessa forma solicitamos evidencia da transmissão das faturas via email do dia 09/02/2018.', 'Prezado(a) Usuário(a),&#10;&#10;1. Sua demanda não poderá ser atendida por esta Requisição.&#10;&#10;2. Por gentileza, abrir nova solicitação, conforme abaixo:&#10;   2.1 Tecnologia da Informação e Comunicação&#10;   2.2 Software, Aplicativos e Sistemas&#10;   2.3 SERVIÇOS.CAIXA&#10;   2.4 Reportar erro no SERVIÇOS.CAIXA&#10;&#10;À disposição para eventuais dúvidas.&#10;&#10;Atenciosamente,&#10;&#10;João Santos&#10;Equipe Sustentação - SIGSC', 8, 58, 2, 574, '2018-05-08 08:16:35'),
