('INC000001961706', '2018-02-27 16:17:32', '2018-02-27 17:12:16', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: PROGRAMAS_SOCIAIS&#10;&#10;Números Afetados: CIDADÃO: 0800 726 0207&#10;&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição:   Foi identificado uma ocorrência AB1 na CERATSA:&#10;·  FILA: PROGRAMAS_SOCIAIS 8,1%&#10;·  Início da Ocorrência: 16:15', 'Informamos que foi realizado análise das ligações da Fila Programas_Sociais da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001961720', '2018-02-28 12:30:35', '2018-02-28 15:20:18', 'Verificamos que o SIPNL parou de zerar o movimento do dia anterior, conforme reportado pela agência piloto João Negrão, o que gera um pequeno transtorno para as agências no piloto já que as senhas e painéis acabam continuando no movimento anterior. Informamos que o zeramento é efetuado via job agendado no Oracle para execução diária as 02:00.&#10;Orientamos checar o log de execução do job PNLJB001_ENCERRAMENTO para verificar se houve alguma falha de execução.', 'À&#10;CETEC64-Proinfo,&#10;&#10;1.      Tendo em vista se tratar do ambiente centralizado do gerenciador de atendimento, na versão 3.0, solicitamos a analise e atuação necessária por parte desta CETEC64.&#10;&#10;2.      Colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;André Oliveira&#10;Stefanini/ CETEC', 2, 244, 1, 701, '2018-05-08 08:16:35'),
