('INC000001962716', '2018-02-28 11:20:31', '2018-02-28 11:37:24', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Disponibilidade Parcial&#10;&#10;Descrição: Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (servicos.caixa) encontra-se normalizado no que tange os módulos de Mudanças, Serviços e Incidentes. &#10;&#10;- Data Início: 28/02/2018                                                 &#10;- Hora Início: 10:50&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Conforme mencionado na abertura do incidente,  os módulos de Mudanças, Serviços e Incidentes realmente encontram-se normalizados.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 574, '2018-05-08 08:16:35'),
('INC000001962731', '2018-02-28 18:40:24', '2018-02-28 22:36:43', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Base Desatualizada&#10;&#10;Descrição: Solicitamos registro de incidente via REQ para CETEC informando erro na classificação automática de &#34;prioridade&#34;.&#10;No print em  anexo, evidências de registros classificados com &#34;Urgência 1&#34; e &#34;Impacto 4&#34; que deveriam resultar em &#34;Prioridade 2 - Alta&#34; e estão indevidamente classificados com &#34;Prioridade 3 - Média&#34;.', '', 13, 58, 1, 573, '2018-05-08 08:16:35'),
('INC000001962765', '2018-03-02 12:27:42', '2018-03-02 16:58:07', 'apf.caixa está indisponível desde ontem a tarde', 'Prezado,&#10;&#10;Informamos que o evento está sendo tratado através do incidente INC000001962768.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 3, 4, 3, 177, '2018-05-08 08:16:35'),
('INC000001962766', '2018-03-02 15:26:03', '2018-03-02 16:21:56', 'Informamos que a página: http://indicadores.gerti.caixa/ apresenta indisponibilidade, conforme email recebido a mudança para o endereço: http://supere.caixa/ será a partir do dia 05/03/2018, gentileza analisar.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Senhores(as), informamos que o servidor DF7562SR830 cujas rotinas atualizam a base do SINGE está offline. A CETEC84 já foi acionada. &#10;&#10;&#10;Att,&#10;Wdarles Leivas', 4, 37, 3, 202, '2018-05-08 08:16:35'),
('INC000001962767', '2018-03-02 15:52:06', '2018-03-02 16:47:55', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Item Monitorado: SIGAT&#10;Atuação: Servidores&#10;&#10;Descrição: Informamos que apresenta um desastre na ferramenta ZABBIX - SIGAT, gentileza analisar.&#10;Host: SP1227NT100&#10;Assunto: Free disk space is less than 5% on volume C:&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'A &#10;&#10;Central de Atendimento,&#10;&#10;Senhor Gerente,&#10;&#10;1. Informamos que no servidore listado abaixo, foram executados os procedimentos listados abaixo para liberar espaços e evitar travamentos.&#10;&#10;• Paramos e Reinicializamos os processos da DLLHST3G.exe.&#10;• Limpamos as pastas temporária do servidor em questão onde o Server ficou com espaço livre em C: acima de 8 GB.&#10;.   A situação encontra-se regularizada.&#10;&#10;2.  Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção SR&#10;Canais Agência Stefanini/CETEC - CN', 5, 57, 1, 34, '2018-05-08 08:16:35'),
('INC000001962768', '2018-03-02 15:58:19', '2018-03-02 17:31:02', 'apf.caixa está indisponível desde ontem a tarde', 'O serviço foi restabelecido conforme evidência da +2x.&#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 2, 65, 3, 201, '2018-05-08 08:16:35'),
('INC000001962771', '2018-03-02 17:08:41', '2018-03-02 18:11:43', 'Tipo: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Serviço: SERVICE DESK&#10;Descrição: Painel Service Desk&#10;&#10;Prezados,&#10;&#10;favor verificar indisponibilidade do Painel Service Desk. O mesmo fica carregando e não abre.&#10;&#10;Segue tela em anexo.', 'Situação regularizada', 4, 159, 3, 135, '2018-05-08 08:16:35'),
('INC000001962776', '2018-03-02 18:28:14', '2018-03-02 18:43:54', 'Favor reiniciar a instaria do SIIVG', 'O serviço foi reiniciado e está up.&#10;&#10;Mais2x', 6, 61, 3, 198, '2018-05-08 08:16:35'),
('INC000001962788', '2018-03-04 03:20:59', '2018-03-04 03:29:59', 'Description: CEPTISP_Se5/1.9_CEXE_PANAMERICANO_PEC_VVO_128Kb_&#60;3681-2649', 'Serviço contigenciado', 7, 168, 2, 58, '2018-05-08 08:16:35'),
('INC000001966401', '2018-02-28 11:28:12', '2018-02-28 11:58:35', 'Tipo: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Serviço: SERVICE DESK&#10;Descrição: O índice apurado no Portal Service Desk (http://portalservicedesk.caixa/Regionais/Indicadores/?competencia=01/2018&#38;regiao=102&#38;filial=7466) do mês de janeiro de 2018 não está sendo apresentado.', '', 4, 46, 3, 135, '2018-05-08 08:16:35'),
('INC000001966410', '2018-02-28 18:01:14', '2018-02-28 18:16:31', '1&#9;Informamos que o servidor 133 do portal do SIAGS está com erro de login, conforme tela em anexo.&#10;&#10;2&#9;O servidor 131 está extremamente lento para efetuar o login.&#10;&#10;3&#9;Destacamos a extrema relevância para a disponibilidade integral dos servidores do portal, em especial nesse período, considerando a elevada demanda referente a consulta dos demonstrativos de IRRF.', 'Servidor restabelecido.&#10;&#10;Att&#10;&#10;Paulo Barros', 2, 52, 2, 581, '2018-05-08 08:16:35'),
('INC000001972742', '2018-03-01 10:16:58', '2018-03-01 15:00:14', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;1. Informamos que o ITSM (servicos.caixa) encontra-se normalizado no que tange os módulos de Mudanças, Serviços e Incidentes. &#10;&#10;- Data Início: 01/03/2018                                                 &#10;- Hora Início: 10:00&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI&#10;CN  Operações de TI Brasília/BR', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
('INC000001972756', '2018-03-01 14:36:32', '2018-03-01 16:01:08', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila TODOS está com a taxa de AB1 de 9,1%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que foi realizado análise das ligações da Fila TODOS da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Identificamos que as ligações estão ficando em Fila até serem atendidas, isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
