('INC000001975804', '2018-03-01 15:54:57', '2018-03-01 16:29:51', 'Sistema inoperante. Aparentemente conexão com banco de dados indisponivel.', '“Prezado (a) Concluímos o atendimento de sua demanda caso haja algum questionamento perante o atendimento favor reabrir a requisição por meio do link servicos.caixa &#62; Minhas Solicitações ”&#10;&#10;Informamos que a aplicação foi reiniciada, e a conexão com o pondo de dados esta estabelecida.&#10;&#10;[standalone@localhost:9999 /] /subsystem=datasources/data-source=siagdDS:test-connection-in-pool&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; [true]&#10;}', 2, 51, 3, 185, '2018-05-08 08:16:35'),
('INC000001975835', '2018-03-02 09:24:59', '2018-03-02 12:02:46', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505 &#10;&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila Contrato Habitação  está com a taxa de AB1 de 11,27&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila CONTRATO_HABITACAO, bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV com as configurações da fila CONTRATO_HABITACAO, e não encontramos divergências de configurações. No entanto, ocorreu aumento expressivo de chamadas no site e devido a alta demanda no site da CERATBR, emitimos relatórios de usuários da referida fila e constatamos que o site não possui agentes suficientes disponíveis para atender a fila gerando enfileiramento de chamadas. Quando ocorre enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Após analisar todo ambiente de telefonia, verificamos que ocorreu uma falha no componente da MLHG no site da CERAT-SP (no site da CERAT-SP não na CERAT-BR) e falha no serviço do Routing Server e as chamadas não estavam sendo direcionadas para fila CONTRATO_HABITACAO no site ocasionando direcionamento para os sites de Salvador e Brasília alterando a distribuição e ocasionando aumento de demanda em ambos os sites. Para correção da falha foi necessário efetuar procedimento para correção da MLHG (na CERAT-SP apenas) e após testes constatamos a normalidade, ou seja, em todos os sites a entrega de chamadas está com direcionamento em conformidade. Efetuamos monitoração nos sites e constatamos que a distribuição está normalizada. A tendência é que o abandono diminua na medida em que as chamadas são atendidas em todas as localidades. Segue em anexo evidencias.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001975851', '2018-03-02 16:17:06', '2018-03-02 16:53:53', 'O sistema não esta funcionando desde ontem.&#10;https://simpf.caixa/&#10;Solicito regularização do serviço.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;1-) Informamos que a aplicação encontra-se disponivél. &#10;&#10;2-) Realizamos o restart da mesma. &#10;&#10;3-) Não foram encontradas evidências  de erro na aplicaçã.', 2, 65, 4, 201, '2018-05-08 08:16:35'),
