('INC000001975904', '2018-03-01 16:02:16', '2018-03-01 16:38:32', 'Favor reiniciar instância do siivg', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Realizado o restart da aplicação, não foi possível encontrar evidência de erros.', 2, 61, 3, 198, '2018-05-08 08:16:35'),
