('INC000001975927', '2018-03-02 09:25:21', '2018-03-02 11:59:57', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: Comercial&#10;&#10;Números Afetados: COMERCIAL: 3004 1105 – 0800 726 0505&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Informamos que a fila CONTRATO_HABITACAO está com a taxa de AB1 de 10%.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila CONTRATO_HABITACAO, bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV com as configurações da fila CONTRATO_HABITACAO, e não encontramos divergências de configurações. No entanto, ocorreu aumento expressivo de chamadas no site e devido a alta demanda no site da  CERATSA, emitimos  relatórios de usuários da referida fila e constatamos que o site não possui agentes suficientes disponíveis para atender a fila gerando enfileiramento de chamadas. Quando ocorre enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Após analisar todo ambiente de telefonia, verificamos que ocorreu uma falha no componente da MLHG no site da CERAT-SP (no site da CERAT-SP não na CERAT-SA) e falha no serviço do Routing Server e as chamadas não estavam sendo direcionadas para fila CONTRATO_HABITACAO no site ocasionando direcionamento para o Site de Salvador e Brasília alterando a distribuição e ocasionando aumento de demanda em ambos os sites. Para correção da falha foi necessário efetuar procedimento para correção da MLHG (na CERAT-SP apenas) e após testes constatamos a normalidade, ou seja, em todos os sites a entrega de chamadas está com direcionamento em conformidade. Efetuamos monitoração nos sites e constatamos que a distribuição está normalizada. A tendência é que o abandono diminua na medida em que as chamadas são atendidas em todas as localidades. Segue em anexo evidencias.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001975929', '2018-03-02 09:53:52', '2018-03-02 11:22:19', 'Sistema: SIGSC&#10;&#10;Tipo de Incidente: Lentidão&#10;&#10;Descrição: Prezados(as), &#10;&#10;Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;&#10;Período de Lentidão:&#10;- Data Início: 02/03/2018                                                 &#10;- Hora Início: 09h35', 'Prezado(a), bom dia.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 173, '2018-05-08 08:16:35'),
