('INC000001982028', '2018-03-05 10:11:55', '2018-03-05 11:26:53', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE (Suporte Tecnológico)&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: STE_OP_SOCIAL_PJ 10,8% &#10;- Início da Ocorrência: 10:10', 'Sr. Gestor,&#10;&#10;1.&#9;Devido a indisponibilidade dos Clients da CERATSA houve falha dos serviços provocada pela migração da VM do ContactCenter, todas as chamadas em curso foram abandonadas gerando altas taxas de abandono na CERATSA.    &#10;2.&#9;Após analise constatamos que ocorreu falha nos serviços T-Server, Routing Server e Real Time do OSCC da CERATSA devido a migração do Host (ContactCenter 10.123.124.21) no ambiente virtualizado.&#10;3.&#9;A migração de VM dos servidores de Telesserviços provocam oscilações, quedas e indisponibilidade de vários serviços prejudicando a operação das CERATs. Foi encaminhado para CETEC16 solicitação de agendamento de migrações dos Hosts (Grupo de afinidades 1 e 2 dos Servidores de Telesserviços) para que estas migrações ocorram somente durante a madrugada, minimizado os impactos na operação das CERATs.&#10;4.&#9;Foram evidenciados também que os Media Server (10.123.124.37 e 10.123.124.37) que atendem as CERATS SP e SA, após análise verificamos a ausências dos áudios de música espera das filas com AB1 e isto provocas as quedas nestas filas de atendimento. Foram realizados o UPLOAD dos arquivos de espera para normalização dos Media Server. &#10;&#10;Att.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001982029', '2018-03-05 10:12:27', '2018-03-05 11:07:39', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE (Suporte Tecnológico)&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SA&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: STE_SOCIAL_PJ 13,1% &#10;- Início da Ocorrência: 10:10', '1.&#9;Devido a indisponibilidade dos Clients da CERATSA houve falha dos serviços provocada pela migração da VM do ContactCenter, todas as chamadas em curso foram abandonadas gerando altas taxas de abandono na CERATSA.    &#10;2.&#9;Após analise constatamos que ocorreu falha nos serviços T-Server, Routing Server e Real Time do OSCC da CERATSA devido a migração do Host (ContactCenter 10.123.124.21) no ambiente virtualizado.&#10;3.&#9;A migração de VM dos servidores de Telesserviços provocam oscilações, quedas e indisponibilidade de vários serviços prejudicando a operação das CERATs. Foi encaminhado para CETEC16 solicitação de agendamento de migrações dos Hosts (Grupo de afinidades 1 e 2 dos Servidores de Telesserviços) para que estas migrações ocorram somente durante a madrugada, minimizado os impactos na operação das CERATs.&#10;4.&#9;Foram evidenciados também que os Media Server (10.123.124.37 e 10.123.124.37) que atendem as CERATS SP e SA, após análise verificamos a ausências dos áudios de música espera das filas com AB1 e isto provocas as quedas nestas filas de atendimento. Foram realizados o UPLOAD dos arquivos de espera para normalização dos Media Server.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001982030', '2018-03-05 10:13:54', '2018-03-05 11:28:28', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE (Suporte Tecnológico)&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#10;Localidade Afetada: CERAT/SP&#10;&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSP:&#10;- FILA: STE_IBC_PF 11,3% &#10;- Início da Ocorrência: 10:10', 'Sr. Gestor,&#10;&#10;1.&#9;Devido a alta taxa de abandono na CERATSP verificamos que houve falha dos serviços provocada pela migração da VM do ContactCenter, todas as chamadas em curso foram abandonadas gerando altas taxas de abandono na CERATSP.    &#10;2.&#9;Após analise constatamos que ocorreu falha nos serviços T-Server, Routing Server e Real Time do OSCC da CERATSP devido a migração do Host (ContactCenter 10.123.124.17) no ambiente virtualizado.&#10;3.&#9;A migração de VM dos servidores de Telesserviços provocam oscilações, quedas e indisponibilidade de vários serviços prejudicando a operação das CERATs. Foi encaminhado para CETEC16 solicitação de agendamento de migrações dos Hosts (Grupo de afinidades 1 e 2 dos Servidores de Telesserviços) para que estas migrações ocorram somente durante a madrugada, minimizado os impactos na operação das CERATs.&#10;4.&#9;Foram evidenciados também que os Media Server (10.123.124.37 e 10.123.124.37) que atendem as CERATS SP e SA, após análise verificamos a ausências dos áudios de música espera das filas com AB1 e isto provocas as quedas nestas filas de atendimento. Foram realizados o UPLOAD dos arquivos de espera para normalização dos Media Server. &#10;&#10;Att.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000001982085', '2018-03-06 09:52:38', '2018-03-06 10:42:34', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: STE(Suporte Tecnológico): 3004 1104 - 0800 726 0104&#10;&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila STE_CONVENIO_COBRANCA_PJ  está com a taxa de AB1 de 8,70%&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Conforme solicitado verificamos as configurações da fila STE_CONVENIO_COBRANCA_PJ, bem como seus recursos utilizados na telefonia (como MLHG), e não encontramos falha no ambiente para o cenário de AB1. Também comparamos as configurações do MCDU no OSV com as configurações da fila STE_CONVENIO_COBRANCA_PJ, e não encontramos divergências de configurações. Emitimos  relatórios de usuários da referida fila e constatamos que o site não possui agentes suficientes disponíveis para atender a fila gerando enfileiramento de chamadas. Quando ocorre enfileiramento de chamadas, os clientes podem desconectar a qualquer momento, e isso inclui desconexão no primeiro intervalo (AB1). Sugerimos alocar mais agente para atendimento na fila. O índice de Ab1 tende a diminuir na medida em que forem alocados mais agentes para atendimento. Segue em anexo evidencia.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
