('INC000001982110', '2018-03-05 17:28:20', '2018-03-05 17:58:50', 'Informamos que o SIING não está funcionando.&#10;Verificamos nos logs que está ocorrendo um erro no acesso a base de dados.&#10;&#10;2018-03-05 16:34:56,569 WARN  [org.hibernate.engine.jdbc.spi.SqlExceptionHelper] (http-/0.0.0.0:8080-5) SQL Error: 0, SQLState: 08003&#10;2018-03-05 16:34:56,569 ERROR [org.hibernate.engine.jdbc.spi.SqlExceptionHelper] (http-/0.0.0.0:8080-5) This connection has been closed.', 'Prezado(a), houve um incidente de lock no banco, mas o serviço já está operando normalmente.', 2, 60, 3, 197, '2018-05-08 08:16:35'),
