('INC000001982152', '2018-03-06 13:22:55', '2018-03-07 12:45:47', 'Está ocorrendo novamente erro no cadastramento do campo nu_mncpo_ibge_l98 na tabela do SIICO de produção. &#10;A unidade 7684 de Belo Horizonte, está com o campo nu_mncpo_ibge_l98 sem valor (com Null). &#10;Solicito o preenchimento do valor correto na tabela ICOTBU24, campo   campo nu_mncpo_ibge_l98 com o valor 620  para a Unidade 7684 (nu_unidade = 7684) somente .&#10;Att&#10;Clemente.', 'Foi feito update na base do SIICO conforme solicitado.', 2, 3, 2, 176, '2018-05-08 08:16:35'),
