('INC000001982409', '2018-03-05 08:13:57', '2018-03-05 09:48:30', 'Controle do Antivírus indisponível.&#10;&#10;Server Error in &#39;/&#39; Application.&#10;&#10; Runtime Error&#10;Description: An application error occurred on the server. The current custom error settings for this application prevent the details of the application error from being viewed remotely (for security reasons). It could, however, be viewed by browsers running on the local server machine.&#10;&#10;Details: To enable the details of this specific error message to be viewable on remote machines, please create a &#60;customErrors&#62; tag within a &#34;web.config&#34; configuration file located in the root directory of the current web application. This &#60;customErrors&#62; tag should then have its &#34;mode&#34; attribute set to &#34;Off&#34;.&#10;&#10;&#10;&#60;!-- Web.Config Configuration File --&#62;&#10;&#10;&#60;configuration&#62;&#10;    &#60;system.web&#62;&#10;        &#60;customErrors mode=&#34;Off&#34;/&#62;&#10;    &#60;/system.web&#62;&#10;&#60;/configuration&#62;&#10;&#10;&#10;Notes: The current error page you are seeing can be replaced by a custom error page by modifying the &#34;defaultRedirect&#34; attribute of the application&#39;s &#60;customErrors&#62; configuration tag to point to a custom error page URL.&#10;&#10;&#10;&#60;!-- Web.Config Configuration File --&#62;&#10;&#10;&#60;configuration&#62;&#10;    &#60;system.web&#62;&#10;        &#60;customErrors mode=&#34;RemoteOnly&#34; defaultRedirect=&#34;mycustompage.htm&#34;/&#62;&#10;    &#60;/system.web&#62;&#10;&#60;/configuration&#62;', 'Prezado,&#10;&#10;A aplicação corrigiu a inconsistência sem a necessidade de intervenção por parte da equipe de sustentação.&#10;Houve uma concorrência de processos no momento de uma das atualizações do sistema antivírus, e logo após, a atualização automática solucionou o problema.&#10;&#10;Att,&#10;&#10;Wesley Cardoso&#10;Gestão de Informações', 4, 161, 3, 79, '2018-05-08 08:16:35'),
('INC000001982416', '2018-03-05 13:43:12', '2018-03-05 14:35:25', 'Favor reiniciar instancia e aumentar configuração da JVM &#10;xmx para acima de 40000m&#10; /usr/lib/jvm/java-1.7.0-oracle-1.7.0.55.x86_64/jre/bin/java -D[Server:srv0038_SIIVG] -XX:PermSize=1024m -XX:MaxPermSize=1024m -Xms15360m -Xmx25600m', '', 2, 61, 3, 198, '2018-05-08 08:16:35'),
('INC000001982419', '2018-03-05 14:27:53', '2018-03-05 15:24:52', 'Solicitamos verificar o portal da universidade caixa que esta fora ar.&#10;http://cctdcapllx0073.df.caixa:10091/ucc_facil&#10;http://cctdcapllx0074.df.caixa:10091/ucc_facil', '', 2, 74, 3, 171, '2018-05-08 08:16:35'),
('INC000001982425', '2018-03-05 16:22:28', '2018-03-05 17:07:47', 'Sistema não responde ao clique nas opçoes de menu. Provavelmente por problema de conexão com o banco de dados. Favor verificar, pois este problema está recorrente.', '', 2, 51, 3, 185, '2018-05-08 08:16:35'),
('INC000001982426', '2018-03-05 16:43:17', '2018-03-05 18:08:40', 'Favor esclarecer sobre a diminuição na capacidade de processamento dos servidores virtuais onde é visto no gráfico do zabbix a diminuição do processamento livre dos servidores. Imagens em anexo.&#10;&#10;Lembrando que a diminuição do processamento livre está impactando na performance do SIGSC apresentando lentidão para os usuários.&#10;&#10;Qualquer dúvida por favor entre em contato.&#10;Nicolai S. Mirsky - 3206-1811', '', 2, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000001982445', '2018-03-06 10:26:39', '2018-03-06 10:50:28', 'O SIACG está apresentando erro pois sua base DW não foi carregada e está vazia. Favor proceder com o ajuste da carga com urgência para normalizar o acesso a aplicação.', 'As tabelas foram atualizadas favor verificar novamente.', 2, 50, 1, 182, '2018-05-08 08:16:35'),
('INC000001982447', '2018-03-06 11:47:40', '2018-03-06 18:33:57', 'Favor esclarecer sobre a diminuição na capacidade de processamento dos servidores virtuais onde é visto no gráfico do zabbix a diminuição do processamento livre dos servidores. Imagens em anexo.&#10;&#10;Lembrando que a diminuição do processamento livre está impactando na performance do SIGSC apresentando lentidão para os usuários.&#10;&#10;O incidente anterior(INC000001982426) foi fechado como solução definitiva informando : &#34;Gaps deixados pela diminuição de Idle time está relacionado à utilização de CPU&#34;. &#10;&#10;Porém em dezenas de outros sevidores a utilização de CPU NÃO afeta o IDLE TIME nesses casos a performance não é afetada da mesma maneira. &#10;&#10;Porque não é aberto um problema para documentar a investigação da falta de recursos físicos no cluster de virtualização? &#10;&#10;Até quando serão apresentadas, nos incidentes abertos, desculpas incoerentes aos fatos reais?&#10;&#10;&#10;Qualquer dúvida por favor entre em contato.&#10;Nicolai S. Mirsky - 3206-1811', '', 12, 82, 1, 195, '2018-05-08 08:16:35'),
('INC000001982450', '2018-03-06 15:17:25', '2018-03-06 15:50:36', 'Caros,&#10;&#10;Solicito a movimentação do servidor apl7562lx064.df.caixa para outro servidor físico visto que o servidor atual está causando a indisponibilidade parcial do SIGSC. Esse servidor está atualmente com o ARS fora do ar e não está possibilitando, com performance aceitável, o start do serviço e nem a realização das ações via SSH.&#10;&#10;&#10;Qualquer dúvida por favor entre em contato.&#10;Nicolai S. Mirsky - 3206-1811', 'O servidor foi movimentado de host físico conforme solicitado.', 2, 58, 2, 193, '2018-05-08 08:16:35'),
('INC000001982452', '2018-03-06 16:01:53', '2018-03-06 16:34:29', 'Caros,&#10;&#10;Solicito a movimentação do servidor apl7562lx065.df.caixa para outro servidor físico visto que o servidor atual está causando a indisponibilidade parcial do SIGSC. Esse servidor está atualmente com o ARS impactado e não está possibilitando, com performance aceitável, a utilização do sistema.&#10;&#10;&#10;Qualquer dúvida por favor entre em contato.&#10;Nicolai S. Mirsky - 3206-1811', 'Conforme solicitado, o servidor informado foi movimentado de hospedeiro.', 2, 58, 2, 193, '2018-05-08 08:16:35'),
('INC000001982779', '2018-03-06 12:31:50', '2018-03-06 12:57:00', 'Favor reiniciar instância do SIIVG&#10;Derrubar todos comandos presos na base do SIIVG&#10;Antes favor gerar arquivo com o comando abaixo&#10;Select * from pg_stat_activity', 'Procedimento executado', 2, 61, 3, 198, '2018-05-08 08:16:35'),
('INC000001982781', '2018-03-06 14:16:47', '2018-03-06 14:27:59', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGDB&#10;Atuação: Arquivos não Disponibilizados&#10;&#10;Descrição: Informamos que o arquivo  SIGDB do dia 06/03 não está disponibilizado na página: http://aplicativos.cetec.df.caixa/Pages/Web/Gestao/SIGDB/TransmissaoArquivo.aspx&#10;&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'À&#10;CENTRAL DE ATENDIMENTO E MONITORAMENTO.&#10;&#10;Informamos que os arquivos foram atualizados nesta data e hora, por esses motivos estamos finalizando o Incidente e caso persista favor nos contatar.&#10;&#10;Atenciosamente,&#10;&#10;Valceildo C. de Jesus&#10;Canais Agencias Stefanini/CETEC&#10;T +55 61 3206-1649', 5, 131, 1, 34, '2018-05-08 08:16:35'),
