('INC000001983518', '2018-03-06 10:18:37', '2018-03-06 10:58:01', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Autoatendimento - Painel Negocial&#10;Atuação: &#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que foi detectado às 09:30 atraso no processamento dos arquivos de sondas gerando atraso  na atualização das informações do painel de monitoração &#10;http://autoatendimentomonitoracao.caixa/Gerencial/.', '', 4, 139, 1, 34, '2018-05-08 08:16:35'),
('INC000001983519', '2018-03-06 10:20:23', '2018-03-06 11:16:20', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: SERVICE DESK&#10;Descrição: Portal Service Desk&#10;&#10;Prezados,&#10;&#10;O indicador &#34;Entrega de Relatórios Gerenciais Obrigatórios&#34; não está contabilizando o percentual correto. Os relatórios já foram setados no SIGOC, porém os valores oriundos da ferramenta não reflete corretamente no Portal Service Desk.', 'Prezado (as), &#10;&#10;1.&#9;Informamos que a Webservice existente abastece os dados para o contrato Regionais, porem verificamos que de fato existem dados para o contrato Nacional, porém todos com o ano e 2016&#10;2.&#9;Segue em anexo relatório para validação dos dados, caso seja pertinente favor abrir requisição para implementação.  &#10;3.&#9;Estamos à disposição para demais dúvidas. &#10;&#10;Atenciosamente,&#10;Jose Patricio Vieira&#10;Analista de Banco de Dados', 4, 159, 3, 135, '2018-05-08 08:16:35'),
('INC000001983536', '2018-03-06 16:51:39', '2018-03-06 17:26:23', 'Tipo: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Serviço: INTEGRAÇÃO GSC&#10;Descrição: Prezados,&#10;&#10;No dia 05/03 no período das 12h40 até aproximadamente às 13h450, percebemos que os tickets de chamados referente ao contrato 14803/2017 deixaram ser enviados ao nosso portal, verificamos junto ao suporte técnico da nossa ferramenta (WEBASSIST) e foi informado que a mesma não apresentou nenhum problema.&#10;Desta forma solicitamos verificar se houve alguma falha no sistema da Caixa na data e período informados acima.&#10;Obrigada.', 'Prezados,&#10;&#10;Informamos que a solicitação foi aberta utilizando a requisição do tipo incidente sendo que a correta seria do tipo WO, gentileza abrir a requisição com a seguinte categorização.&#10;&#10;- Tecnologia da Informação e Comunicação&#10;- Reportar erro no SERVIÇOS.CAIXA&#10;&#10;- Solicitar Agora&#10;&#10;- Qual ambiente em que o erro ocorre? * - Desenvolvimento&#10;- Em que módulo? * - Integração&#10;- Selecione a integração * -Fornecedor Externo&#10;- Tipo de erro * - Não gera ticket fornecedor&#10;- Descreva como o erro ocorre* - Descreva sua solicitação&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 13, 58, 3, 135, '2018-05-08 08:16:35'),
('INC000001983560', '2018-03-07 10:38:44', '2018-03-07 11:30:36', 'Favor reiniciar a instancia do SIIVG', 'Prezado(a), Instância reiniciada com sucesso e serviço operando normalmente.', 2, 61, 3, 198, '2018-05-08 08:16:35'),
