('INC000001984018', '2018-03-08 07:25:47', '2018-03-08 07:32:33', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGSC&#10;Atuação: GSC - ITSM - Aplicação MQ Client&#10;&#10;Descrição: Prezados,&#10;&#10;Informamos um aumento significativo no volume de mensagens travadas na fila LQ.RSP.SERVICO.ITSM conforme monitoração no MQ. &#10;&#10;Atenciosamente&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;(61) 3206-1800', 'Prezado Marcelo,&#10;&#10;1. Sua demanda não poderá ser atendida por esta Requisição.&#10;&#10;2. Por gentileza, abrir nova solicitação conforme abaixo:&#10;   2.1 Tecnologia da Informação e Comunicação&#10;   2.2 Software, Aplicativos e Sistemas&#10;   2.3 SERVIÇOS.CAIXA&#10;   2.4 Reportar erro no SERVIÇOS.CAIXA&#10;&#10;À disposição para eventuais dúvidas.&#10;&#10;Atenciosamente,&#10;&#10;Flávio Medeiros&#10;Equipe Sustentação - SIGSC', 8, 58, 1, 34, '2018-05-08 08:16:35'),
('INC000001984617', '2018-03-06 10:01:59', '2018-03-06 10:28:15', 'TUE 06 MAR, 2018 -10=00=51&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO RTDTRF2RJ&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - &#10;      CONTATO - &#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Conforme verificado dispositivo encontra-se operacional.', 10, 132, 1, 236, '2018-05-08 08:16:35'),
