('INC000001984901', '2018-03-06 12:46:07', '2018-03-06 15:43:25', 'projetos.caixa EXTREMAMENTE LENTO há três dias', 'Não identificamos lentidão para acessar o sistema. Navegamos por ele e o tempo médio de resposta, para a navegação, foi de 7s, conforme imagem em anexo.&#10;&#10;Verificamos os servidores de front-end, back-end e do banco de dados. Todos estão operando normalmente, sem gargalos.', 2, 68, 2, 214, '2018-05-08 08:16:35'),
('INC000001984902', '2018-03-06 13:58:19', '2018-03-06 14:11:49', 'Ambiente projetos.caixa apresentando muita lentidão a todas as ações requeridas.', 'Sr(a) Ana Paula,&#10;&#10;1 - Informamos que existe um INC000001984901 aberto para a resolução do problema da página projetos.caixa, gentileza aguardar a resolução do incidente aberto.&#10;&#10;&#10;2. Em caso de dúvidas na abertura de demandas normativas ou operacionais, acione a CN de Atendimento Interno por meio do 0800 721 2222.&#10;&#10;3. Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 68, 1, 214, '2018-05-08 08:16:35'),
