('INC000001990311', '2018-03-08 11:39:17', '2018-03-08 11:58:37', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: PAINEL GSC&#10;Descrição: IMPOSSIBILIDADE DE ABRIR CHAMADOS NO GSC, CATEGORIA &#62; FILIAL DE TI&#10;Anexo da mensagem com erro.&#10;Todos os campos obrigatórios foram preenchidos', 'Prezados,&#10;&#10;Informamos que a solicitação foi aberta utilizando a requisição do tipo incidente sendo que a correta seria do tipo WO, gentileza abrir a requisição com a seguinte categorização.&#10;&#10;- Tecnologia da Informação e Comunicação&#10;- Reportar erro no SERVIÇOS.CAIXA&#10;&#10;- Solicitar Agora&#10;&#10;- Qual ambiente em que o erro ocorre? * - Desenvolvimento&#10;- Em que módulo? * - Requisições&#10;- Tipo de erro * - Envio de REQ&#10;- Número da WO* - Não Existe&#10;- Descreva como o erro ocorre* - Descreva sua solicitação&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 3, 58, 3, 135, '2018-05-08 08:16:35'),
('INC000001990601', '2018-03-08 04:20:01', '2018-03-08 11:49:55', 'A validação diária da configuração das regras de retorno de fornecedor externo encontrou as seguintes divergências: &#10;&#10;-  Não foi localizada a unidade 7448-GITEC no formulário de cadastro de unidade.', 'Esclarecemos que a GITECFL foi inativada por isso o motivo que nao aparecer mais no formulario de cadastro de unidade', 14, 58, 1, 124, '2018-05-08 08:16:35'),
('INC000001991101', '2018-03-08 09:28:44', '2018-03-08 11:44:54', 'Esta GEDTI é responsável pelo acompanhamento dos projetos corporativos da empresa no portal Projetos.Caixa. Ocorre que o ambiente vem apresentando lentidão já há umas 02 semanas. Essa lentidão se reflete na navegação do portal (algumas ações demandam mais de 15s para retornar uma resposta), bem como nas ações de salvamento e publicação, que entram em fila e demoram bastante tempo para finalizar. Em outras situações, o usuário recebe mensagens de erro ao tentar salvar ou simplesmente a ação não finaliza.&#10;Precisamos de uma solução para o problema que vem afetando todos os usuários do Portal.', 'Informamos que foram verificados os servidores de SQL Server é do SharePoint é não encontramos nenhuma anormalidade de banco, CPU e memoria que provoca-se a lentidão é o portal está acessível não havendo indisponibilidade. Conforme conversado com o solicitante foi orientado a abertura de um problema para verificação. Estamos a disposição para mais esclarecimento.', 2, 48, 1, 180, '2018-05-08 08:16:35'),
('INC000001991501', '2018-03-08 15:36:38', '2018-03-08 15:39:17', 'Isso é um teste', 'vide nota', 11, 15, 1, 270, '2018-05-08 08:16:35'),
('INC000001993310', '2018-03-08 16:26:58', '2018-03-08 16:36:50', 'THU 08 MAR, 2018 -16=24=52&#10;CREXTRRR002 - A INTERFACE&#10;NOME= 0 SE1/7&#10;DESC= CEPTIRJ_CREXTRRR002_SE1/7_CEXC_JF-SE_CONSULTA-PROCESSOS_OI_1MB_«&#10;IP=172.29.139.1 ESTA DOWN&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAçãO', 'Informo que este incidente está relacionado ao INC000001989353. Em tratativa com a operadora.', 10, 91, 1, 44, '2018-05-08 08:16:35'),
('INC000001993643', '2018-03-12 08:17:39', '2018-03-12 10:08:18', 'Controle do Antivírus travado, com a mensagem: &#10;Estamos processando os novos dados. Enquanto isso, a página atualizará a cada 10s.', 'Prezado,&#10;&#10;Informamos que a infra encontra-se indisponível.&#10;&#10;Aberto chamado para área responsável.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Fabiano da Silva Barbosa&#10;Gestão de Informações - CETEC', 4, 76, 2, 80, '2018-05-08 08:16:35'),
