('INC000002003925', '2018-03-09 12:45:26', '2018-03-09 16:26:29', '1.         Informamos que o ITSM (http://servicos.caixa) encontra-se com lentidão no que se refere aos módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de indisponibilidade:&#10;- Data Início: 09/03/2018                                                 &#10;- Hora Início: 12:00', 'Prezado(a), boa tarde&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002004220', '2018-03-09 14:56:27', '2018-03-09 16:23:03', 'Tipo de Falha: Disponibilidade Parcial&#10;&#10;Serviço Afetado: STE&#10;&#10;Números Afetados: 3004 1104 - 0800 726 0104&#10;&#9;&#10;&#10;&#10;&#10;Localidade Afetada: CERAT/BR&#10;&#10;Descrição: Informamos que a fila STE_CERTIFICACAO_DIGITAL_PF  está com a taxa de AB1 de 9,00%&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que foi realizado análise das ligações da Fila STE_CERTIFICACAO_DIGITAL_PF e identificamos que o motivo do AB1 foi devido a falha do Servidor Media Server (OMS1 10.123.124.43) que apresentou travamento sendo necessário realizar o restart do mesmo, conforme evidência anexa. Com isso, as ligações que estavam em atendimento foram desconectadas, gerando AB1. Continuamos monitorando as ligações e não houve mais falha, bem como a porcentagem de AB1 diminuiu.', 9, 172, 2, 144, '2018-05-08 08:16:35'),
('INC000002004262', '2018-03-12 10:31:48', '2018-03-12 13:28:03', 'Prezados(as), &#10;&#10;1.         Informamos que o ITSM (http://servicos.caixa) encontra-se com extrema lentidão no que se refere aos módulos de Incidente, Serviço e Mudanças.&#10;&#10;&#10;&#10;Período de indisponibilidade:&#10;- Data Início: 12/03/2018                                                 &#10;- Hora Início: 09:45&#10;&#10;Atenciosamente,&#10;&#10;Central de Serviços de TI&#10;CN – Operações de TI Brasília/BR', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 175, '2018-05-08 08:16:35'),
