('INC000002005022', '2018-03-11 09:51:18', '2018-03-11 10:29:16', 'Foi identificado um erro na tentativa de acesso a console de relatórios do SIGSC http://relatorios.servicos.caixa/arsys/shared/login.jsp?/arsys/forms/cctdcapllx0199.df.caixa/AR%20System%20Report%20Console. Apresenta o seguinte erro ARWARN [9505] AR Server is Not Reachable.', 'A máquina virtual (VM) foi desligada às 8:45hs e por isso o serviço estava fora. O serviço já está no ar e foi aberto um chamado para Proinfo sobre esta queda na vm.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 2, 193, '2018-05-08 08:16:35'),
('INC000002005122', '2018-03-10 13:52:41', '2018-03-10 15:04:22', 'Tipo: Páginas WEB&#10;Serviço: GESTÃO 0800&#10;Tipo de Evento: Indisponibilidade&#10;Descrição: Informamos ab1 na CERATBR fila TIM_MULTIBANK.', 'Informamos que realizamos a análise da Fila TIM_Multibank e identificamos que devido a falha no Servidor URA SIP Convergys da CERATSP, as ligações foram transbordadas para a CERATBR, conforme evidência anexa. Sendo assim, CERATBR recebeu alta volumetria de ligação, gerando AB1. Após a normalização do Servidor URA SIP Convergys as ligações foram normalizadas e começou a diminuir o índice do AB1 na CERATBR.', 9, 172, 3, 268, '2018-05-08 08:16:35'),
