('INC000002007408', '2018-03-12 17:45:49', '2018-03-12 18:46:12', 'Queda de conexão com o Banco de Dados no ambiente do CTC da GITEC/FO: ce7874sr053.&#10;&#10;&#62; ping -a ce7874sr053&#10;&#10;Disparando ce7874sr053.corp.caixa.gov.br [10.123.19.31] com 32 bytes de dados:&#10;Esgotado o tempo limite do pedido.&#10;Esgotado o tempo limite do pedido.&#10;Esgotado o tempo limite do pedido.&#10;Esgotado o tempo limite do pedido.&#10;&#10;Estatísticas do Ping para 10.123.19.31:&#10;Pacotes: Enviados = 4, Recebidos = 0, Perdidos = 4 (100% de  perda)', 'O incidente está sendo tratado pelo PBI000000123301', 3, 63, 3, 267, '2018-05-08 08:16:35'),
('INC000002007414', '2018-03-13 15:08:12', '2018-03-13 15:30:06', 'O SICBC (que é responsável or capturar mensagens do BC Correio - BACEN) não está capturando as mensagens daquele Banco Central do Brasil (BACEN) desde a madrugada de hoje (13/03/2018). Essa captura deve ocorrer pelo SICBC em intervalos de 30 minutos. Não existe evidência da não captura das mensagens além da Caixa Postal da GENOR08 vazia, ou seja, as mensagens não estão sendo capturadas pelo SICBC no BACEN (BC Correio). Mas na tentativa de execução &#34;manual&#34; do SICBC para que capture as mensagens, o SICBC está gerando a mensagem de erro que segue em anexo. ALERTAMOS PARA A URGÊNCIA NO ATENDIMENTO, UMA VEZ QUE AS MENSAGENS DO BACEN TEM CUNHO JUDICIAL E PRAZO PARA ATENDIMENTO PELA CAIXA.', '', 2, 55, 4, 190, '2018-05-08 08:16:35'),
('INC000002007416', '2018-03-13 16:14:52', '2018-03-13 16:25:16', 'Foi identificado um erro na tentativa de acesso a console de relatórios do SIGSC http://relatorios.servicos.caixa/arsys/shared/login.jsp?/arsys/forms/cctdcapllx0199.df.caixa/AR%20System%20Report%20Console. Apresenta o seguinte erro ARWARN [9505] AR Server is Not Reachable.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado, após restart no servidor.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 193, '2018-05-08 08:16:35'),
('INC000002007444', '2018-03-14 10:25:16', '2018-03-14 14:11:02', 'Estamos recebendo acionamentos (dia 14/03 - 09:50hs), de diversas unidades e de diferentes UF, informando que ao tentar acessar o SISAG em EF - Estação Financeira, é apresenta a mensagem de erro impeditiva &#10;&#34;Usuário e senha invalida&#34;.&#10;&#10;Convém informar que ontem (14/03/2018), também verificamos este problema e nos foi informado que as estações estavam fora do LDAP e, com a reinclusão das EFs no LDAP, a ocorrência foi solucionada.', 'A&#10;&#10;UNIDADE,&#10;&#10;Senhor (a) Usuário (a)&#10;&#10;1&#9;Informamos que foi identificado uma falha na tentativa de autenticação de rede no acesso a estação financeira para algumas UNIDADES,  &#10; sendo que após o usuário informar matricula e senha, está sendo apresentada a mensagem  de &#34;usuário e/ou senha inválido&#34;.&#10; &#10;2&#9;Comunicamos que já foi acionada as áreas pertinentes , onde foi identificado a causa da indisponibilidade e estará sendo distribuído de forma centralizada a solução &#10; para os equipamentos que apresentaram a falha em questão, gentileza aguardar.&#10;&#10;3&#9;Desta forma, este chamado está sendo encerrado.&#10;&#10;5.  Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção Sênior&#10;Canais Agência Stefanini/CETEC', 5, 70, 2, 169, '2018-05-08 08:16:35'),
('INC000002007451', '2018-03-14 12:16:24', '2018-03-14 12:35:28', 'Prezado,&#10;&#10;1. O problema permanece neste instante.&#10;2. Mesmo erro.&#10;3. Gentileza efetuar nova verificação com urgência.&#10;&#10;Att.&#10;Persio&#10;____________________________________________&#10;Prezados,&#10;&#10;1. Hj amanheceu novamente com o mesmo problema.&#10;2. Gentileza verificar com urgência.&#10;&#10;Att.&#10;Persio Fagundes&#10;GITEC/CT PEDeS&#10;_______________________________&#10;&#10;&#10;Sistema SIING. Logo após LOGON apresenta a mensagem de OCORREU ERRO INESPERADO. gentileza verificar com urgência.', '', 2, 60, 3, 197, '2018-05-08 08:16:35'),
('INC000002007505', '2018-03-12 11:46:43', '2018-03-12 12:27:10', 'O caderno de TI (http://cadernoti.caixa/) está indisponível.', 'Ao logar no servidor, ficou constatado que um serviço do windows LASS estava ocupando toda memória RAM do servidor Este fato ocorreu devido a falta de espaço em disco no servidor  e acarretou em um lentidão do SO com o travamento do serviço.&#10;&#10;Foi finalizado o processo e reiniciado a máquina.', 2, 75, 3, 213, '2018-05-08 08:16:35'),
('INC000002007507', '2018-03-12 14:36:36', '2018-03-12 15:59:53', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGDB&#10;Atuação: Arquivos não Disponibilizados&#10;&#10;Descrição: Informamos que o SIGDB não foi disponibilizado na página http://aplicativos.cetec.df.caixa/Pages/Web/Gestao/SIGDB/TransmissaoArquivo.aspx, gentileza verificar.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 5, 138, 1, 34, '2018-05-08 08:16:35'),
('INC000002007508', '2018-03-12 15:39:07', '2018-03-12 18:13:03', 'Os ambientes de relatório (http://relatorios.servicos.caixa e http://historico.servicos.caixa) estão constantemente retornando Time Out, não trazendo os dados solicitados.&#10;Tela anexa.', 'Prezado Usuário,&#10;&#10;1. Efetuamos testes de pesquisas no ambiente histórico e geração de relatórios no ambiente de relatórios e não identificamos falhas.&#10;&#10;2. Sendo assim, favor efetuar novos testes e caso o problema persistir, nos retornar a qualificação que está sendo utilizada para que possamos analisar, tendo em vista que não recebemos time out ao efetuar testes diversos.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002007511', '2018-03-12 16:51:13', '2018-03-12 18:44:52', 'Prezados Senhores &#10;O portal da Universidade.caixa esta fora do ar. Favor verificar&#10;http://universidade.caixa/conheca-a-universidade/portfolio', 'O incidente está sendo tratado pelo PBI000000123301', 3, 74, 3, 171, '2018-05-08 08:16:35'),
