('INC000002026325', '2018-03-14 18:09:49', '2018-03-14 18:25:11', 'Identificamos que o SIGSC está apresentando falha na geração de WO.', 'Prezado Usuário,&#10;&#10;1. Informamos que as requisições geraram as devidas WO, porém houve lentidão durante o dia devido uma falha no servidor.&#10;&#10;2. Ocorrência sendo tratada no INC000002026220.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 2, 193, '2018-05-08 08:16:35'),
('INC000002026337', '2018-03-14 23:03:22', '2018-03-15 01:50:31', 'Aberto por Janilton/G&#38;P - Monitoração', 'À &#10;&#10;Equipe C N Operações de TI São Paulo &#10;Monitoração Mainframe&#10;&#10;Sr. Paulo Roberto Ramos            &#10;&#10;&#10;Foi verifica que uma partição (referente ao 1° semestre de 2016) de um dos discos que estava corrompida, após a remoção do referido disco o S.O pode ser inicializado.', 6, 14, 3, 35, '2018-05-08 08:16:35'),
('INC000002026381', '2018-03-15 11:36:55', '2018-03-15 15:17:46', 'Informamos alerta no AB1 de 9,09% na fila: TIM_MULTIBANK&#10;CERATBR &#10;Comercial:  3004 1105 – 0800 726 0505 &#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', '', 9, 172, 2, 208, '2018-05-08 08:16:35'),
('INC000002026603', '2018-03-14 09:49:04', '2018-03-14 15:32:23', 'Prezados(as), &#10;&#10;1.         Informamos que o ITSM (http://servicos.caixa) encontra-se com extrema lentidão no que se refere aos módulos de Incidente, Serviço e Mudanças.&#10;&#10;&#10;&#10;Período de indisponibilidade:&#10;- Data Início: 13/03/2018                                                 &#10;- Hora Início: 09:20&#10;&#10;Atenciosamente,&#10;&#10;Central de Serviços de TI&#10;CN – Operações de TI Brasília/BR', 'Prezado(a) bom dia. &#10;No presente momento já foi detectado que o banco de dados está com problemas na parte de disco.&#10;Esse problema está sendo tratado na REQ000024574746 pela ProInfo.&#10;Uma vez que o problema seja solucionado o sistema será normalizado.&#10;Obrigado.&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002026611', '2018-03-14 12:33:38', '2018-03-14 15:38:15', 'Usuários do GSC estão reportando muita lentidão na ferramenta.&#10;Em alguns momentos apresenta erros semelhantes ao anexo.', 'Prezado(a) bom dia. &#10;No presente momento já foi detectado que o banco de dados está com problemas na parte de disco.&#10;Esse problema está sendo tratado na REQ000024574746 pela ProInfo.&#10;Uma vez que o problema seja solucionado o sistema será normalizado.&#10;Obrigado.&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
