('INC000002027205', '2018-03-14 14:15:28', '2018-03-14 14:58:24', 'O SICBC (que é responsável or capturar mensagens do BC Correio - BACEN) não está capturando as mensagens daquele Banco Central do Brasil (BACEN) desde a madrugada de hoje (13/03/2018). Essa captura deve ocorrer pelo SICBC em intervalos de 30 minutos. Não existe evidência da não captura das mensagens além da Caixa Postal da GENOR08 vazia, ou seja, as mensagens não estão sendo capturadas pelo SICBC no BACEN (BC Correio). Mas na tentativa de execução &#34;manual&#34; do SICBC para que capture as mensagens, o SICBC está gerando a mensagem de erro que segue em anexo. ALERTAMOS PARA A URGÊNCIA NO ATENDIMENTO, UMA VEZ QUE AS MENSAGENS DO BACEN TEM CUNHO JUDICIAL E PRAZO PARA ATENDIMENTO PELA CAIXA.&#10;&#10;ALERTAMOS PARA URGÊNCIA NO ATENDIMENTO DA DEMANDA, considerando que está pendente desde ontem.&#10;Favor observar a REQ000024557867 aberta ontem que descreve o problema que não foi atendido.&#10;&#10;ALERTAMOS também que as mensagens capturadas do BACEN são demandas judiciais e tem prazo para atendimento sob pena de pagamento de multas diárias.', '', 2, 55, 4, 190, '2018-05-08 08:16:35'),
