('INC000002027235', '2018-03-15 11:13:08', '2018-03-15 11:22:33', '1&#9;Solicitamos em caráter de urgência, reaplicar a correção em anexo, considerando que o erro voltou a ocorrer.&#10;&#10;2&#9;Solicitamos ainda avaliar, se o retorno do erro foi decorrente da interrupção realizada ontem, para aplicação do lote extra, ou seja, se alguma etapa para reativar a aplicação não foi executada.', 'Foi aplicada a correção em anexo.', 2, 52, 3, 186, '2018-05-08 08:16:35'),
('INC000002027236', '2018-03-15 11:18:51', '2018-03-15 13:12:20', '•&#9;Comunicamos que o sistema SIAGS está apresentando lentidão desde o dia 13/03/2018 as 13:00 horas, por este motivo está impactando tempo da análise. Apresentando falha nos processos de.&#10;&#10;1.&#9;Mudança de fase&#10;2.&#9;Revisar e reconsiderar glosas&#10;3.&#9;Reprocessar protocolo&#10;4.&#9;Abrir a janela conferir&#10;5.&#9;Falha ao salvar a analise', 'Ambiente esta funcionando normalmente conforme evidências.', 2, 52, 1, 187, '2018-05-08 08:16:35'),
('INC000002027304', '2018-03-14 16:18:44', '2018-03-14 16:57:36', '1&#9;Solicitamos o reestabelecimento urgente do acesso ao servidor http://cctdcaplnt0129/AutorizadorPRD/, que é fundamental para as solicitações de autorização prévia(Autorizador Externo), encaminhadas pelos grandes credenciados do Saúde CAIXA.', 'Foi reiniciado a POOL do autorizador conforme imagens em anexo.', 2, 52, 1, 187, '2018-05-08 08:16:35'),
('INC000002027317', '2018-03-15 09:14:48', '2018-03-15 10:25:48', 'Aixa indisponível via Skype.&#10;Tela anexa.', 'Prezado Marcos,&#10;&#10;Informamos que o problema apresentado foi solucionado.&#10;&#10;Realizamos teste para abertura de chamado WO0000024833141, onde concluímos que assistente virtual está abrindo normalmente os chamados .&#10;&#10;À disposição para mais informações.&#10;&#10;Equipe Assistente Virtual - AIXA.', 15, 80, 3, 210, '2018-05-08 08:16:35'),
('INC000002027318', '2018-03-15 10:52:05', '2018-03-15 12:41:18', 'Temos necessidade urgente de realizar o cadastramento das EFS da unidade 3494, porem o site para cadastro utilizando do nome logico esta indisponivel.&#10;&#10;https://sisag.caixa/sisageo/', 'Ao &#10;&#10;Usuário&#10;&#10;1. Informamos que o acesso ao sisag via Browse foi descontinuado.&#10;&#10;2. O acesso ao SISAG pela ET é realizado via Agente EO.&#10;&#10;3. O usuário informou que foi resolvido e autorizou fechamento do incidente.&#10;&#10;Atenciosamente &#10;&#10;Jonatas Lopes Ferreira&#10;Equipe Canal Agencia&#10;Stefanini/CETEC', 5, 5, 2, 169, '2018-05-08 08:16:35'),
('INC000002027319', '2018-03-15 10:54:15', '2018-03-15 13:34:22', 'Informamos alerta no AB1 de 8,5% na fila: FGTS &#10;CERATSA &#10;CIDADÃO: 0800 726 0207&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que foi realizado análise das ligações da Fila FGTS da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 208, '2018-05-08 08:16:35'),
('INC000002027418', '2018-03-15 08:56:16', '2018-03-15 09:48:38', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Visão ETL&#10;Atuação: &#10;&#10;Descrição: Detectamos alerta no processo CMDB, pacote ETL014_CMDB.', 'Prezados,&#10;&#10;Informamos que a ETL perdeu a conexão com a origem.&#10;Refizemos novamente as autenticações e prosseguimos com a execução da extração.&#10;&#10;Att,&#10;&#10;Wesley Cardoso&#10;Gestão de Informações', 4, 78, 1, 34, '2018-05-08 08:16:35'),
