('INC000002027423', '2018-03-15 13:11:04', '2018-03-15 14:04:12', 'Sistema SIING **&#10;Hj o Sistema sorteou apenas parte dos ingressos que estavam agendados para 09:00hs de hj.&#10;Consultando a log do servidor, há vários erros sendo apresentados desde os primeiros minutos do dia de hj.&#10;Em que pese a aplicação estar operante, há vários erros na log.&#10;Gentileza efetuar verificação com urgência.&#10;Se possível efetuar reboot nos servidores.&#10;&#10;Att.&#10;Persio Fagundes&#10;GITEC/CT PEDeS', 'Prezados, conforme  verificação  foi constato uma falha de  banco de dados hoje  pela manhã o que pode te ocasionado o problema. Informamos que o restart da aplicação foi realizado conforme o solicitado.', 2, 60, 2, 196, '2018-05-08 08:16:35'),
