('INC000002027448', '2018-03-16 09:58:58', '2018-03-16 10:25:33', 'O portal de Gerenciamento de Grupos está apresentando grupos de várias unidades diferentes para usuários que não pertencem àquelas unidades apresentadas em tela.&#10;&#10;Exemplo anexo.', 'Prezado Usuário,&#10;&#10;1. Sua demanda não poderá ser atendida por esta Requisição, pois não se trata de incidente.&#10;&#10;2. Por gentileza, abrir nova solicitação conforme abaixo:&#10;   2.1 Tecnologia da Informação e Comunicação&#10;   2.2 Software, Aplicativos e Sistemas&#10;   2.3 Software e Aplicativo&#10;   2.4 Solicitar ajustes no gerenciamento de grupos da unidade&#10;   2.5. Solicitar agora&#62;&#62; preencher os campos&#10;&#10;3. Estamos à disposição para os esclarecimentos necessários.&#10;&#10;Atenciosamente,&#10;CETEC - Central de Atendimento e Monitoração', 3, 81, 1, 211, '2018-05-08 08:16:35'),
