('INC000002027722', '2018-03-15 12:15:17', '2018-03-15 12:39:12', 'Prezados(as), &#10;&#10;1.         Informamos que o ITSM (http://servicos.caixa) encontra-se com lentidão no que se refere aos módulos de Incidente, Serviço e Mudanças.&#10;&#10;&#10;Período de indisponibilidade:&#10;- Data Início: 15/03/2018                                                 &#10;- Hora Início: 11:50', 'Prezado Usuário,&#10;&#10;1. Informamos que houve falha em um dos servidores da aplicação no período citado e com isso ocasionando lentidão para alguns usuários.&#10;&#10;2. A situação foi regularizada.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002027727', '2018-03-15 16:03:25', '2018-03-15 17:06:49', 'Prezado(as) Senhores(as)&#10;O portal da Universidade.caixa encontra-se fora do ar.&#10;Favor verificar.', '', 2, 8, 3, 171, '2018-05-08 08:16:35'),
('INC000002027835', '2018-03-15 17:22:38', '2018-03-15 18:12:01', 'O site universidade.caixa encontra-se indisponível. Observamos que vários servidores plone-UCC-LX00## caíram, e que o servidor plone-UCC-LX0079 se encontra completamente inacessível. Solicitamos auxílio para restaurarmos o acesso ao portal.', 'Prezados, informamos que o serviço foi restabelecido.', 2, 74, 3, 171, '2018-05-08 08:16:35'),
('INC000002027914', '2018-03-15 13:39:53', '2018-03-15 16:22:38', 'Informamos alerta no AB1 de 8,3% na fila: PROGRAMAS_SOCIAIS&#10;CERATSA &#10;CIDADÃO: 0800 726 0207&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Informamos que foi realizado análise das ligações da Fila Programa_Sociais da CERATSA e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia.', 9, 172, 2, 208, '2018-05-08 08:16:35'),
