('INC000002028701', '2018-03-15 15:34:06', '2018-03-15 16:35:48', 'O portal de RH da CETEC no Sharepoint está &#34;congelado&#34; há alguns dias, sem atualização das demandas. A equipe da Stefanini analisou e reportou ser um problema na Infra do Sharepoint. Gentileza analisar a posicionar a equipe de Governança. Obrigada.&#10;http://unidades/sites/CETEC/RH/Solicitar/SitePages/Painel/Painel.aspx', 'Prezados,&#10;&#10;Não identificamos a não atualização dos dados.&#10;&#10;Solicitamos mais informações para uma melhor análise.&#10;&#10;Atenciosamente,&#10;Jean Michel', 4, 159, 3, 179, '2018-05-08 08:16:35'),
('INC000002028721', '2018-03-16 10:45:14', '2018-03-16 11:12:08', 'INC000002029229 - Fechado sem que o serviço tenha sido restabelecido.&#10;Controle do Antivírus indisponível. &#10;&#10;Error.&#10;An error occurred while processing your request.', 'Prezado,&#10;&#10;Informo que o sistema está funcionando corretamente conforme imagem em anexo, no entanto o erro reportado agora se da devido aos usuários de matrícula &#34;C&#34; terem perdido o CGC de vinculação.&#10;&#10;Esclarecemos que a unidade responsável pela base de usuários já foi acionada para regularização do problema. &#10;&#10;Atenciosamente,&#10;&#10;&#10;Fabiano da Silva Barbosa&#10;Gestão de Informações - CETEC', 4, 76, 3, 143, '2018-05-08 08:16:35'),
('INC000002028727', '2018-03-16 14:37:27', '2018-03-16 15:21:26', 'Informamos que o suporte web apresenta erro ao realizar consulta de equipamentos e ponto, conforme em anexo.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Senhores(as), informamos que a situação foi normalizada.&#10;&#10;Att,&#10;Wdarles Leivas', 4, 37, 2, 212, '2018-05-08 08:16:35');
