('INC000002028729', '2018-03-16 15:26:59', '2018-03-16 15:44:42', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Item Monitorado: Autoatendimento - Painel Negocial&#10;Atuação: &#10;&#10;Descrição: Informamos que está apresentando erro na consulta as unidades no painel de monitoração (http://autoatendimentomonitoracao.caixa/Gerencial/), conforme anexo.&#10;&#10;&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezado,&#10;&#10;Informo que o sistema está funcionando corretamente conforme imagem em anexo, no entanto o erro reportado agora se da devido aos usuários de matrícula &#34;C&#34; terem perdido o CGC de vinculação.&#10;&#10;Esclarecemos que a unidade responsável pela base de usuários já foi acionada para regularização do problema. &#10;&#10;Atenciosamente,&#10;&#10;&#10;Fabiano da Silva Barbosa&#10;Gestão de Informações - CETEC', 4, 46, 1, 34, '2018-05-08 08:16:35'),
('INC000002028813', '2018-03-16 08:17:28', '2018-03-16 09:45:20', 'O servidor DF7436SR170 esta fora do ar, não responde ping, portanto o sistema do saúde caixa e outros estão fora do ar.', 'Prezados,&#10;&#10;1.&#9;A LUM (VMAX090_01A29_BR) que o servidor (DF7436SR170) está ficou sem espaço em disco, com isso esse servidor ficou indisponível.&#10;2.&#9;Estão sendo migrados 2 servidores para a liberação do espaço nessa LUM para a resolução do problema, após o termino da migração, o servidor voltará a disponibilidade.', 2, 47, 3, 170, '2018-05-08 08:16:35'),
('INC000002028825', '2018-03-16 17:10:18', '2018-03-16 17:47:50', 'Após a equalização do ambiente de homologação (hmp.projetos.caixa) com o ambiente de produção (projetos.caixa), atendido pelo REQ000024440936, o ambiente de homologação ficou extremamente lento, como estava o ambiente de produção anteriormente. Ocorre que a lentidão do ambiente de produção foi regularizada mas o de homologação está apresentando os mesmos problemas. No momento temos 51 processos enfileirados que não andam. Precisamos do ambiente para poder fazer as simulações necessárias antes da utilização no ambiente de produção, mas não estamos conseguindo utilizá-lo.', 'Informamos que o portal está acessível não havendo indisponibilidade do mesmo. Sugerimos a abertura de uma ordem de serviço para tratarmos sobre a lentidão do portal de projetos em HMP.', 2, 48, 1, 140, '2018-05-08 08:16:35'),
('INC000002028859', '2018-03-19 09:36:11', '2018-03-19 10:15:55', 'SIAGS - Erro de &#34;out of memory&#34; na rotina de pagamento do prestadores - 18/3/2018', 'O erro apresentado, ocorreu na sexta feira,dia 16 de março. Foi realizada uma manutenção orientada pela benner para corrigir o erro apresentado durante a semana. Esta ação ocorreu a partir das 21 horas do dia 16 e teve uma duração aproximadamente de 3 horas.&#10;&#10;Estaremos monitorando o comportamento da aplicação esta semana... caso o problema persista, estaremos entrando em contato com a benner para futuras correções.', 2, 52, 1, 187, '2018-05-08 08:16:35'),
('INC000002028898', '2018-03-20 12:29:46', '2018-03-20 14:13:03', 'Indisponibilidade de conteúdos no ambiente de homologação da INTRANET CAIXA.&#10;&#10;http://hmp.intranet.caixa/Paginas/HomeIntranet.aspx', 'O conteúdo da HomeIntranet foi editado como se fosse HomeJornal. Quando é editado um item na lista, o primeiro campo dele é tipo de conteúdo. A pessoa clicou no conteúdo home intranet e modificou pra conteúdo home jornal.&#10;&#10;Por isso ocorreu o problema. Não foi o ambiente, foi operacional.', 2, 71, 2, 139, '2018-05-08 08:16:35'),
