('INC000002029560', '2018-03-19 09:16:24', '2018-03-19 10:55:26', 'Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: FGTS 10,8% &#10;- Início da Ocorrência: 09:17', 'Prezado,&#10;&#10;Informamos que houve falha nos Serviços do OSCC da CERATSA devido a migração de Host no ambiente virtualizado (Vcenter), conforme evidência anexa. Às 8h os operadores não conseguiram logar no Client, com isso as ligações ficavam em espera ocasionando Fila, o que significa que os Clientes estão sujeitos de abandonarem as ligações, causando AB1. Para correção da falha foi necessário efetuar procedimento padrão (restart) para recuperação dos serviços. Após o procedimento efetuamos testes e ficamos monitorando o ambiente. Observamos que até o momento o ambiente encontra-se normalizado, bem como diminuiu gradativamente a porcentagem de AB1.', 9, 73, 2, 208, '2018-05-08 08:16:35'),
('INC000002029563', '2018-03-19 10:35:02', '2018-03-19 11:01:50', 'A Página de Relatóros SIGSC (http://relatorios.servicos.caixa/arsys/shared/login.jsp?/arsys/forms/cctdcapllx0199.df.caixa/AR%20System%20Report%20Console) encontra-se indisponivel', 'Prezado usuário bom dia.&#10;As maquinas foram reiniciadas devido a um problema de índice que estava impactando o usuário final. &#10;O servidor se encontra acessível e operante.&#10;Obrigado .&#10;Att,&#10;Gustavo Petruff&#10;Equipe Sustentação SIGSC', 8, 58, 3, 194, '2018-05-08 08:16:35'),
('INC000002029574', '2018-03-19 17:40:01', '2018-03-19 18:18:08', 'O painel de acompanhamento do antivírus está apresentando máquinas duplicadas, conforme evidência anexa.', 'Prezados(as),&#10;&#10;Informamos que a situação foi regularizada.&#10;&#10;À disposição para eventuais esclarecimentos.', 4, 159, 1, 211, '2018-05-08 08:16:35'),
