('INC000002029597', '2018-03-21 10:00:43', '2018-03-21 10:27:15', 'Ao acessar https://hmp.siiac.proinfo.caixa, após informar usuário e senha, o sistema só apresenta a mensagem de &#39;usuário ou senha inválidos&#39; e não permite o login.', '', 2, 59, 3, 142, '2018-05-08 08:16:35'),
('INC000002029599', '2018-03-21 10:06:09', '2018-03-21 12:26:51', 'A página http://servicos.caixa está apresentando indisponível para alguns usuários, gentileza verificar.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 'Prezado(a), boa tarde.&#10;&#10;Solição de contorno: ambiente normalizado, após restart nos servidores.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Iremos acompanhar a solução definitiva no incidente vinculado na Proinfo.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 194, '2018-05-08 08:16:35'),
