('INC000002029615', '2018-03-16 20:03:36', '2018-03-16 20:55:07', 'OS: 0013/0952', 'O Loop foi resolvido após a retirada da configuração do loop detect de todas as vsis de todas as VLANs.&#10;&#10;Com a autorização da CETEC22(Gilmar), as configurações de loop foram retiradas e o ambiente foi normalizado.&#10;&#10;Atenciosamente,&#10;&#10;Marcio Teramoto&#10;TIVIT', 11, 126, 2, 145, '2018-05-08 08:16:35'),
