('INC000002031570', '2018-03-21 08:40:48', '2018-03-22 14:53:02', 'A&#10;CETEC&#10;&#10;Senhor Gerente,&#10;&#10;1.      Estamos recebendo acionamentos de clientes informando que ao inserir o cartão no terminal de autoatendimento da Caixa (PAE ou SAA), o cartão fica retido no equipamento.&#10;&#10;1.1   Identificamos 109 acionamentos  de CARTÃO RETIDO PELO EQUIPAMENTO até o momento.&#10;&#10;3.       Solicitamos análise desta ocorrência.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Suporte Tecnológico Externo&#10;Caixa Econômica Federal', 'Senhor Daniel Souza,&#10;&#10;1.&#9;Solicitamos informar se é possível nos enviar relação (mail para a CETEC34) com pelo menos 30 terminais afetados pelo incidente. Necessitamos dos dados para identificar &#10;se os terminais em que houve a instalação da correção foram impactados.&#10;&#10;2.&#9;Também ratificar se atinge SAA, porque tal problema é conhecido só afetando terminais PERTO de PAE/SNC.&#10;&#10;3.&#9;Reforçamos junto a esta CERAT que uma das alterações demandadas no SIMOC foi a possibilidade dos atendentes desta equipe poderem reiniciar os terminais remotamente,&#10;o que incorre em destravamento do cartão do cliente.&#10;&#10;    3.1 E em caso de persistência da ocorrência enviar a GITEC de vinculação.&#10;&#10;4.&#9;À disposição para eventuais esclarecimentos.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação', 3, 77, 3, 115, '2018-05-08 08:16:35'),
