('INC000002034131', '2018-03-19 16:45:47', '2018-03-19 18:16:23', 'Favor atualizar o Painel de RH. Tem demandas já tratadas que ainda constam como Pendentes, prejudicando o fluxo de tratamento: http://unidades/sites/CETEC/RH/Solicitar/SitePages/Home.aspx', 'Prezados,&#10;&#10;A atualização do Painel RH foi realizada.&#10;&#10;Caso ainda haja alguma inconsistência nos status das demandas, por favor, abrir o incidente com a relação das demandas para que possamos analisar melhor o problema.&#10;&#10;&#10;Atenciosamente,&#10;Jean Michel', 4, 159, 1, 178, '2018-05-08 08:16:35'),
('INC000002034134', '2018-03-19 20:33:45', '2018-03-19 21:42:26', 'A intranet está fora. Solicitamos que todos os IPs de acesso ao VIP da intrnet, 10.123.6.15, sejam bloqueados,&#10; exceto a rede 10.196.16.0/24. Assim que normalizar, entraremos em contato para liberar os IPs e encerrar o incidente.', 'Após a atualização e o desbloqueio do IPs, o acesso à intranet foi normalizado.', 2, 71, 4, 147, '2018-05-08 08:16:35'),
('INC000002034606', '2018-03-20 10:39:19', '2018-03-20 11:31:14', 'Estamos recebendo acionamentos de unidades, participantes da atualização de versão do SISAG V009C000R019 - Grupo NACIONAL 2, informando que após atualização, ao tentar acessar o SISAG apresenta mensagem de erro &#34; Validando dados da versão de infraestrutura&#34; e o SISAG não carrega.&#10;&#10;Seguem exemplos de registro de requisições já abertas para análise deste problema.&#10;&#10;- REQ000024712230 - AG 0268-SANTANA, SP, Erro em todas as estações&#10;- REQ000024712746 - AG 3346-PRACA BARAO, SP, Erro em todas as estações&#10;- REQ000024712453 - AG 4986-AMERICA DO SUL, SP,  Erro em todas as estações&#10;- REQ000024712398 - AG 4069-LIMAO/SP, Erro em todas as estações', 'À&#10;&#10;1. Informamos que foi identificado que os servidores listado na mensagem estavam com falta de permissão no ISS.&#10;&#10;2. A configuração vai ser corrigida,&#10;&#10;Atenciosamente&#10;&#10;Jonatas Lopes Ferreira&#10;Equipe: Canal Agencia&#10;Stefanini/CETEC', 5, 70, 3, 206, '2018-05-08 08:16:35'),
('INC000002034614', '2018-03-20 12:05:19', '2018-03-20 13:47:42', 'À&#10;CETEC,&#10;&#10;1.&#9;Informamos que o ITSM (http://servicos.caixa)  encontrava-se com extrema lentidão no que se refere aos módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de indisponibilidade:&#10;- Data Fim: 20/03/2018                                                 &#10;- Hora Fim: 11:30', 'Reciclagem do serviço do Tomcat.', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002034644', '2018-03-21 10:25:32', '2018-03-21 12:27:32', 'Prezados, &#10;&#10;1.&#9;Informamos que o ITSM (http://servicos.caixa) que encontrava-se com extrema lentidão no que se refere aos módulos de Incidentes, Serviços e Mudanças.&#10;&#10;Período de indisponibilidade:&#10;- Data inicio: 21/03/2018                                                 &#10;- Hora:09:40&#10;&#10;Atenciosamente,&#10;&#10;Central de Serviços de TI &#10;CN – Operações de TI Brasília/BR', 'Prezado(a), boa tarde.&#10;&#10;Solição de contorno: ambiente normalizado, após restart nos servidores.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Iremos acompanhar a solução definitiva no incidente vinculado na Proinfo.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 175, '2018-05-08 08:16:35'),
('INC000002035311', '2018-03-20 12:21:27', '2018-03-20 14:09:51', 'Informamos que a fila PROGRAMAS_SOCIAIS encontra-se com o %AB1 8,2%.&#10;&#10;CIDADÃO: 0800 726 0207&#10;&#10;CERATSA.', 'Informamos que, após verificação do ambiente de telefonia, não identificamos falhas no ambiente da CERATSA que justifiquem índice maior de AB1.&#10;No entanto, observamos que a CERATSA muitas vezes não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1. Sugerimos alocar mais agentes na fila para atendimento da demanda. Segue em anexo analise.', 9, 172, 2, 208, '2018-05-08 08:16:35'),
('INC000002035315', '2018-03-20 16:23:11', '2018-03-20 17:23:10', 'Informamos que a fila CONTRATO_HABITAÇÃO encontra-se com o %AB1 8,8%.&#10;&#10;CERAT/SP&#10;COMERCIAL: 3004 1105 – 0800 726 0505', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSP que justifiquem índice maior de AB1.&#10;Observamos que a CERATSP não possui agentes disponíveis para atendimento da fila Contrato Habitação, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;Segue o print do relatório de usuários, evidenciando que não há agentes disponíveis para atendimento na CERATSP:&#10;Segue o print do relatório acumulativo da fila Contrato Habitação informando o nível de serviço que está em 43,08% e a quantidade de abandono nos 1°, 2° ,3° ,4° e 5° intervalos.', 9, 172, 2, 208, '2018-05-08 08:16:35'),
('INC000002036507', '2018-03-20 10:16:43', '2018-03-20 10:25:12', 'TUE 20 MAR, 2018 -10=15=39&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO RTDJFCE&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - &#10;      CONTATO - &#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAÇÃO', 'Conforme verificado não houve indisponibilidade do dispositivo.', 10, 121, 1, 231, '2018-05-08 08:16:35'),
