('INC000002040701', '2018-03-21 16:07:32', '2018-03-21 16:31:07', 'Informamos que a fila &#10;STE_CERTIFICACAO_DIGITAL_PF encontra-se com o %AB1 8,18%.&#10;&#10;CERAT/SP&#10;COMERCIAL: 3004 1105 – 0800 726 0505', 'Informamos que o incidente foi aberto com dados inconsistentes. A fila STE_CERTIFICACAO_DIGITAL_PF não consta na CERATSP. Por esse motivo será encerrado.&#10;&#10;Att,&#10;Matheus Gomes', 9, 172, 2, 208, '2018-05-08 08:16:35'),
