('INC000002043230', '2018-03-24 19:07:25', '2018-03-24 22:25:35', 'Prezados,&#10;&#10;Informamos que a página de monitoramento do autoatendimento http://simga.caixa/, vem apresentando desde o início da madrugada ausência de sondas nos terminais dentro da página. Ressaltamos que os terminais estão operando normalmente conforme contato realizado com as GITECs. Foi efetuado contato com Porto Alegre onde identificaram amostra SNC de sonda e transações recentes, portanto o terminal vem apresentando ausência de sondas indevidamente. Conforme solicitação da equipe, favor analisar possível instabilidade no SIMTC/SIMAA.', 'Reciclagem da instância', 13, 181, 1, 291, '2018-05-08 08:16:35'),
