('INC000002051982', '2018-04-03 10:54:36', '2018-04-03 12:22:55', 'Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de Lentidão:&#10;- Data Início: 03/04/2018                                                 &#10;- Hora Início: 10h10&#10;&#10;&#10;Atenciosamente,&#10;Manoel&#10;CEPTIBR / CPM - Central de Atendimento&#10;Ramal:(61)3448-6437', 'Prezado Usuário,&#10;&#10;1. Informamos que um dos servidores da aplicação apresentou lentidão no período citado, porém a situação já foi regularizada.&#10;&#10;2. Favor efetuar novos testes.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002052018', '2018-03-29 23:43:03', '2018-03-29 23:56:52', 'THU 29 MAR, 2018 -23=42=56&#10;HOUVE UMA PERDA DE COMUNICACAO COM O EQUIPAMENTO DF7560RA1.DF.CAIXA&#10;&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - GITEC/BR - SEPN 507 BL A 3 ANDAR/ W3 - BRASILIA - DF&#10;      CONTATO - GITEC-BR TEL (61) 3206-1700/1702&#10;--------&#10;&#10;CAUSAS PROVAVEIS=&#10;1) EQUIPAMENTO FOI REINICIALIZADO;&#10;2) EQUIPAMENTO FOI DESLIGADO (QUEDA DE ENERGIA / MANUTENCAO );&#10;3) QUEDA DOS CIRCUITOS DE BACKBONE;&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE SERVIDOR&#10;   EFETUAR PING PARA O SERVIDOR.&#10;   CASO NAO HAJA RESPOSTA, ACIONAR SUPORTE RESPONSAVEL.&#10;   CASO O PING SEJA RESPONDIDO NORMALMENTE, ACIONAR EQUIPE SUPORTE A REDE.&#10;&#10;--------&#10;ACOES PARA NODE DOWN DE DEMAIS EQUIPAMENTOS&#10;   CONTATAR A CETEC PARA IDENTIFICAR A CAUSA.&#10;   FECHAR ESTE REGISTRO APOS O RESTABELECIMENTO DO ATIVO.&#10;&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAÇÃO', 'Informo que o equipamento esta respondendo a ping', 10, 226, 1, 352, '2018-05-08 08:16:35'),
('INC000002052342', '2018-03-30 08:05:05', '2018-03-30 09:20:16', 'Solicito verificar as bases que alimenta as view existentes no servicor CCTDCDADNT0002SQL7562PRD14 balse OLDB001.&#10;AS INFORMAÇÕES NÃO ESTÃO ATUALIZANDO&#10;- VIEW VW001', 'Prezado,&#10;&#10;Informamos que foi identificado inconsistência no processamento da aplicação que importa o arquivo de sondas gerando atraso em páginas que monitora o autoatendimento. Foi aberto wo 25200637 para equipe responsável verificar a situação apresentada.', 3, 224, 1, 354, '2018-05-08 08:16:35'),
