('INC000002052469', '2018-04-02 13:26:16', '2018-04-02 16:36:48', 'Prezados, &#10;&#10;1.&#9;Informamos que o ITSM (http://servicos.caixa) encontra-se com extrema lentidão no que se refere aos módulos de Incidentes, Serviços e Mudanças. &#10;problema.            &#10;&#10;Período de indisponibilidade:&#10;- Data Inicio: 02/04/2018                                                 &#10;- Hora Inicio: 12:50&#10;&#10;Atenciosamente,&#10;&#10;Central de Serviços de TI &#10;CN – Operações de TI Brasília/BR', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 175, '2018-05-08 08:16:35'),
('INC000002052478', '2018-04-02 16:33:57', '2018-04-02 20:39:28', 'Informamos que este Service Desk está recebendo demandas nas quais os usuários relatam:&#10;Não permite consulta das operações da Pessoa Física, fica carregando indefinidamente.&#10;&#10;Segue tela em anexo.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Ao realizamos o primeiro teste de comunicação com o banco nos deparamos com a seguinte mensagem:&#10;&#10;&#34;[domain@localhost:9999 /] /host=cctdcapllx0102/server=srv0102_SIBDO/subsystem=datasources/data-source=SibdoDS:test-connection-in-pool&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; [true],&#10;    &#34;response-headers&#34; =&#62; {&#34;process-state&#34; =&#62; &#34;restart-required&#34;}&#10;}&#10;&#34;&#10;&#10;&#10;Informamos que foi realizado teste de conexão com o banco e o mesmo não apresentou falhas &#10;[domain@localhost:9999 /] /host=cctdcapllx0102/server=srv0102_SIBDO/subsystem=datasources/data-source=SibdoDS:test-connection-in-pool&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; [true]&#10;}&#10;&#10;&#10;pedimos a gentileza de realizar um novo teste de consulta.', 2, 233, 1, 363, '2018-05-08 08:16:35'),
