('INC000002053634', '2018-04-02 09:57:13', '2018-04-02 10:50:53', 'Informamos que o  Indicador Regional do Service Desk não está apresentando nenhum índice dos indicadores referente ao TIC / TELEFONIA, em nenhum dos contratos da competência 03/2018.', 'Prezado (as), &#10;&#10;1.&#9;Informamos que os dados já estão disponíveis na página para todos os contratos. &#10;2.&#9;Segue em anexo imagem &#10;3.&#9;Estamos à disposição para demais dúvidas. &#10;&#10;Atenciosamente,&#10;Jose Patricio Vieira&#10;Analista de Banco de Dados', 4, 231, 2, 360, '2018-05-08 08:16:35'),
('INC000002053643', '2018-04-02 11:48:54', '2018-04-02 12:27:21', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGDB&#10;Atuação: Arquivos não Disponibilizados&#10;&#10;Descrição: A Página http://aplicativos.cetec.df.caixa/Pages/Web/Gestao/SIGDB/TransmissaoArquivo.aspx, não foi identificado os arquivos do SIGDB do dia de hoje, 02/04/2018, no controle de transmissão de arquivos SIGDB.', 'A&#10;&#10;CETEC - Central de Monitoramento,&#10;&#10;Senhor Coordenador&#10;&#10;1.     Informamos que os dados do SIGDB não constam desatualizados, tendo em vista que no último movimento 30/03/2018 foi feriado.&#10;&#10;2.     Na data de 03/04/2018 os estarão atualizados .&#10;&#10;3.     Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção Sênior&#10;Canais Agência Stefanini/CETEC', 5, 230, 1, 34, '2018-05-08 08:16:35'),
