('INC000002056511', '2018-04-03 10:41:18', '2018-04-03 11:08:42', 'O SIGRO de homologação está apresentando extrema lentidão, impossibilitando o seu uso e de acordo com log do jBoss o problema deve estar relacionado a memória.&#10;&#10;Gentileza avaliar e solucionar o problema, pois necessitamos realizar testes para comprovar a existência ou não de problema reclamado pelo Gestor, tanto em HMP quanto em PRD.&#10;&#10;=====TRANSCRIÇÃO DE PARTE DO LOG DO JBOSS=====&#10;&#34;10:32:29,524 WARN  [org.hornetq.core.remoting.server.impl.RemotingServiceImpl] (hornetq-failure-check-thread) GC overhead limit exceeded: java.lang.OutOfMemoryError: GC overhead limit exceeded&#10;&#9;at java.util.HashSet.(HashSet.java:103) [rt.jar:1.7.0_55]&#10;&#9;at org.hornetq.core.remoting.server.impl.RemotingServiceImpl$FailureCheckAndFlushThread.run(RemotingServiceImpl.java:589) [hornetq-core-2.2.23.Final-redhat-1.jar:2.2.19.SNAPSHOT (HQ_2_2_23_Final, 122)]&#10;&#10;10:32:16,675 ERROR [org.apache.tomcat.util.net.JIoEndpoint] (http-/0.0.0.0:8493-Acceptor-0) Socket accept failed: java.lang.OutOfMemoryError: GC overhead limit exceeded&#10;&#9;at sun.security.ssl.InputRecord.(InputRecord.java:84) [jsse.jar:1.7.0_55]&#10;&#9;at sun.security.ssl.AppInputStream.(AppInputStream.java:50) [jsse.jar:1.7.0_55]&#10;&#9;at sun.security.ssl.SSLSocketImpl.init(SSLSocketImpl.java:586) [jsse.jar:1.7.0_55]&#10;&#9;at sun.security.ssl.SSLSocketImpl.(SSLSocketImpl.java:494) [jsse.jar:1.7.0_55]&#10;&#9;at sun.security.ssl.SSLServerSocketImpl.accept(SSLServerSocketImpl.java:313) [jsse.jar:1.7.0_55]&#10;&#9;at org.apache.tomcat.util.net.jsse.JSSESocketFactory.acceptSocket(JSSESocketFactory.java:180) [jbossweb-7.0.17.Final-redhat-1.jar:]&#10;&#9;at org.apache.tomcat.util.net.JIoEndpoint$Acceptor.run(JIoEndpoint.java:322) [jbossweb-7.0.17.Final-redhat-1.jar:]&#10;&#9;at java.lang.Thread.run(Thread.java:745) [rt.jar:1.7.0_55]&#34;', '', 2, 235, 1, 364, '2018-05-08 08:16:35'),
('INC000002056622', '2018-04-03 15:14:51', '2018-04-03 15:53:09', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Página Antivírus&#10;Atuação: &#10;&#10;Descrição: Prezados,&#10;&#10;Informamos que foi detectado a desatualização da seguinte página. &#10;http://antivirus.cetec.df.caixa/RepStatus/.', '', 4, 76, 1, 34, '2018-05-08 08:16:35'),
('INC000002056623', '2018-04-03 18:05:21', '2018-04-06 17:43:55', 'Prezados,&#10;&#10;Permanece erro em que não permite consulta das operações da Pessoa Física, fica carregando indefinidamente no bdcaixaweb.caixa&#10;&#10;Segue print em anexo.', 'Prezados pedimos a gentileza de realizar novos testes, pois aplicação foi reinicializada&#10;&#10;Informamos que o banco utilizado pela aplicação está funcionando corretamente conforme evidencia.&#10;&#10;[domain@localhost:9999 /] /host=cctdcapllx0102/server=srv0102_SIBDO/subsystem=datasources/data-source=SibdoDS:test-connection-in-pool&#10;{&#10;    &#34;outcome&#34; =&#62; &#34;success&#34;,&#10;    &#34;result&#34; =&#62; [true]&#10;}&#10;&#10;&#10;Conforme verifica nos logs não foram apresentados erros de infraestrutura na aplicação.&#10;&#10;&#10;Informamos também que foi realizar a rentativa de contado com os colaboradores  Marcos Paula e Lucas de Resende. Porém não conseguimos contato.', 2, 233, 2, 363, '2018-05-08 08:16:35'),
