('INC000002058708', '2018-04-04 10:15:09', '2018-04-04 10:24:02', '1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;2.&#9;Afim de que a CETEC avalie a situação e proceda com as tratativas necessárias à normalização.&#10;&#10;Período de Lentidão:&#10;- Data Início: 04/04/2018                                                 &#10;- Hora Início: 10h00&#10;&#10;Central de Atendimento             &#10;CN - Operações de TI Brasília/DF&#10;Maria Elaine', 'Prezada Usuária,&#10;&#10;1. Após análise, não identificamos falhas em nenhum dos servidores da aplicação e ao efetuar testes, a aplicação não apresentou lentidão', 8, 58, 1, 175, '2018-05-08 08:16:35'),
