('INC000002058923', '2018-04-04 18:27:47', '2018-04-04 18:51:34', 'O SICBC não está capturando mensagens, nem permitindo o login.&#10;&#10;No log do Tomcat, consta o seguinte erro, relacionado a conexão perdida com o Banco:&#10;&#10; #sicbc# FATAL [UsuarioDAO] javax.persistence.PersistenceException: org.hibernate.exception.JDBCConnectionException: This connection has been closed. 18:16:16,766 [http-8443-4]', 'Prezados, informamos que houver um inconsistência no banco de dados o que pode te afetado a aplicação.  Pedimos a gentileza de realizar um novo teste na aplicação.', 2, 51, 3, 190, '2018-05-08 08:16:35'),
('INC000002058960', '2018-04-06 09:13:48', '2018-04-06 10:09:13', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Agência Virtual&#10;Atuação: Failed Desktop OS Machines&#10;&#10;Descrição: Constatamos que há 31 alertas em “Failed Desktop OS Machines”.', '1. Em atenção ao incidente percebido nesta manhã através da monitoração Director, reportado pela Central de Monitoramento, esclarecemos que a ação de contorno foi iniciada e tem previsão para conclusão ainda nesta manhã, aproximadamente em 1 hora.&#10;&#10;2. Conforme o coordenador de projetos nuvem caixa, Gustavo Bueno o mesmo também verificou que esse problema ocorre devido porque está tendo um migrate de um host para o outro o serviço está no ar só algumas máquinas estão indisponíveis e deve normalizar em pouco tempo.&#10;&#10;3. Orientamos que quando ocorra esse problema é recomendado que os próprios usuários abra chamado para Gitec de vinculação solicitando a atualização e verificação da aplicação.&#10;&#10;4. Colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente&#10;&#10;Jonatas Lopes Ferreira&#10;Equipe: Canal Agencia&#10;Stefanini/CETEC', 5, 241, 1, 34, '2018-05-08 08:16:35'),
('INC000002058980', '2018-04-06 17:33:31', '2018-04-06 17:48:49', 'Máquinas não respondendo no ambiente APR7562LX022 e APL7562LX164 ocasionando indisponibilidade neste segmento.', 'Prezado Carlos,&#10;&#10;1. Informamos que os servidores retornaram ao funcionamento correto sem a necessidade de atuação técnica.&#10;&#10;2. Aparentemente foi falha de comunicação do servidor físico ou virtual, pois ao analisar os logs, não consta erros.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 2, 193, '2018-05-08 08:16:35'),
('INC000002059063', '2018-04-06 02:37:16', '2018-04-06 05:42:40', 'BKB_BARRSDR1_G0/2.77(-)DFTSRDTC1_G4/2/2.77_LV3(500003969)', 'Abertura de chama junto operadora.', 7, 44, 2, 373, '2018-05-08 08:16:35'),
