('INC000002059118', '2018-04-04 15:17:45', '2018-04-04 15:34:43', 'Prezados,&#10;&#10;1. Sistema SIING ambiente de PRODUÇÃO, está indisponível.&#10;2. Apresenta msg de OCORREU ERRO INESPERADO logo após logon.&#10;3. Gentileza verificar com urgência&#10;&#10;Att.&#10;Persio Fagundes&#10;GITEC/CT PEDeS', '', 2, 60, 3, 197, '2018-05-08 08:16:35'),
('INC000002059157', '2018-04-06 07:44:12', '2018-04-06 08:43:46', 'Prezados, &#10;&#10;1.&#9;Informamos que a base de relatórios analytics (http://analytics.servicos.caixa) encontra-se Indisponível. &#10;          &#10;Período de indisponibilidade:&#10;- Data Início: 06/04/2018                                                 &#10;- Hora Início: 07:00&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento de TI &#10;CN – Operações de TI Brasília/BR', 'Prezado(a) usuário(a) bom dia. &#10;O erro em questão está sendo tratado no PBI000000125304.&#10;O servidor em questão já foi reiniciado e o erro não deve voltar a ocorrer. &#10;Atenciosamente,&#10;Equipe Sustentação -  SIGSC', 8, 58, 1, 371, '2018-05-08 08:16:35'),
('INC000002059214', '2018-04-04 14:49:49', '2018-04-04 15:14:41', 'Tipo de Monitoração: Aplicação&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: SIGSC&#10;Atuação: GSC - ITSM - Aplicação MQ Client&#10;&#10;Descrição: Informamos que há problemas no RTC. Há no momento 1 mensagem parada na fila “LQ.RSP.SERVICO.ITSM”.', 'Prezado Usuário,&#10;&#10;1. Informamos que a a mensagem ficou &#34;parada&#34; na fila devido a falta do motivo do status ao fechar a mudança no GSC e com isso o RTC não consegue consumir.&#10;&#10;2. Comunicamos que essa ocorrência se trata de um erro conhecido e está sendo tratado através do PBI000000096206.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 34, '2018-05-08 08:16:35'),
('INC000002059278', '2018-04-06 11:57:52', '2018-04-06 18:29:51', 'À&#10;CETEC,&#10;&#10;Informamos que servcos.caixa encontra-se com lentidão nos módulos de mudança, serviço e incidentes.&#10;&#10;Período de lentidão&#10;&#10;Data inicial:06/04/2018&#10;Hora inicio:11:30', 'reciclagem de serviço', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002059308', '2018-04-04 15:31:25', '2018-04-04 16:00:01', 'O sistema apresenta a mensagem de &#34;Não foi possível recuperar os dados do usuário&#34;.&#10;&#10;Solicito verificar se a base de dados do sistema está no ar e se o usuário de banco está com permissão para o esquema asosm001', 'Prezados, informamos que houver um inconsistencia no banco, porém ja foi normalizada. pedimos a gentileza de realizar o teste.&#10;&#10;&#10;&#10;Att', 2, 53, 3, 188, '2018-05-08 08:16:35'),
('INC000002059309', '2018-04-04 18:20:11', '2018-04-04 18:55:52', 'O sistema não tem concluído os fluxos previstas pelas suas funcionalidades. A equipe de desenvolvimento atribui este incidente à perda de conexão com o Banco de Dados. Pedimos que seja realizada uma análise com este foco no ambiente de produção do SIAGD.', 'Prezados, informamos que houver um inconsistência no banco de dados o que pode te afetado a aplicação.  Pedimos a gentileza de realizar um novo teste na aplicação.', 2, 51, 2, 370, '2018-05-08 08:16:35'),
('INC000002059322', '2018-04-05 11:57:48', '2018-04-05 16:22:06', '1.Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de Lentidão:&#10;&#10;- Data Início: 05/04/2018                                                 &#10;- Hora Início: 11:30', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
