('INC000002061403', '2018-04-04 16:19:36', '2018-04-05 09:42:30', 'A&#10;CETEC27 - CGR - Centro de Gerenciamento de Rede &#10;&#10;Prezados,&#10;&#10;&#10;1.&#9;Solicitamos análise e posicionamento quanto a evidência de indisponibilidade de rede centralizada na região da BAHIA.&#10;&#10;2.&#9;Identificamos acionamentos, via canal telefônico de usuários informando que ao acessar o SISAG a estação fica travada e não consegue dar continuidade.&#10;&#10;3.&#9;Para análise segue chamados:&#10;&#10;REQ000025071381       BA       Unidade           3233&#10;REQ000025074235       BA       Unidade           1050&#10;REQ000025071391       BA       Unidade           3201&#10;REQ000025074581       BA       Unidade           4764&#10;&#10;4.&#9;Solicitamos posicionamento para adequação do nosso atendimento junto ao usuário.&#10;&#10;5.&#9;Agradecemos antecipadamente e nos colocamos à disposição.&#10;&#10;&#10;Atenciosamente&#10;&#10;WAGNER SOUSA&#10;Assistente&#10;&#10;MARCOS PAULO BARBOSA DAS CHAGAS&#10;Supervisor de TI&#10;Tecnologia da Informação', 'À&#10;CETEC&#10;&#10;1.  Mantivemos contato com representantes de todas as unidades listadas e recebemos os retornos conforme abaixo:&#10;&#10;3233 - REQ000025071381 - Inacessibilidade do SISAG de modo não generalizado e restabelecido sem intervenção técnica. Confirmação realizada com os colegas Sheila Thaise Almeida Silva e Vagner Fernandes Oliveira.&#10;&#10;1050 - REQ000025074235 - Inacessibilidade do SISAG de modo não generalizado e restabelecido sem intervenção técnica. Confirmação realizada com Jarbas Santos Cotia.&#10;&#10;3201 - REQ000025071391- Inacessibilidade do SISAG de modo generalizado e restabelecido sem intervenção técnica.&#10;&#10;4764 - REQ000025074581 - Problema de baixa de imagem. Concluída.&#10;&#10;2.&#9;Realizamos análise no ambiente de Rede WAN para todas as unidades, mesmo duas delas informando que não houve indisponibilidade total do SISAG e demais serviços.&#10;&#10;2.1.    Identificamos que não ocorreram anormalidades nos links de Backbone, tampouco nos de Rede de Acesso que pudessem indisponibilizar o referido serviço.&#10;&#10;3.&#9;Acionaremos a GITEC de vinculação e a coordenação da CETEC pertinente para análise da REDE LAN e periféricos; e aplicação, respectivamente.&#10;&#10;4.      À disposição em caso de dúvidas.&#10;&#10;Atenciosamente,&#10;&#10;CGR', 3, 70, 3, 206, '2018-05-08 08:16:35'),
('INC000002061483', '2018-04-07 12:16:13', '2018-04-07 13:21:27', 'Informamos que a base de relatórios analytics (http://analytics.servicos.caixa) encontra-se Indisponível.&#10;&#10;Período de indisponibilidade:&#10;- Data Início: 07/04/2018                                                 &#10;- Hora Início: 08:00', 'Prezado(a) usuário(a) bom dia. &#10;O erro em questão está sendo tratado no PBI000000125304.&#10;O servidor em questão já foi reiniciado e o erro não deve voltar a ocorrer. &#10;Atenciosamente,&#10;Equipe Sustentação -  SIGSC', 8, 58, 1, 371, '2018-05-08 08:16:35'),
