('INC000002072406', '2018-04-09 09:33:19', '2018-04-09 15:01:45', 'Informamos que o ITSM (serviços.caixa) encontra-se com lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período de Lentidão:&#10;&#10; &#10;&#10;- Data Início: 09/04/2018                                                 &#10;- Hora Início: 09:15', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002072408', '2018-04-10 11:24:02', '2018-04-10 14:36:50', 'GSC está muito lento, impactando nas tarefas que dependem do uso da ferramenta e dificultando a abertura de demandas pelos usuários.', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
