('INC000002072462', '2018-04-19 10:12:48', '2018-04-19 12:09:04', '1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com  extrema lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período da Ocorrência:&#10;- Data Início: 19/04/2018                                                 &#10;- Hora Início: 09h45', 'Prezado, boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Lembrando também que existe uma falha no ambiente de virtualização onde se encontra os servidores do GSC sendo tratado pela Proinfo, portanto, deveremos ter esses incômodos até a solução definitiva do problema.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002072474', '2018-04-23 11:25:33', '2018-04-23 13:57:40', 'Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com extrema lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;2.&#9;Afim de que a CETEC avalie a situação e proceda com as tratativas necessárias à normalização.&#10;&#10;&#10;Período da Ocorrência:&#10;- Data Início: 230/04/2018                                                 &#10;- Hora Início: 11h00&#10;&#10;&#10;Atenciosamente &#10;Central de Atendimento &#10;CN – Operações de TI Brasília/DF', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 175, '2018-05-08 08:16:35'),
('INC000002072524', '2018-04-10 08:27:36', '2018-04-10 09:09:47', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Erro de Sistema&#10;Item Monitorado: Agência Virtual&#10;Atuação: Failed Desktop OS Machines&#10;&#10;Descrição: Constatamos que há 76 alertas em “User Connection Failures”.', '1. Em atenção ao incidente percebido nesta manhã através da monitoração Director, reportado pela Central de Monitoramento, esclarecemos que a ação de contorno foi iniciada e tem previsão para conclusão ainda nesta manhã, aproximadamente em 1 hora.&#10;&#10;2. Conforme o coordenador de projetos nuvem caixa, Gustavo Bueno o mesmo também verificou que esse problema ocorre devido porque está tendo um delivery group que foi desabilitado ontem, mas, hoje, uma rotina automática o reativou. Quem quem tinha o pool no &#34;favoritos&#34;, dava erro de falta de capacidade e já foi desativada.&#10; &#10;3. Esse número que mostra no Unvaliable capacity é referente à última hora em que os erros começaram às 08 e foram até 08:30. Então, a partir das 09, vai descer esse número e provavelmente as  09:30 deve zerar esse item de Unvailiable capacity.&#10;&#10;4. Orientamos que quando ocorra esse problema é recomendado que os próprios usuários abra chamado para Gitec de vinculação solicitando a atualização e verificação da aplicação.&#10;&#10;5. Colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Jonatas Lopes Ferreira&#10;Equipe: Canal Agência&#10;Stefanini/CETEC', 5, 241, 1, 34, '2018-05-08 08:16:35'),
('INC000002072525', '2018-04-10 08:31:18', '2018-04-10 09:11:22', 'Tipo de Monitoração: Páginas Web&#10;Tipo de Evento: Inconsistência de Dados&#10;Item Monitorado: Indicador GERTI&#10;Atuação: &#10;&#10;Descrição: A Página - http://supere.caixa/Supere/Index, informamos que não foram publicados os seguintes indicadores em D-1 dos dias 05/04, 06/04, 07/04, 08/04 e 09/04. Todas as GITEC&#39;s&#10;&#10;INDICADORES&#10;&#10;Disponibilidade da Rede / Foco Negocial&#10;Disponibilidade da Rede / Foco Tecnologia', 'Senhores(as), informamos que os dados foram reprocessados e atualizados.&#10;&#10;Att,&#10;Wdarles Leivas', 4, 247, 1, 34, '2018-05-08 08:16:35'),
