('INC000002072917', '2018-04-09 10:48:44', '2018-04-09 12:04:57', 'Informamos que os totens e paineis do SIPNL v3.0 (gerenciadordeatendimento.caixa), em piloto nas agências João Negrão e Ministério da Fazenda, estão fora devido a conexão negada no proxy para a porta 5445. Em testes, os totens conseguem fazer&#34; telnet gerenciadordeatendimento.caixa 80&#34;, porém, levam connection resufed ao tentar &#34;telnet gerenciadordeatendimento.caixa 5445&#34;. Favor verificar o porque não está sendo possível conectar na porta 5445. Salientamos que sem os totens e painéis as agências estão totalmente fora!', 'À&#10;CETEC64 - Proinfo &#10;&#10;1.    Tendo em vista se tratar do ambiente SIPNL versão 3.0, solicitamos a analise deste incidente por esta CETEC64.&#10;&#10;2.     A disposição para esclarecimentos,&#10;&#10;3.     Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção Sênior&#10;Canais Agência Stefanini/CETEC', 2, 244, 3, 385, '2018-05-08 08:16:35'),
