('INC000002075812', '2018-04-11 09:05:16', '2018-04-11 09:49:00', 'Ao entrar com usuário e senha no SIING o sistema retorna o erro anexo.', 'Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10; &#10;Devido a falta de comunicação entra a aplicação e o banco de dados conforme evidência em abaixo, foi necessario o restart da aplicação. &#10;&#10;&#10;2018-04-11 09:19:41,196 WARN  [org.hibernate.engine.jdbc.spi.SqlExceptionHelper] (http-/0.0.0.0:8080-4) SQL Error: 0, SQLState: 08003 &#10;2018-04-11 09:19:41,196 ERROR [org.hibernate.engine.jdbc.spi.SqlExceptionHelper] (http-/0.0.0.0:8080-4) This connection has been close&#10;&#10;Informamos que a aplicação encontra-se disponível, conforme teste realizados juntamente com o solicitante.', 2, 60, 3, 197, '2018-05-08 08:16:35'),
