('INC000002077710', '2018-04-12 17:46:26', '2018-04-12 18:24:38', 'Serviço Afetado* :&#9;STE (Suporte Tecnológico)&#10;Números Afetados:&#9;3004 1104 - 0800 726 0104&#10;Localidade Afetada :&#9;CERAT/SP&#10;Descrição* :&#9;Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: STE_CONVENIO_COBRANCA_EP 8,3% &#10;- Início da Ocorrência: 17:45', 'Informamos que foi realizado análise das ligações da Fila STE_CONVENIO_COBRANÇA_EP da CERATSA e identificamos que não havia agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia. No entanto, a porcentagem de AB1 abaixou para 7,9% até o fechamento desse INC.', 9, 73, 2, 208, '2018-05-08 08:16:35'),
