('INC000002090202', '2018-04-18 19:00:57', '2018-04-18 19:44:10', 'Prezados Senhores &#10;O portal da Universidade Caixa encontras-se fora do ar.&#10;Favor verificar&#10;http://cctdcapllx0076.df.caixa:10091/ucc_facil &#9;&#10;http://cctdcapllx0079.df.caixa:10091/ucc_facil', 'Prezados (a),&#10;&#10;informamos que este incidente foi resolvido com as seguintes medidas:&#10;&#10;Foi reiniciado as instâncias do plone nos servidores http://cctdcapllx0076 e &#10;http://cctdcapllx0079 e ambas estão operantes conforme imagem em anexo.&#10;&#10;Att,&#10;&#10;Equipe Mais2X', 6, 74, 4, 171, '2018-05-08 08:16:35'),
('INC000002090212', '2018-04-19 15:12:01', '2018-04-19 16:49:45', 'Ocorre mensagem de erro em anexo ao clicar em Custódia &#62; Arquivos.&#10;&#10;Segue WO&#39;s de &#10;WO0000025645466&#10;WO0000025569995&#10;WO0000025572082', 'A&#10;&#10;UNIDADE,&#10;&#10;Senhor (a) Usuário (a)&#10;&#10;1&#9;Informamos que foi identificado erro após a atualização da versão 6.3.5 do SICCH, referente a problemas apresentados ao tentar utilizar a opção &#34;CUSTÓDIA &#60; ARQUIVOS&#34;, &#10;onde está sendo apresentada a mensagem  de &#34;Run-time error 50030 - Unable to initialize, please, contact the developer&#34;.&#10; &#10;2&#9;Comunicamos que a Área Gestora e de desenvolvimento já foi acionada para análise e estão trabalhando para corrigir o problema, e está CN CETEC &#10;continuará acompanhando a ocorrência, gentileza aguardar.&#10;&#10;3&#9;Desta forma, este chamado está sendo encerrado.&#10;&#10;5.  Agradecemos a compreensão e colocamo-nos a disposição para os esclarecimentos julgados necessários.&#10;&#10;Atenciosamente,&#10;&#10;Simone Saraiva&#10;Analista de Produção Sênior&#10;Canais Agência Stefanini/CETEC', 5, 268, 3, 437, '2018-05-08 08:16:35'),
('INC000002090232', '2018-04-21 08:12:48', '2018-04-21 10:31:30', 'Prezados(as), &#10;&#10;Informamos indisponibilidade no analytics.&#10;&#10;Período da Ocorrência:&#10;&#10;- Data Início: 21/04/2018                                                 &#10;- Hora Início: 07h00&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento', 'Prezada Usuária,&#10;&#10;1. Informamos que o serviço foi restabelecido.&#10;&#10;2. Comunicamos que haverá uma mudança na ferramenta na data de 22/04/2018 visando regularizar a intermitência do Analytics.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 3, 371, '2018-05-08 08:16:35'),
('INC000002090281', '2018-04-24 09:23:21', '2018-04-24 11:02:40', 'Conforme informado pela área gestora:&#10;&#10;De: SUCOI01 - COMPLIANCE &#10;Enviada em: terça-feira, 24 de abril de 2018 08:42&#10;Para: GITECGO05 - Desenvolvimento Descentralizado&#10;Assunto: SINPC - Script de Atualização base Novo Portfolio &#10;&#10;À&#10;GITECGO05&#10;&#10;Senhor Gestor,&#10;&#10;1          Conforme contato, informamos que o usuário “usrw_go_sinpc” em que pese conseguir efetuar a conexão com o banco (dados abaixo), está sem permissão para gravação (truncate/insert/delete/update).&#10;&#10;                        SQL Server:     CCTDCDADNT0025.corp.caixa.gov.br&#10;                        SQL Database: NPCDB001&#10;                        SQL User:        usrw_go_sinpc&#10;                        Tables:            NPCTB003_ESPELHO_NORMATIVOS / NPCTB002_NORMATIVOS&#10;&#10;2          Aguardamos retorno,&#10;&#10;Atenciosamente&#10;&#10;Cesar Halabi de Paula&#10;Gerente Executivo&#10;SN Controle Institucional do Conglomerado&#10;(61) 3206-3185', 'Prezado Usuário,&#10;&#10;Após contato realizando em conjunto com PROINFO e SUCTI06, foi identificado que o problema em questão está sobre a administração da SUCTI06, que irá tratar o problema por meio mensagem. &#10;&#10;Ressaltamos esse tipo de atendimento não é tratado como incidente, pois a Equipe da SUCTI06 não atende incidente e nem requisição de Ordem de Serviço no SIGSC, somente por meio de mensagens enviada pelo Outlook.&#10;&#10;Foi encaminhado um e-mail para SUCTI06 colocando a descrição do problema e relatando o andamento do incidente realizado pela CETEC. Foi copiado a cliente e-mail (Ana Flavia Netto).&#10;&#10;Estamos à disposição para maiores esclarecimentos.&#10;&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;61 3206 -1800', 3, 276, 1, 452, '2018-05-08 08:16:35'),
('INC000002090283', '2018-04-24 11:23:50', '2018-04-24 12:10:39', 'Serviço Afetado : STE (Suporte Tecnológico)&#10;Números Afetados:&#9;3004 1104 - 0800 726 0104&#10;Localidade Afetada : CERAT/BR&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATBR:&#10;- FILA: STE_CONVENIO_COBRANCA_PJ - 8,03% &#10;- Início da Ocorrência: 11:20 &#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', 'Informamos que realizamos a análise das ligações da Fila STE_CONVENIO_COBRANÇA_PJ da CERATBR e identificamos que não há agentes disponíveis para atender as ligações de imediato, conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia. E também, verificamos no Message Flow for Call do SBC de algumas ligações que o BYE está vindo do Cliente antes dos 10segundos.', 9, 172, 2, 208, '2018-05-08 08:16:35'),
