('INC000002091919', '2018-04-20 10:19:20', '2018-04-20 10:58:40', 'Prezados..&#10;&#10;O maquina de servidor bdd7562lx104.df.caixa esta indisponível por favor verificar', 'Prezado(a), o disco de 200GB que está como THIN encheu a LUN fazendo com que a máquina ficasse parada até que fosse liberado espaço, então foi movido um servidor da LUN para outra e assim tornando o servidor bdd7562lx104 disponível novamente.', 2, 271, 3, 441, '2018-05-08 08:16:35'),
