('INC000002092464', '2018-04-24 11:20:20', '2018-04-24 13:35:52', 'Serviço Afetado* :&#9;COMERCIAL&#10;Números Afetados:&#9;3004 1105 – 0800 726 0505&#10;Localidade Afetada :&#9;CERAT/BR&#10;&#10;Descrição* :&#9;Foi identificado uma ocorrência AB1 na CERATBR:&#10;- FILA: OPERACOES_CREDITO 8,64% &#10;- Início da Ocorrência: 11:19', 'Informamos que realizamos a análise das ligações da Fila OPERAÇÕES_CRÉDITO da CERATBR e identificamos que não há agentes disponíveis para atender as ligações de imediato, bem como os agentes são Multi Skill conforme evidência em anexo. Isso significa que os clientes estão sujeitos de abandonarem as ligações enquanto estão na fila de espera, inclusive no primeiro intervalo, gerando AB1. Realizamos teste de ligação com sucesso, ficando em Fila até ser atendido. Com isso, não caracteriza falha de telefonia. E também, no presente momento o percentual de AB1 diminuiu gradativamente (7%).', 9, 172, 2, 208, '2018-05-08 08:16:35');
