('INC000002093301', '2018-04-21 04:20:01', '2018-04-21 12:16:59', 'A validação diária da configuração das regras de retorno de fornecedor externo encontrou as seguintes divergências: &#10;&#10;-  Não foi localizada a unidade 7448-GITEC no formulário de cadastro de unidade.', 'Sustentação', 14, 58, 1, 124, '2018-05-08 08:16:35'),
('INC000002093304', '2018-04-24 04:20:01', '2018-04-24 10:31:20', 'A validação diária da configuração das regras de retorno de fornecedor externo encontrou as seguintes divergências: &#10;&#10;-  Não foi localizada a unidade 7448-GITEC no formulário de cadastro de unidade.', 'Chamado aberto para solução definitiva - REQ000025473808', 14, 58, 1, 124, '2018-05-08 08:16:35'),
('INC000002094620', '2018-04-24 11:10:46', '2018-04-24 15:29:12', 'À&#10;CETEC,&#10;&#10;&#10;1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com extrema lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;Período da Ocorrência:&#10;- Data Início: 24/04/2018                                                 &#10;- Hora Início: 11h00', 'Prezado(a), boa tarde.&#10;&#10;Ambiente normalizado.&#10;&#10;Por favor, realize LOGOUT, limpeza de cache nos navegadores (ctrl+shift+del) e um novo login.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002094646', '2018-04-25 10:12:12', '2018-04-25 10:31:37', 'Prezados(as), &#10;&#10;1.&#9;Informamos que o ITSM (serviços.caixa) encontra-se com extrema lentidão no que tange os módulos de Incidente, Serviço e Mudanças.&#10;&#10;2.&#9;Afim de que a CETEC avalie a situação e proceda com as tratativas necessárias à normalização.&#10;&#10;Período da Ocorrência:&#10;- Data Início: 25/04/2018                                                 &#10;- Hora Início: 10h00', 'Prezada Usuária,&#10;&#10;1. Após análise nos servidores da aplicação, não identificamos falhas ou lentidão.&#10;&#10;2. Sendo assim, favor realizar a limpeza completa de cache do navegador (Ctrl + Shift + Del) e efetuar novos testes.&#10;&#10;3. Estamos à disposição para maiores informações.&#10;&#10;Atenciosamente,&#10;&#10;Calebe Alves Rosa&#10;Equipe Sustentação - GSC', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002094843', '2018-04-24 13:58:10', '2018-04-24 14:13:23', 'Informamos que o SIMOL está indisponível.&#10;&#10;Ao entrar com o endereço simol.caixa não carrega.', 'Informamos que o sistema está funcionando normalmente, confirmado com usuário sem nenhuma intervenção técnica.&#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', 3, 277, 3, 453, '2018-05-08 08:16:35'),
('INC000002094881', '2018-04-25 10:24:30', '2018-04-25 11:15:37', 'Prezados,&#10;&#10;Informamos ab1 acima de 8% na fila PROGRAMAS_SOCIAIS serviço CIDADAO &#34;0800 726 0207&#34; na CERATSA.&#10;&#10;Atenciosamente,&#10;&#10;Central de Atendimento e Monitoração&#10;CETEC - CN Tecnologia da Informação&#10;61 3206 -1800', 'Informamos que, após novo estudo, não identificamos falhas de telefonia no ambiente da CERATSA que justifiquem índice maior de AB1.&#10;No entanto, observamos que a CERATSA muitas vezes não possui agentes disponíveis para atendimento, gerando ligações em fila, e consequentemente, os clientes estão suscetíveis a desconectarem as chamadas em qualquer um dos intervalos, inclusive no primeiro intervalo, gerando AB1.&#10;Evidencia-se possível falha de telefonia quando ocorre o sintoma de alto índice de abandono no primeiro intervalo (AB1) mesmo com operadores disponíveis, o que não é o caso. &#10;Segue em anexo análise.', 9, 172, 3, 208, '2018-05-08 08:16:35'),
('INC000002094918', '2018-04-23 16:43:59', '2018-04-23 16:55:46', 'MON 23 APR, 2018 -16=43=55&#10;HOUVE PERDA DE BGP NA COMUNICACAO COM A OPERADORA AMOB&#10;&#10;DESCRICAO= REDE2_CONC - DFRPECTC2_6/0/5_MOB_«533538»&#10;INTERFACE= DFRPECTC2-GIGABITETHERNET6/0/5&#10;IP CAIXA=192.168.249.33    IP OPERADORA=192.168.249.34&#10;--------&#10;*SOLICITAR CORREÇÃO, SE AS INFORMAÇÕES, ABAIXO, ESTIVEREM ERRADAS=&#10;&#10;      LOCAL   - CTC/DF - END. - BRASILIA-DF&#10;      CONTATO - CTC/DF (61)3206-2400&#10;--------&#10;&#10;ACOES=&#10;   ABRIR CHAMADO COM A OPERADORA AMOB.&#10;--------&#10;INFORMAÇÃO ADICIONAL DO CAMPO &#34;NOTES&#34; DO SPECTRUM=&#10;NENHUMA INFORMAÇÃO', 'Conforme verificado BGP apresentou uma breve queda, porém o mesmo já encontra-se estabilizado.', 10, 196, 1, 382, '2018-05-08 08:16:35'),
