('INC000002101601', '2018-04-26 13:20:14', '2018-04-26 13:53:47', 'Informamos que o SIGSC está com lentidão no acesso.&#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', '&#34;FECHAMENTO DE INCIDENTE&#10;DIAGNOSTICO:Está sendo verificado através do PBI000000127702 (Problem Investigation) as causas do travamento do host físico cadgersh0016 que sustentavam as VM&#39;s em questão.&#10;CAUSA RAIZ:Não identificado&#10;SOLUÇÃO DE CONTORNO:Solução automática Vsphere HA realocou os hosts após indisponibilidade, para outros host do cluster, gerando alerta de restart na monitoração&#34;', 8, 58, 1, 195, '2018-05-08 08:16:35'),
('INC000002101602', '2018-04-26 13:26:18', '2018-04-26 13:53:09', 'Indisponibilidade total do Serviço.Caixa e Relatórios.Caixa.&#10;Vimos que nos servidores virtuais abaixo foram reiniciados, e gostaríamos de saber o motivo dessa reinicialização&#10;apl7562lx163.df.caixa&#10;apl7562lx164.df.caixa&#10;apl7562lx064.df.caixa&#10;cctdcapllx0199.df.caixa', '&#34;FECHAMENTO DE INCIDENTE&#10;DIAGNOSTICO:Está sendo verificado através do PBI000000127702 (Problem Investigation) as causas do travamento do host físico cadgersh0016 que sustentavam as VM&#39;s em questão.&#10;CAUSA RAIZ:Não identificado&#10;SOLUÇÃO DE CONTORNO:Solução automática Vsphere HA realocou os hosts após indisponibilidade, para outros host do cluster, gerando alerta de restart na monitoração&#34;', 2, 58, 3, 194, '2018-05-08 08:16:35'),
('INC000002101727', '2018-04-27 11:05:49', '2018-04-27 11:52:13', 'Informamos que não está sendo possível abrir os documentos &#34;Manual do Usuário&#34; e &#34;Manual do Webservice&#34; do sistema SIVCB.Informamos que os documentos devem estar na pasta &#34;/var/sistemas/sivcb/manual_usuario&#34; com os nomes &#34;SIVCB_Manual_do_UsuarioExterno.pdf&#34; e &#34;SIVCB_Manual_do_UsuarioInterno.pdf&#34; e deve constar no system properties do Jboss de aplicação da forma abaixo:&#10;        &#60;property name=&#34;br.gov.cef.sivcb.caminho.manual.usuario.externo&#34; value=&#34;/var/sistemas/sivcb/manual_usuario/SIVCB_Manual_do_UsuarioExterno.pdf&#34;/&#62;&#10;        &#60;property name=&#34;br.gov.cef.sivcb.caminho.manual.usuario.interno&#34; value=&#34;/var/sistemas/sivcb/manual_usuario/SIVCB_Manual_do_UsuarioInterno.pdf&#34;/&#62;', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas: &#10;&#10;DIAGNOSTICO:Verificado que as properties que são necessarias para o donwload dos manuais não estavam presentes. &#10;&#10;CAUSA RAIZ: Faltando configurações de propriedades da aplicação no jboss &#10;&#10;SOLUÇÃO DE CONTORNO:Realizar  criação das properties e efetuadas as permissões de acesso necessarias. Porém o erro persiste. O solicitante irar entrar em contato com o responsavél pela aplicação', 2, 287, 2, 474, '2018-05-08 08:16:35'),
('INC000002101744', '2018-04-27 17:25:50', '2018-05-03 10:40:24', 'RTC 4904786&#10;Indisponibilidade da máquina Servidor / CS7261ET135 IP: 172.27.9.222 localizado nas dependências da Caixa, conforme e-mail em anexo.', '1. Conforme contato com Luiz Cláudio da Datamec nesta data, o mesmo confirmou que o servidor está operacional.&#10;&#10;2. Está sendo alinhado o fluxo correto para o tratamento dos incidentes referentes à este servidor, entre o Coordenador de Projetos Cesar Albuquerque (CEPTISP), CETEC27 e CEPTISP20, a qual será responsável pelos futuros atendimentos.', 18, 290, 1, 481, '2018-05-08 08:16:35'),
