('INC000002215107', '2018-05-03 14:16:57', '2018-05-03 17:43:09', 'À&#10;CETEC&#10;&#10;&#10;Após o retorno do SIGSC, depois da atualização efetuada, não estou mais conseguindo editar os relatórios que foram gerados pelo meu User. A opção editar não está mais disponível. &#10;&#10;São relatórios diários, semanais e mensais onde é necessário efetuar alterações em alguns campos antes de efetuar a execução (alteração de datas, horas). Os relatórios são utilizados para os fechamentos mensais de atendimento de nossos contratos terceirizados.&#10;&#10;Solicito regularização e retorno da possibilidade de editar os relatórios previamente gravados no SIGSC.', '', 8, 58, 1, 483, '2018-05-08 08:16:35'),
('INC000002215144', '2018-05-04 10:04:31', '2018-05-04 12:14:58', 'Tipo: Páginas Web&#10;Tipo de Evento: Mensagem de Erro no Sistema&#10;Serviço: GECON&#10;Descrição: Não estamos conseguindo fechar o chamado WO0000030350025 no GECON. Eles apresentam a mensagem: &#10;Chamado WO0000030350025  não encontrado na base! Para que seja verificado o motivo do mesmo não estar cadastrado na base de dados, orientamos realizar a abertura de chamado no GSC relatando a situação, para que a equipe responsável possa realizar as devidas verificações.&#10;Contrato 14803/2017', 'Informamos que o referido conta na base, com a respectiva designação, vinculado ao contrato 14803/2017.&#10;Esclarecemos que devido a migração do GSC alguns processo relacionados ao RAT Sistemas/GECON foram prejudicados mas esta regularizando gradativamente devido o tempo de paralisação.&#10;&#10;Atenciosamente,&#10;&#10;Elildo Reis&#10;Equipe Pagadoria&#10;Gestão Stefanini/CETEC', 4, 46, 3, 135, '2018-05-08 08:18:52'),
('INC000002215146', '2018-05-04 10:18:51', '2018-05-04 11:49:41', 'Serviço Afetado : COMERCIAL&#10;Números Afetados:&#9;3004 1105 – 0800 726 0505&#10;Localidade Afetada : CERAT/SA&#10;Descrição: Foi identificado uma ocorrência AB1 na CERATSA:&#10;- FILA: OPERACOES_CREDITO  - 10,2% &#10;- Início da Ocorrência: 10:15 &#10;&#10;Atenciosamente,&#10;CETEC – CN Tecnologia da Informação&#10;Central de Atendimento e Monitoração - STEFANINI', '', 9, 172, 2, 208, '2018-05-08 08:18:52'),
('INC000002215309', '2018-05-03 15:42:55', '2018-05-03 16:53:53', 'GITECBR - Conforme conversado com o Coordenador do PROINFO - WAGNER, estamos com indisponibilidade no servidor clusterizado da GECRM 494. Seque em anexo descrição do erro. contato Carla - 3206-5948', 'Incidente trata-se de outro sistema, que não o IC 7562APL-SIREL. Conforme nota e anexos, trata-se de cluster de responsabilidade de outra equipe.', 2, 293, 3, 485, '2018-05-08 08:16:35'),
