('INC000002216522', '2018-05-05 17:04:37', '2018-05-05 18:21:53', 'Informamos que foi identificado a indisponibilidade do circuito (CEPTISP_CSEXTRRR101_Gi4/0/0.152_CEF_CETIP_FILE-TRANS_CS0000SW107_P12_WCS_10Mb_&#60;AC086002-FAS377&#62;), tráfego redirecionado para (CEPTISP_CSEXTRRR102_Gi4/0/0.145_CEF_CETIP-CAMPINAS_FILE-TRANSFER_CS000SW107_P12 10Gb DESIGNACAO: WCS-CETIP-7261).', 'Circuito indisponível.', 7, 94, 2, 734, '2018-05-08 08:18:52'),
('INC000002216844', '2018-05-07 07:34:21', '2018-05-07 07:44:56', '', 'Vide notas', 7, 249, 3, 11, '2018-05-08 08:18:52'),
('INC000002217720', '2018-05-07 13:59:00', '2018-05-07 14:59:28', 'O sistema está apresentando o ERRO 500 ao tentar efetuar solicitações no SIAPA, conforme imagem anexa.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;DIAGNOSTICO: Em analise juntamento com o solicitando a apresentação voltou a funcionar corretamente.&#10;CAUSA RAIZ:&#10;SOLUÇÃO DE CONTORNO: Realizado o restart da aplicação para a limpeza de cache.', 2, 272, 2, 582, '2018-05-08 08:18:52'),
('INC000002217904', '2018-05-07 12:01:01', '2018-05-07 12:14:34', 'BKB-DFTSRCTC2-G2/2/8&#60;=&#62;SCRSFNS4-G0/1.18_LV3_&#60;500008530&#62;', 'Conforme verificado circuito apresentou oscilação de 12 minutos, não sendo necessário a abertura de chamado.', 10, 22, 1, 735, '2018-05-08 08:18:52'),
('INC000002218010', '2018-05-07 11:20:39', '2018-05-07 12:21:19', 'Prezados,&#10;&#10;Conforme histórico abaixo, nos foi informado de que a rotina de importação dos manuais normativos estava operacional. Contudo, solicitamos a troca/atualização do arquivo txt referente aos manuais normativos vigentes pela REQ000025704141, esperando que na data de hoje o sistema atualizaria a importação, porém isso não ocorreu. Pedimos a verificação novamente da rotina no cron e seu acerto para que a importação do manual normativo seja feita corretamente. Segue tela anexada com a data desatualizada.&#10;&#10;&#10;RTC 3853476  Identificamos que uma rotina do sistema SIWMC, no ambiente de homologação, não está sendo realizada devido a uma outra rotina de geração de arquivos do sistema SISMN. A rotina é a geração de um arquivo TXT com a vigência dos manuais normativos do sistema SISMN. O sistema SIWMC não acessa o SISMN e busca esse arquivo. O SISMN é quem gera esse arquivo e o disponibiliza em uma pasta do sistema SIWMC que faz a leitura e importação do mesmo. Essa rotina do sistema SISMN já é executada para o sistema SIWMC no ambiente de produção sem problemas. Pedimos a verificação do problema e seu acerto para que possamos efetuar os testes necessários do sistema SIWMC antes de subir para a produção. (GITECBH05 - PEDES - 7435)&#10;As requisições abertas com o intuito de resolver o problema, sem solução, são: &#10;HMP - REQ000023752325&#10;PRD - REQ000023752307&#10;&#10;O endereço do servidor e pasta para a disponibilização do arquivo txt são:&#10;SIWMC - HMP&#10;https://scthmapllx0021.df.caixa:8543/siwmc/&#10;host scthmapllx0021&#10;scthmapllx0021.df.caixa has address 10.116.114.196&#10;pasta: /var/sistemas/siwmc/importar&#10;&#10;Segue também uma cópia do arquivo txt do ambiente de produção para exemplo e replicação em anexo. Nesse sentido, o arquivo gerado para o ambiente hmp deve ser o mesmo gerado para o ambiente PRD.&#10;&#10;Caso seja necessário, o ambiente PRD onde já é disponibilizado o arquivo txt com a vigência dos manuais normativos, e que deve continuar assim, é:&#10;SIWMC - PRD &#10;https://cctdcapllx0043.df.caixa:8643/siwmc/;&#10;host cctdcapllx0043&#10;cctdcapllx0043.df.caixa has address 10.123.8.82&#10;&#10;Pedimos que analisem as duas requisições informadas caso ainda haja alguma dúvida.&#10;&#10;Nos colocamos à disposição para quaisquer esclarecimentos.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;DIAGNOSTICO: Erro na importação de arquivos&#10;CAUSA RAIZ: S&#10;SOLUÇÃO DE CONTORNO:Conforme verificado juntamente com o solicitante, a importação dos dados apresentou erros devido ao script de banco que foi executado. O mesmo irá verificar os scripts , e abrirá uma nova requisição.', 2, 389, 1, 680, '2018-05-08 08:18:52'),
('INC000002218301', '2018-05-07 10:11:59', '2018-05-07 10:37:16', 'De acordo com informações da área gestora estão sendo apresentadas mensagens de &#39;Redirecionamento Incorreto&#39; na tentativa de acesso ao http://siiac.caixa por alguns usuários.&#10;A orientação de limpar o cache do browser (CTRL+SHIFT+DEL) e acessar em outra instância não tem sanado o problema (ver REQ000025691740).&#10;Como não houve implantação de versão do sistema recentemente, solicitamos verificar a infraestrutura, incluindo nginx e SIUSR.&#10;Tivemos problemas semelhantes com o SIEST na semana passada.', '“Prezados (a) informamos que este incidente foi resolvido com as seguintes medidas:&#10;DIAGNOSTICO:&#10;CAUSA RAIZ:&#10;SOLUÇÃO DE CONTORNO: Em contato com a solicitante, foi informado que todas as instancias  da aplicação estão funcionando corretamente. A mesma informou que o ocrrido foi na quinta feira da semana passada 03/05/2018, na sexta ja tinha sido realizado todo o restar do ambiente do SIIAC.', 2, 59, 3, 586, '2018-05-08 08:18:52'),
('INC000002218400', '2018-05-07 10:22:17', '2018-05-07 11:40:54', 'Caderno Ti indisponível&#10;http://cadernoti.caixa/arsys/forms/df7562sr005/PDL:PD_Console/?username=catalogo&#38;pwd=catalogo&#10;&#10;Quando acessado aparece mensagem:&#10;&#34;Ocorreram os seguintes erros ao tentar processar sua solicitação:&#10;ARERR [91]&#10;Message not in catalog; Message number = 91 : ONC/RPC call timed out  &#34;', '“Prezados informamos que este incidente foi resolvido com as seguintes medidas:&#10;DIAGNOSTICO: &#10;&#34;Ocorreram os seguintes erros ao tentar processar sua solicitação: &#10;ARERR [91] &#10;Message not in catalog; Message number = 91 : ONC/RPC call timed out  &#34;&#10;&#10;CAUSA RAIZ:&#10;Servidor df7562sr005 de origem da aplicação estava lento e travando.&#10;&#10;SOLUÇÃO DE CONTORNO:&#10;Informamos que após verificar os logs no servidor df7562sr004, foi preciso reiniciar o servidor df7562sr005 porque estava lento e travando impossibilitando o funcionamento correto da aplicação. Feito os testes no portal cadernoti.caixa é o mesmo já está acessível. &#10;&#10;Estamos à disposição para mais esclarecimentos.', 2, 403, 3, 736, '2018-05-08 08:18:52'),
('INC000002218504', '2018-05-07 12:00:57', '2018-05-07 12:15:11', '', 'Circuito normalizado durante verificação não havendo necessidade de acionamento da operadora.', 10, 22, 3, 737, '2018-05-08 08:18:52'),
('INC000002218506', '2018-05-07 12:06:44', '2018-05-07 16:55:33', 'Tipo: Páginas Web&#10;Tipo de Evento: Indisponibilidade&#10;Serviço: INTEGRAÇÃO GSC&#10;Descrição: Fornecedores alegam que o campo descrição da REQ não está sendo mapeado para o campo detalhe da WO. Exemplos: &#10;WO0000030407759 / WO0000030408525', 'Conforme conversado pelo Lync, neste caso será necessário abrir uma solicitação de alteração de requisição.&#10;&#10;Atenciosamente,&#10;Equipe Sustentação GSC&#10;Thiago Carvalho', 8, 58, 2, 135, '2018-05-08 08:18:52'),
('INC000002218524', '2018-05-07 16:39:38', '2018-05-07 17:18:52', 'Servidor CCTDCAPLNT0261 está indisponível.&#10;Real Sistema Afetado: Portal Jurídico', '', 6, 404, 3, 420, '2018-05-08 08:18:52'),
('INC000002218529', '2018-05-07 18:08:30', '2018-05-07 19:29:05', 'Favor verificar a indisponibilidade/retenção de processamento no SIAGS - PRD.', 'Prezados (a),&#10;&#10;informamos que este incidente foi resolvido com as seguintes medidas:&#10;DIAGNOSTICO: O número de requisições para o serviço de agendamento estava muito alto.&#10;CAUSA RAIZ: Em análise&#10;SOLUÇÃO DE CONTORNO: Foi reiniciado o serviço  Benner Tasks Worker [SAUDEPRD]&#34;   dos servidores de agendamento do SIAGS, normalizando as requisições.&#10;&#10;Att,&#10;&#10;Equipe Mais2X', 2, 52, 3, 186, '2018-05-08 08:18:52'),
